(2, 4, 'Chuyện Gì Đã Xảy Ra Trong Linh Miêu: Quỷ Nhập Tràng?', 'chuyen-gi-da-xay-ra-trong-linh-mieu:-quy-nhap-trang?', 'Để chuẩn bị cho cuộc đổ bộ phòng vé tháng 11 năm nay, Linh Miêu: Quỷ Nhập Tràng tiếp tục “nhá hàng” những hình ảnh tiết lộ thêm về nguồn gốc của lời nguyền. Khi mà giờ đây, trong gia đình phát hiện có người đã làm tà thuật để kết hợp rắn hổ mang và mèo đe', '673072a4669e3.jpg', 'blog', 'Để chuẩn bị cho cuộc đổ bộ phòng vé tháng 11 năm nay, Linh Miêu: Quỷ Nhập Tràng tiếp tục “nhá hàng” những hình ảnh tiết lộ thêm về nguồn gốc của lời nguyền. Khi mà giờ đây, trong gia đình phát hiện có người đã làm tà thuật để kết hợp rắn hổ mang và mèo đe', 'Venom', 3, '2024-11-10 09:35:08', 3, '2025-03-25 21:39:25', 0),
(3, 4, 'Đếm 500 Cameo Từ Deadpool & Wolverine', 'dém-500-cameo-tù-deadpool-&-wolverine', 'Là canh bạc lớn Marvel Studios đối phó cơn thoái trào dòng phim siêu anh hùng, Deadpool & Wolverine tung ra hàng loạt chiêu bài lôi kéo khán giả. Dĩ nhiên, những quả trứng Phục Sinh liên quan đến các dự án siêu anh hùng cũ và mới là yếu tố cực kì quan trọng để nhà sản xuất “câu khách”! Stars nắm được bao nhiêu chi tiết ẩn khi xem bộ phim chiếu rạp này? Happy Hogan Từ vai trò tài xế cho Tony Stark, Happy thăng tiến tốc độ chóng mặt và nay đã ngồi vào ghế phỏng vấn tuyển dụng ở  tập đoàn Stark. Không may, Happy thẳng thừng từ chối Wade Wilson dù gã phản anh hùng có màn phỏng vấn xin việc cực kì ấn tượng. Henry Cavill Chỉ xuất hiện đúng một cảnh quay, Henry Cavill và bắp tay khổng lồ gây ấn tượng cực kì sâu sắc. Dù rất nhiều lời đồn đoán rằng “Harry Potter” Daniel Radcliffe sẽ vào vai Wolverine bản mới, có lẽ, Henry Cavill mới là lựa chọn thích hợp hơn. Deadpool còn khẳng định Marvel trả lương cao hơn DC! Johnny Thiên Thần Chắc chắn, khoảnh khắc Chris Evans thốt ra “Flame on!” là một trong những cảnh phim đáng nhớ nhất Deadpool & Wolverine. Những khán giả xem phim siêu anh hùng từ những năm đầu thế kỉ chắc hẳn khó quên Johnny Storm háo thắng bốc đồng ở Fantastic Four (2005) và Fantastic Four: Rise of the Silver Surfer (2007). Những năm gần đây, Chris Evans ghi dấu ấn toàn cầu nhờ hình ảnh “thanh niên nghiêm túc” Captain America. Steve đĩnh đạc thích nhắc nhở các đồng đội “language” trong các bộ phim thuộc vũ trụ điện ảnh Marvel và Human Torch trẻ trâu khác nhau quá đỗi. Công chúng còn đùa vui rằng, xét bản tính tếu táo ngoài đời, Johnny Storm gần với Chris Evans hơn Steve Rogers nhiều.  Gambit Khoảng năm 2014, Fox muốn sản xuất Gambit và chọn Channing Tatum làm nam chính. Thế nhưng, dự án này đã chết yểu trước khi ra mắt. Cáo về tay nhà Chuột, bộ phim riêng cho “thần bài” trở thành điệp vụ bất khả thi. Chính bản thân Channing Tatum cũng chẳng ít lần bày tỏ nỗi thất vọng vì không thể diễn nhân vật này trên màn ảnh. May mắn thay, Deadpool & Wolverine tặng anh cơ hội được khoác lên người tạo hình ngày nhớ đêm mong ấy. “Gambit” Channing Tatum rất thích nói những câu đạo lí, thi thoảng chèn vào lời tự sự về thân phận chẳng biết có tồn tại hay không của bản thân. Dẫu sao thì, Channing Tatum lỡ mất Gambit biết đâu lại tốt, bởi hầu hết công chúng đều bày tỏ Taylor Kitsch (Gambit trong X-Men Origins: Wolverine) hợp vai hơn hẳn. Elektra và Blade Ở tuổi 52, Jennifer Garner vẫn quá đẹp ở tạo hình Elektra bản 2024. Nữ chiến binh từng làm mưa làm gió một thời bởi thân hình quá quyến rũ dù tác phẩm lỗ chổng vó tại các rạp chiếu phim toàn cầu. Khác với Elektra, Blade do Wesley Snipes thủ vai thành công hơn hẳn, sản xuất tận 3 phần. Đặc biệt, Blade: Trinity còn Ryan Reynolds góp mặt. Trong Deadpool & Wolverine, Deadpool nói rằng anh là Blade duy nhất. Đây có phải là dấu hiệu cho thấy Blade phiên bản mới của Mahershala Ali sẽ chìm vào quên lãng mãi mãi? Suốt 5 năm qua, Blade đã đổi biên kịch nhiều lần, vẫn chưa đi vào quá trình sản xuất và Mahershala Ali cũng vắng bóng tại Comic-Con San Diego vừa qua. Xưa nay, không ít lần Marvel Studios ra tay “xử trảm” những dự án từng được kì vọng nếu cảm thấy chúng lỗi thời. Inhumans là ví dụ điển hình. Tại kì Comic-Con lần này, Marvel Studios đã công bố hàng loạt dự án cho các năm 2025-2026: - Captain America: Brave New World (Dự kiến khởi chiếu 14.02.2025) - Thunderbolts (Dự kiến khởi chiếu 05.2025) - The Fantastic Four: First Steps (Dự kiến khởi chiếu 07.2025) - Avengers: Doomsday (Dự kiến khởi chiếu 05.2026) - Avengers: Secret Wars (Dự kiến khởi chiếu 05.2027) Cơ hội dành cho Blade dường như chẳng còn! X-23 Năm 2017, cuộc phiêu lưu đầy máu của Logan và cô bé X-23 Laura đã lấy đi hàng lít nước mắt  khán giả. Thật tuyệt vời khi lại thấy Hugh Jackman và Dafne Keen xuất hiện chung khung hình ở Deadpool & Wolverine. Dù không nhiều đất diễn, Laura chứng minh rõ ràng rằng cô bé xứng đáng với sự hi sinh của Logan!  Avengers Iron Man, Captian America và Thor – những Avengers kì cựu cũng được nhắc đến trong Deadpool & Wolverine. Điều này phần nào chứng minh Trái Đất 10005 mà Wade Wilson đang sống vẫn là vũ trụ gốc – cốt lõi MCU. Dẫu vậy, với một tác phẩm nhiều lần phá vỡ “bức tường thứ 4” như Deadpool & Wolverine, không gì là chắc chắn cả. Spiderman SpideyPool là bộ đôi được yêu thích hàng đầu dàn comic Marvel. Trong Deadpool & Wolverine, khoảnh khắc trên xe, Deadpool dùng cử chỉ phóng tơ của Người Nhện. Thêm vào đó, câu thoại “Mọi Deadpool đều có một Peter.” tiếp tục ẩn ý về Peter Parker lừng danh. Liệu người hâm mộ SpideyPool có cơ hội chứng kiến màn song kiếm hợp bích trên màn ảnh rộng? Và nếu điều tuyệt vời ấy xảy ra thì Tobey Maguire, Andrew Garfield hay Tom Holland sẽ là Người Nhện sánh vai cùng “Deadpool” Ryan Reynolds? X-Men Deadpool & Wolverine dành một đoạn phim tri ân vũ trụ điện ảnh Marvel thuộc Fox với những dị nhân quen thuộc như Charlie Xavier (Patrick Stewart / James McAvoy), Magneto (Ian McKellen / Michael Fassbender), Mystique, Jean Grey, Cyclops, Storm, Quicksilver… Hiện vẫn chưa có thông tin nào việc Marvel sẽ sử dụng dàn diễn viên cũ hay tuyển diễn viên mới cho các phim tiếp theo về Dị Nhân. Credit suýt có Doctor Doom Cùng với việc Deadpool & Wolverine làm mưa làm gió tại các rạp chiếu phim toàn cầu, Marvel Studios àm dậy sóng tại Comic-Con vì hé lộ Robert Downey Jr. tiếp tục đeo lên chiếc mặt nạ mới và trở thành phản diện Doctor Doom. Được biết, sau khi diễn viên thủ vai Kang - Jonathan Majors vướng vòng lao lí, hãng từng liên lạc với Robert Downey Jr. về việc quay lại MCU. Marvel cũng lên kế hoạch cho Doctor Doom xuất hiện ở credit Deadpool & Wolverine. Tuy nhiên, việc này không thành vì lúc đó Robert từ chối. Thời gian sau, ngôi sao đoạt tượng vàng Oscar năm nay mới gật đầu. Dẫu sao, thay Doctor Doom bùng nổ, Deadpool & Wolverine bù lại bằng một after credit cực hài, chắc chắn sẽ khiến khán giả cười ngất ngay cả lúc đã ra khỏi rạp chiếu phim.', '673073b3bdae8.jpg,673073b3bdc3f.jpg', 'blog', 'Là canh bạc lớn Marvel Studios đối phó cơn thoái trào dòng phim siêu anh hùng, Deadpool & Wolverine tung ra hàng loạt chiêu bài lôi kéo khán giả. Dĩ nhiên, những quả trứng Phục Sinh liên quan đến các dự án siêu anh hùng cũ và mới là yếu tố cực kì quan trọng để nhà sản xuất “câu khách”!', 'Cameo', 3, '2024-11-10 09:40:51', 3, '2025-03-25 21:39:27', 0),
(4, 4, 'Mickey 17: Châm Biếm Trò Hề Của Tư Bản?', 'mickey-17:-cham-biem-tro-he-cua-tu-ban?', 'Kickey 17 là tác phẩm khoa học viễn tưởng đầy tham vọng của đạo diễn Bong Joon Ho, dựa trên tiểu thuyết  của Edward Ashton. Phim mở ra viễn cảnh tương lai nơi nhân loại chinh phục vũ trụ bằng phương thức vượt qua giới hạn sinh học. Nhân vật chính, một \"Expendable\" – tức cá thể nhân bản mang tên Mickey, được lập trình để thực hiện những nhiệm vụ nguy hiểm nhất, hy sinh rồi tái sinh liên tục theo vòng tuần hoàn. Tuy nhiên, khi nhận thức bản thân dần thay đổi, anh đối mặt với hàng loạt câu hỏi về bản chất sinh tồn.', '67da81c733b32.jpg', 'blog', 'hey', 'mickey17', 3, '2025-03-19 15:35:19', 3, '2025-03-25 21:39:28', 0),
(5, 4, '[Review] Flow: Kịch Bản Là Thứ Quan Trọng Nhất!', '[review]-flow:-kich-ban-la-thu-quan-trong-nhat!', 'Nếu là người thích hoài niệm về thời xưa cũ, Flow  gợi nhớ đến những phim câm kinh điển thế kỉ 20. Ai đam mê điện ảnh mà chưa từng say mê loạt phim câm từ ông hoàng Charlie Chaplin hay quen thuộc với tuổi thơ hơn cả là câu chuyện huyền thoại. Đoàn phim đã sử dụng giọng thật của các con vật để lồng tiếng. Kĩ sư âm thanh đã vào tận sở thú thu tiếng capybara. Tuy nhiên, giọng chuột lang nước lại chưa phù hợp tính cách nhân vật. Cuối cùng, đoàn phim quyết định “nhờ” một bạn lạc đà thay thế. Ngoài ra, phải cảm ơn cô mèo cam Miut đã lồng tiếng thật truyền cảm cho mèo xám. Nhờ tiếng kêu meo chạm tới tận con tim, dù người xem nào phải “nhà meo học” cũng hiểu được em mèo xám muốn thể hiện cảm xúc gì. Tương tự, tiếng chó sủa mỗi lần đều mang sắc thái khác nhau.', '67da824ceb91d.jpg', 'blog', 'hehe', 'flow', 3, '2025-03-19 15:37:32', 3, '2025-03-25 21:39:29', 0),
(6, 7, 'ĐÃI BẠN SIÊU THÂN', 'dai-ban-sieu-than', 'ĐÃI BẠN SIÊU THÂN\r\n+ Tặng ngay 01 PEPSI “ĐÃ KHÁT” khi mua 2 vé xem phim suất chiếu trước 19h.\r\n+ Chỉ với 59.000đ có ngay COMBO “ĐÃ KHÁT ĐÃ THÈM” (1 Bắp + 1 nước).\r\n* Ưu đãi áp dụng từ: 04.01.2025 – 28.01.2025.\r\n\r\n* Áp dụng cho tất cả các cụm rạp tại Hồ Chí Minh, Hà Nội và Huế.\r\n\r\n* Số lượng có hạn trong ngày.', '67e2bf0e5735b.jpg', 'tintuc', '+ Tặng ngay 01 PEPSI “ĐÃ KHÁT” khi mua 2 vé xem phim suất chiếu trước 19h.\r\n+ Chỉ với 59.000đ có ngay COMBO “ĐÃ KHÁT ĐÃ THÈM” (1 Bắp + 1 nước).\r\n* Ưu đãi áp dụng từ: 04.01.2025 – 28.01.2025.\r\n\r\n* Áp dụng cho tất cả các cụm rạp tại Hồ Chí Minh, Hà Nội và Huế.\r\n\r\n* Số lượng có hạn trong ngày.', '#daibansieuthan', 3, '2025-03-25 21:34:10', 3, '2025-03-25 21:34:54', 1),
(7, 8, 'OPERA HOUSE', 'opera-house', 'OPERA HOUSE\r\nChứng kiến sự hùng vĩ ở trung tâm thành phố\r\n\r\nTrải nghiệm những buổi biểu diễn nghệ thuật đẳng cấp tại Nhà Hát Lớn Đà Lạt mang tính biểu tượng, đang ẩn mình trong kiệt tác kiến trúc Tòa nhà Hoa Hướng Dương tại Quảng trường Lâm Viên.\r\n\r\nNhững sự kiện khó quên: Chứng kiến các buổi hòa nhạc, vở kịch, cuộc thi sắc đẹp, dạ tiệc và các tác phẩm hoành tráng trong không gian tuyệt đẹp.\r\n\r\nCông nghệ hiện đại: Đắm mình trong hệ thống âm thanh và ánh sáng chuyên nghiệp nâng tầm mọi màn trình diễn.\r\n\r\nVị trí đắc địa và thuận tiện ngay trung tâm Đà Lạt, tăng thêm trải nghiệm khó quên.\r\n\r\nNhà Hát Lớn Đà Lạt - Nơi hội tụ những tuyệt tác hiện đại', '67e2bf77c0889.png', 'tintuc', 'Chứng kiến sự hùng vĩ ở trung tâm thành phố\r\n\r\nTrải nghiệm những buổi biểu diễn nghệ thuật đẳng cấp tại Nhà Hát Lớn Đà Lạt mang tính biểu tượng, đang ẩn mình trong kiệt tác kiến trúc Tòa nhà Hoa Hướng Dương tại Quảng trường Lâm Viên.\r\n\r\nNhững sự kiện khó quên: Chứng kiến các buổi hòa nhạc, vở kịch, cuộc thi sắc đẹp, dạ tiệc và các tác phẩm hoành tráng trong không gian tuyệt đẹp.\r\n\r\nCông nghệ hiện đại: Đắm mình trong hệ thống âm thanh và ánh sáng chuyên nghiệp nâng tầm mọi màn trình diễn.\r\n\r\nVị trí đắc địa và thuận tiện ngay trung tâm Đà Lạt, tăng thêm trải nghiệm khó quên.\r\n\r\nNhà Hát Lớn Đà Lạt - Nơi hội tụ những tuyệt tác hiện đại', '#OPERAHOUSE', 3, '2025-03-25 21:36:39', 3, '2025-03-25 21:36:39', 1),
(8, 9, 'C’STUDENT - 45K CHO HỌC SINH SINH VIÊN', 'c’student---45k-cho-hoc-sinh-sinh-vien', 'C’STUDENT - 45K CHO HỌC SINH SINH VIÊN \r\nĐồng giá 45K/2D cho HSSV/GV/U22 cả tuần tại mọi cụm rạp Cinestar\r\n\r\nĐiều kiện\r\n\r\nHSSV xuất trình thẻ HSSV hoặc CCCD từ dưới 22 tuổi.\r\nGiảng viên/ giáo viên xuất trình thẻ giảng viên.\r\nLưu ý\r\n\r\nMỗi thẻ mua được một vé.\r\nKhông áp dụng cho các ngày Lễ, Tết, hoặc suất chiếu có phụ thu từ nhà phát hành phim.', '67e2bfd4f0262.png', 'tintuc', 'Đồng giá 45K/2D cho HSSV/GV/U22 cả tuần tại mọi cụm rạp Cinestar\r\n\r\nĐiều kiện\r\n\r\nHSSV xuất trình thẻ HSSV hoặc CCCD từ dưới 22 tuổi.\r\nGiảng viên/ giáo viên xuất trình thẻ giảng viên.\r\nLưu ý\r\n\r\nMỗi thẻ mua được một vé.\r\nKhông áp dụng cho các ngày Lễ, Tết, hoặc suất chiếu có phụ thu từ nhà phát hành phim.', 'C’STUDENT - 45K CHO HỌC SINH SINH VIÊN', 3, '2025-03-25 21:38:12', 3, '2025-03-25 21:38:12', 1),
(9, 9, 'C\'TEN - HAPPY HOUR - 45K/ 2D MỐC 10H', 'c-ten---happy-hour---45k/-2d-moc-10h', 'C\'TEN - HAPPY HOUR - 45K/ 2D MỐC 10H \r\nÁp dụng giá 45K/ 2D và 55K/ 3D cho khách hàng xem phim trước 10h sáng và sau 10h tối.\r\n\r\nĐiều kiện\r\n\r\nÁp dụng tại App/Web Cinestar hoặc mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nKhông áp dụng cho các ngày lễ/tết.', '67e2bfea3d6cf.png', 'tintuc', 'Áp dụng giá 45K/ 2D và 55K/ 3D cho khách hàng xem phim trước 10h sáng và sau 10h tối.\r\n\r\nĐiều kiện\r\n\r\nÁp dụng tại App/Web Cinestar hoặc mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nKhông áp dụng cho các ngày lễ/tết.', 'C\'TEN - HAPPY HOUR - 45K/ 2D MỐC 10H', 3, '2025-03-25 21:38:34', 3, '2025-03-25 21:38:34', 1),
(10, 9, 'C\'MONDAY - HAPPY DAY - ĐỒNG GIÁ 45K/ 2D', 'c-monday---happy-day---dong-gia-45k/-2d', 'C\'MONDAY - HAPPY DAY - ĐỒNG GIÁ 45K/ 2D \r\nĐồng giá 45K/2D, 55K/3D vào thứ 2 hàng tuần\r\n\r\nĐiều kiện\r\n\r\nÁp dụng cho các suất chiếu vào ngày thứ 2 hàng tuần.\r\nMua vé trực tiếp tại App/Web Cinestar hoặc mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nKhông áp dụng cho các ngày lễ/tết', '67e2bffe160f7.jpg', 'tintuc', 'Đồng giá 45K/2D, 55K/3D vào thứ 2 hàng tuần\r\n\r\nĐiều kiện\r\n\r\nÁp dụng cho các suất chiếu vào ngày thứ 2 hàng tuần.\r\nMua vé trực tiếp tại App/Web Cinestar hoặc mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nKhông áp dụng cho các ngày lễ/tết', 'C\'MONDAY - HAPPY DAY - ĐỒNG GIÁ 45K/ 2D', 3, '2025-03-25 21:38:54', 3, '2025-03-25 21:38:54', 1),
(11, 9, 'C\'MEMBER - HAPPY MEMBER’S DAY - GIÁ CHỈ 45K/ 2D', 'c-member---happy-member’s-day---gia-chi-45k/-2d', 'C\'MEMBER - HAPPY MEMBER’S DAY - GIÁ CHỈ 45K/ 2D\r\nÁp dụng giá 45K/ 2D và 55K/ 3D cho khách hàng là thành viên Cinestar vào ngày thứ 4 hàng tuần.\r\n\r\nĐiều kiện\r\n\r\nKhách hàng là thành viên C’FRIEND hoặc C’VIP của Cinestar.\r\nÁp dụng khi mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nGiảm thêm 10% giá trị hóa đơn bắp nước cho chủ thẻ C’FRIEND và 15% cho chủ thẻ C’VIP.\r\nKhông áp dụng cho các ngày lễ/tết.', '67e2c00fb33ce.png', 'tintuc', 'Áp dụng giá 45K/ 2D và 55K/ 3D cho khách hàng là thành viên Cinestar vào ngày thứ 4 hàng tuần.\r\n\r\nĐiều kiện\r\n\r\nKhách hàng là thành viên C’FRIEND hoặc C’VIP của Cinestar.\r\nÁp dụng khi mua trực tiếp tại rạp.\r\nLưu ý\r\n\r\nGiảm thêm 10% giá trị hóa đơn bắp nước cho chủ thẻ C’FRIEND và 15% cho chủ thẻ C’VIP.\r\nKhông áp dụng cho các ngày lễ/tết.', 'C\'MEMBER - HAPPY MEMBER’S DAY - GIÁ CHỈ 45K/ 2D', 3, '2025-03-25 21:39:11', 3, '2025-03-25 21:39:11', 1),
(12, 9, 'CƠN BÃO “SALE” SIÊU KHỦNG TẠI BHD STAR', 'con-bao-“sale”-sieu-khung-tai-bhd-star', 'ĐÓN NHẬN CƠN BÃO “SALE” SIÊU KHỦNG KHIẾP TẠI BHD STAR CINEPLEX.\r\n\r\n+ Tặng ngay 01 PEPSI (trị giá 36.000đ) khi mua 2 vé xem phim bất kì.\r\n\r\n+ Chỉ với 59.000đ có ngay COMBO “ĐÃ KHÁT ĐÃ THÈM” (1 Bắp + 1 nước).\r\n\r\n* Ưu đãi áp dụng từ: 04.01.2024 – 28.01.2025 (Không giới hạn số lần sử dụng).\r\n\r\n* Áp dụng cho tất cả các cụm rạp tại Hồ Chí Minh, Hà Nội và Huế.', '67e2c054c642b.jpg', 'tintuc', 'ĐÓN NHẬN CƠN BÃO “SALE” SIÊU KHỦNG KHIẾP TẠI BHD STAR CINEPLEX.\r\n\r\n+ Tặng ngay 01 PEPSI (trị giá 36.000đ) khi mua 2 vé xem phim bất kì.\r\n\r\n+ Chỉ với 59.000đ có ngay COMBO “ĐÃ KHÁT ĐÃ THÈM” (1 Bắp + 1 nước).\r\n\r\n* Ưu đãi áp dụng từ: 04.01.2024 – 28.01.2025 (Không giới hạn số lần sử dụng).\r\n\r\n* Áp dụng cho tất cả các cụm rạp tại Hồ Chí Minh, Hà Nội và Huế.', 'CƠN BÃO “SALE” SIÊU KHỦNG TẠI BHD STAR', 3, '2025-03-25 21:40:20', 3, '2025-03-25 21:40:20', 1),
(13, 8, 'COMBO “ÁO THUN BHDS x SAIGONINK” SIÊU CHẤT', 'combo-“ao-thun-bhds-x-saigonink”-sieu-chat', 'Công nghệ in hiện đại mang lại những sản phẩm áo thun BST Halloween của BHDS & SaigonInk có hình in sắc nét, màu sắc sinh động', '67e2c0b24a690.jpg', 'tintuc', 'Công nghệ in hiện đại mang lại những sản phẩm áo thun BST Halloween của BHDS & SaigonInk có hình in sắc nét, màu sắc sinh động', 'COMBO “ÁO THUN BHDS x SAIGONINK” SIÊU CHẤT', 3, '2025-03-25 21:41:54', 3, '2025-03-25 21:41:54', 1),
(14, 9, 'COMBO “TÚI TOLE & QUAI XÁCH LY”', 'combo-“tui-tole-&-quai-xach-ly”', 'Mua combo bắp nước kèm túi tole hoặc quai xách ly siêu xinh với giá siêu ưu đãi', '67e2c0e60f080.jpg', 'tintuc', 'Mua combo bắp nước kèm túi tole hoặc quai xách ly siêu xinh với giá siêu ưu đãi', 'COMBO “TÚI TOLE & QUAI XÁCH LY”', 3, '2025-03-25 21:42:46', 3, '2025-03-25 21:42:46', 1),
(15, 9, 'Happy Day - Vé Chỉ Từ 45K', 'happy-day---ve-chi-tu-45k', 'Thưởng thức bom tấn cả ngày không lo về giá. \r\nƯu đãi 50.000đ/vé 2D áp dụng tại cụm rạp: Galaxy Linh Trung, Galaxy Quang Trung, Galaxy Long Xuyên, Galaxy GO!Mall Bà Rịa, Galaxy Đà Nẵng, Galaxy Vinh, Galaxy Cà Mau. \r\nƯu đãi 55.000đ/vé 2D áp dụng tại cụm rạp: Galaxy Tân Bình, Galaxy Nguyễn Du, Galaxy Kinh Dương Vương, Galaxy Trung Chánh, Galaxy Huỳnh Tấn Phát, Galaxy Nguyễn Văn Quá, Galaxy Trường Chinh, Galaxy Mipec Long Biên, Galaxy Bến Tre, Galaxy Hải Phòng, Galaxy Buôn Ma Thuột, Galaxy Nha Trang. Ưu đãi 70.000đ/vé 2D áp dụng tại rạp: Galaxy Sala. \r\nƯu đãi 45.000đ/vé 2D áp dụng tại rạp: Galaxy Aeon Huế. Ưu đãi 60.000đ/vé 2D áp dụng tại rạp: Galaxy Parc Mall Q8.\r\n', '67e2c142124c6.jpg', 'tintuc', 'Thưởng thức bom tấn cả ngày không lo về giá. \r\nƯu đãi 50.000đ/vé 2D áp dụng tại cụm rạp: Galaxy Linh Trung, Galaxy Quang Trung, Galaxy Long Xuyên, Galaxy GO!Mall Bà Rịa, Galaxy Đà Nẵng, Galaxy Vinh, Galaxy Cà Mau. \r\nƯu đãi 55.000đ/vé 2D áp dụng tại cụm rạp: Galaxy Tân Bình, Galaxy Nguyễn Du, Galaxy Kinh Dương Vương, Galaxy Trung Chánh, Galaxy Huỳnh Tấn Phát, Galaxy Nguyễn Văn Quá, Galaxy Trường Chinh, Galaxy Mipec Long Biên, Galaxy Bến Tre, Galaxy Hải Phòng, Galaxy Buôn Ma Thuột, Galaxy Nha Trang. Ưu đãi 70.000đ/vé 2D áp dụng tại rạp: Galaxy Sala. \r\nƯu đãi 45.000đ/vé 2D áp dụng tại rạp: Galaxy Aeon Huế. Ưu đãi 60.000đ/vé 2D áp dụng tại rạp: Galaxy Parc Mall Q8.\r\n', 'Happy Day - Vé Chỉ Từ 45K', 3, '2025-03-25 21:44:18', 3, '2025-03-25 21:44:18', 1),
(16, 9, 'Xem Phim Hay – Ngất Ngây Cùng Bánh Phồng Dế Rec Rec', 'xem-phim-hay-–-ngat-ngay-cung-banh-phong-de-rec-rec', 'Bánh Phồng Dế Rec Rec – Snack Dế giàu đạm nhiều dinh dưỡng. \r\nĐi xem phim nhâm nhi bắp rang từ lâu đã là một trải nghiệm quá quen thuộc, nếu vẫn còn phân vân giữa các vị bắp khác nhau thì Galaxy Cinema mời Stars “đổi gió” với snack Rec Rec ngon mà không nhàm chán! Bánh Phồng Dế Rec Rec mang nhiều hương vị đa dạng để Stars có cơ hội thưởng thức trọn vị thơm ngon đậm đà. Vị Mala: mang đến tinh túy từ Tứ Xuyên với vị cay kết hợp từ hạt tiêu và ớt, phù hợp với những ai muốn trải nghiệm sự kích thích vị giác một cách tuyệt đối. Vị Gochujang: Kết hợp các loại nguyên liệu bột đỏ, đậu ớt và đậu nành lên men để cho ra mùi vị ngọt ấm pha chút cay nhẹ. Dễ ăn dễ nghiện. Vị Tom Yum: Chất chua cay trong chanh, sả, ớt và riềng biến từng miếng snack thật đậm vị hấp dẫn mang dấu ấn rõ nét từ ẩm thực Thái Lan. Đến Galaxy Cinema thử ngay Bánh Phồng Dế Rec Rec – Snack Hảo Hạng Đồng Hành Cho Sức Khỏe Không Giới Hạn. \r\nThời gian: từ ngày 05.04.2024. Giá bán: 35.000vnđ/bịch (extra 25.000vnđ/bịch). \r\nĐịa điểm: Các cụm rạp Galaxy Cinema tại TP.HCM.', '67e2c195b7ac6.jpg', 'tintuc', 'Bánh Phồng Dế Rec Rec – Snack Dế giàu đạm nhiều dinh dưỡng. \r\nĐi xem phim nhâm nhi bắp rang từ lâu đã là một trải nghiệm quá quen thuộc, nếu vẫn còn phân vân giữa các vị bắp khác nhau thì Galaxy Cinema mời Stars “đổi gió” với snack Rec Rec ngon mà không nhàm chán! Bánh Phồng Dế Rec Rec mang nhiều hương vị đa dạng để Stars có cơ hội thưởng thức trọn vị thơm ngon đậm đà. Vị Mala: mang đến tinh túy từ Tứ Xuyên với vị cay kết hợp từ hạt tiêu và ớt, phù hợp với những ai muốn trải nghiệm sự kích thích vị giác một cách tuyệt đối. Vị Gochujang: Kết hợp các loại nguyên liệu bột đỏ, đậu ớt và đậu nành lên men để cho ra mùi vị ngọt ấm pha chút cay nhẹ. Dễ ăn dễ nghiện. Vị Tom Yum: Chất chua cay trong chanh, sả, ớt và riềng biến từng miếng snack thật đậm vị hấp dẫn mang dấu ấn rõ nét từ ẩm thực Thái Lan. Đến Galaxy Cinema thử ngay Bánh Phồng Dế Rec Rec – Snack Hảo Hạng Đồng Hành Cho Sức Khỏe Không Giới Hạn. \r\nThời gian: từ ngày 05.04.2024. Giá bán: 35.000vnđ/bịch (extra 25.000vnđ/bịch). \r\nĐịa điểm: Các cụm rạp Galaxy Cinema tại TP.HCM.', 'Xem Phim Hay – Ngất Ngây Cùng Bánh Phồng Dế Rec Rec', 3, '2025-03-25 21:45:41', 3, '2025-03-25 21:45:41', 1),
(17, 8, 'Thuê rạp /Sự kiện & Vé nhóm', 'thue-rap-/su-kien-&-ve-nhom', 'Bạn đang tìm giải pháp quảng cáo độc đáo để tăng doanh thu cho công ty?\r\n\r\nBạn muốn gửi quà tặng có ý nghĩa đến đối tác thay cho lời cảm ơn về mối hợp tác lâu bền?\r\n\r\nBạn muốn thưởng thức những bộ phim bom tấn thật riêng tư cùng bạn bè, người thân hay đồng nghiệp?\r\n\r\nVới kinh nghiệm dẫn đầu trong việc tổ chức sự kiện chiếu phim trong không gian riêng biệt, cung cấp vé xem phim hoặc thẻ quà tặng với số lượng lớn cho doanh nghiệp, chúng tôi tự hào sẽ mang đến cho đối tác những giải pháp điện ảnh chuyên nghiệp.', '67e2c208913de.png', 'tintuc', 'Bạn đang tìm giải pháp quảng cáo độc đáo để tăng doanh thu cho công ty?\r\n\r\nBạn muốn gửi quà tặng có ý nghĩa đến đối tác thay cho lời cảm ơn về mối hợp tác lâu bền?\r\n\r\nBạn muốn thưởng thức những bộ phim bom tấn thật riêng tư cùng bạn bè, người thân hay đồng nghiệp?\r\n\r\nVới kinh nghiệm dẫn đầu trong việc tổ chức sự kiện chiếu phim trong không gian riêng biệt, cung cấp vé xem phim hoặc thẻ quà tặng với số lượng lớn cho doanh nghiệp, chúng tôi tự hào sẽ mang đến cho đối tác những giải pháp điện ảnh chuyên nghiệp.', 'Thuê rạp /Sự kiện & Vé nhóm', 3, '2025-03-25 21:47:36', 3, '2025-03-25 21:47:36', 1),
(18, 9, 'Sáng tạo phong cách.', 'sang-tao-phong-cach.', 'CGV hân hạnh phát hành Thẻ Quà Tặng - Phương tiện thanh toán hiện đại và thuận tiện. Đây là một món quà điện ảnh tuyệt vời mà bạn có thể chia sẻ và gửi tặng bạn bè, gia đình, đồng nghiệp và đối tác. Chắc chắn đây sẽ là món quà ngập tràn sắc màu điện ảnh thật ý nghĩa và tuyệt vời dành cho những người bạn yêu quý.\r\n\r\n\r\nThẻ Quà Tặng CGV là loại thẻ trả trước. Với số tiền trong thẻ, bạn có thể sử dụng Thẻ để đổi vé xem phim hoặc bất kì sản phẩm nào tại quầy Bắp Nước của CGV Cinemas.Với vẻ ngoài sang trọng và sự tiện lợi, bạn có thể lựa chọn các mệnh giá cho Thẻ Quà Tặng như 100.000đ; 200.000đ; 300.000đ; 500.000đ; hoặc 1.000.000đ. Thẻ có thời hạn sử dụng trong 1 năm và đặc biệt bạn có thể nạp thêm tiền để gia hạn bất cứ lúc nào. Bạn có thể mua thẻ thật dễ dàng mà không cần đăng ký thông tin chủ thẻ.\r\n\r\n\r\nThẻ quà tặng đang được bán tại quầy vé các rạp CGV Cinemas trên toàn quốc, hoặc bạn có thể mua thẻ quà tặng điện tử tại đây. Thẻ quà tặng có thể được tích hợp vào tài khoản thành viên, và thanh toán tiện lợi bằng thẻ thành viên khi không mang theo thẻ quà tặng.Hiện có loại thẻ quà tặng cho công ty / tổ chức khi bạn mua vé với số lượng lớn. Đặc biệt bạn có thể đưa logo và thông điệp của công ty / tổ chức vào thẻ. Liên hệ phòng Kinh Doanh qua mẫu thông tin dưới đây, chúng tôi sẽ gọi lại cho bạn', '67e2c22604d30.png', 'tintuc', 'CGV hân hạnh phát hành Thẻ Quà Tặng - Phương tiện thanh toán hiện đại và thuận tiện. Đây là một món quà điện ảnh tuyệt vời mà bạn có thể chia sẻ và gửi tặng bạn bè, gia đình, đồng nghiệp và đối tác. Chắc chắn đây sẽ là món quà ngập tràn sắc màu điện ảnh thật ý nghĩa và tuyệt vời dành cho những người bạn yêu quý.\r\n\r\n\r\nThẻ Quà Tặng CGV là loại thẻ trả trước. Với số tiền trong thẻ, bạn có thể sử dụng Thẻ để đổi vé xem phim hoặc bất kì sản phẩm nào tại quầy Bắp Nước của CGV Cinemas.Với vẻ ngoài sang trọng và sự tiện lợi, bạn có thể lựa chọn các mệnh giá cho Thẻ Quà Tặng như 100.000đ; 200.000đ; 300.000đ; 500.000đ; hoặc 1.000.000đ. Thẻ có thời hạn sử dụng trong 1 năm và đặc biệt bạn có thể nạp thêm tiền để gia hạn bất cứ lúc nào. Bạn có thể mua thẻ thật dễ dàng mà không cần đăng ký thông tin chủ thẻ.\r\n\r\n\r\nThẻ quà tặng đang được bán tại quầy vé các rạp CGV Cinemas trên toàn quốc, hoặc bạn có thể mua thẻ quà tặng điện tử tại đây. Thẻ quà tặng có thể được tích hợp vào tài khoản thành viên, và thanh toán tiện lợi bằng thẻ thành viên khi không mang theo thẻ quà tặng.Hiện có loại thẻ quà tặng cho công ty / tổ chức khi bạn mua vé với số lượng lớn. Đặc biệt bạn có thể đưa logo và thông điệp của công ty / tổ chức vào thẻ. Liên hệ phòng Kinh Doanh qua mẫu thông tin dưới đây, chúng tôi sẽ gọi lại cho bạn', 'Sáng tạo phong cách.', 3, '2025-03-25 21:48:06', 3, '2025-03-25 21:48:06', 1),
(19, 8, 'Chi phí marketing hợp lí', 'chi-phi-marketing-hop-li', 'Chi phí marketing hợp lí\r\nThuê phòng chiếu làm sự kiện, Ra mắt sản phẩm, họp công ty, hội nghị khách hàng.\r\n\r\nBạn đang tìm giải pháp giới thiệu sản phẩm hoặc quảng cáo độc đáo để tăng doanh thu cho công ty?\r\n\r\nBạn muốn tổ chức hội thảo hoặc một chương trình có ý nghĩa cho đối tác thay cho lời cảm ơn về mối hợp tác lâu bền?\r\n\r\n- Ra mắt sản phẩm/dự án với hình ảnh minh họa siêu khủng trên màn hình hiện đại của CGV.\r\n\r\n- Không gian khán đài.\r\n\r\n- Tầm nhìn tập trung 100%, choáng ngợp.\r\n\r\n- Âm thanh lập thể, chia đều tới từng người nghe. Không gây khó chịu cho người ngồi gần.\r\n\r\n- Tham khảo: https://youtu.be/GwdTXGlG1iI', '67e2c2453b999.png', 'tintuc', 'Chi phí marketing hợp lí\r\nThuê phòng chiếu làm sự kiện, Ra mắt sản phẩm, họp công ty, hội nghị khách hàng.\r\n\r\nBạn đang tìm giải pháp giới thiệu sản phẩm hoặc quảng cáo độc đáo để tăng doanh thu cho công ty?\r\n\r\nBạn muốn tổ chức hội thảo hoặc một chương trình có ý nghĩa cho đối tác thay cho lời cảm ơn về mối hợp tác lâu bền?\r\n\r\n- Ra mắt sản phẩm/dự án với hình ảnh minh họa siêu khủng trên màn hình hiện đại của CGV.\r\n\r\n- Không gian khán đài.\r\n\r\n- Tầm nhìn tập trung 100%, choáng ngợp.\r\n\r\n- Âm thanh lập thể, chia đều tới từng người nghe. Không gây khó chịu cho người ngồi gần.\r\n\r\n- Tham khảo: https://youtu.be/GwdTXGlG1iI', 'Chi phí marketing hợp lí', 3, '2025-03-25 21:48:37', 3, '2025-03-25 21:48:37', 1);
