INSERT INTO `phim` (`MaPhim`, `TenPhim`, `TenRutGon`, `ThoiLuong`, `Anh`, `Banner`, `Trailer`, `DaoDien`, `DienVien`, `QuocGia`, `NamPhatHanh`, `PhanLoai`, `MoTa`, `NguoiTao`, `NgayTao`, `NguoiCapNhat`, `NgayCapNhat`, `TrangThai`) VALUES
(28, 'Thiên Đường Quả Báo', 'thien-duong-qua-bao', 131, 'film_673065b8319b0.jpg', 'film_673065b8319b0-2024.jpg', 'https://youtu.be/2-oT85FKYsQ', 'Naruebet Kuno', 'Jeff Satur, Engfa Waraha, Seeda Puapimo, Harit Buayoi, Pongsakorn Mettarikanon', 'Thái Lan', 2024, 'T18', 'Thongkam (Jeff Satur) và Sek (Pongsakorn) làm lụng vất vả, cày ngày cày đêm để xây dựng một mái ấm. Sau bao nỗ lực, cuối cùng họ cũng có quyền sở hữu trang trại sầu riêng ở Mae Hong Son. Tuy nhiên, bi kịch bỗng ập tới khi Sek đột ngột qua đời trong một vụ tai nạn vào thời điểm họ chưa kịp đăng ký kết hôn. Chính điều này đã khiến Thongkam không có quyền sở hữu tài sản mà 2 người đã cùng gây dựng. Ngôi nhà và đất đai bao gồm vườn sầu riêng đương nhiên thuộc về mẹ của Sek, người sẽ chuyển đến sống cùng con gái nuôi Mo (Engfa) và người làm vườn Jingna. Thongkam giờ phải đấu tranh để giành lại thành quả của tình yêu và công sức lao động của mình. Liệu giữa Thongkam và Mo, ai sẽ giành được quyền thừa kế , trở thành chủ vựa sầu riêng?', 0, '2024-11-06 17:57:14', 3, '2025-03-28 22:35:56', 1),
(29, 'Venom: Kèo Cuối', 'venom:-keo-cuoi', 109, 'film_67306c2a953e2.jpg', 'film_67e6c12c31ca6-2024.jpg', 'https://youtu.be/P0C9ccMXtqc', 'Boss Kuno', 'Tom Hardy, Chiwetel Ejiofor, Juno Temple, Peggy Lu, Rhys Ifans', 'Âu Mỹ', 2024, 'T13', 'Sau chuyến du lịch ngắn sang quê nhà của Spider-Man: No Way Home (2021), Eddie Brock (Tom Hardy) giờ đây cùng Venom “hành hiệp trượng nghĩa” và “nhai đầu” hết đám tội phạm trong thành phố. Tuy nhiên, đi đêm lắm cũng có ngày gặp ma, chính phủ Mỹ đã phát hiện ra sự tồn tại của con quái vật ngoài hành tinh này. Anh chàng buộc phải trở thành kẻ đào tẩu, liên tục trốn chạy khỏi những cuộc truy quét liên tục. Thế nhưng, đây chưa phải là rắc rối lớn nhất… Những con quái vật gớm ghiếc bất ngờ xuất hiện tại nhiều nơi. Hành tinh của chủng tộc Symbiote đã phát hiện ra Trái Đất và chuẩn bị cho cuộc xâm lăng tổng lực.  Phim mới Venom: The Last Dance / Venom: Kèo Cuối suất chiếu sớm 23-24.10.2024 (Không áp dụng Movie Voucher), dự kiến khởi chiếu 25.10.2024 tại các rạp chiếu phim toàn quốc.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/venom-the-last-dance/', 0, '2024-11-06 18:18:01', 3, '2025-03-28 22:33:00', 1),
(30, 'Red One: Mật Mã Đỏ', 'red-one:-mat-ma-do', 125, 'film_67306c60ef2ee.jpg', 'film_67306c60ef2ee-2024.jpg', 'https://youtu.be/neIRdyx_XMA', 'Jake Kasdan', 'Mary Elizabeth Ellis, Wesley Kimmel, Nick Kroll, Lucy Liu, Kiernan Shipka', 'Âu Mỹ', 2024, 'P', 'Sau khi Ông già Noel (mật danh: Red One) bị bắt cóc, Trưởng An ninh Bắc Cực (Dwayne Johnson) phải hợp tác với thợ săn tiền thưởng khét tiếng nhất thế giới (Chris Evans) trong một nhiệm vụ kịch tính xuyên lục địa để giải cứu Giáng Sinh.', 3, '2024-11-10 09:13:40', 3, '2025-03-28 22:36:59', 1),
(31, 'Linh Miêu: Quỷ Nhập Tràng', 'linh-mieu:-quy-nhap-trang', 109, 'film_67306c6c98c50.jpg', 'film_67306c6c98c50-2024.jpg', 'https://youtu.be/CeGxMuqFFZ8', 'Lưu Thành Luân', 'Hồng Đào, Nguyễn Thúc Thùy Tiên, Thiên An', 'Việt Nam', 2024, 'T18', 'Linh Miêu: Quỷ Nhập Tràng lấy cảm hứng từ truyền thuyết dân gian về “quỷ nhập tràng” để xây dựng cốt truyện. Phim lồng ghép những nét văn hóa đặc trưng của Huế như nghệ thuật khảm sành - một văn hóa đặc sắc của thời nhà Nguyễn, đề cập đến các vấn đề về giai cấp và quan điểm trọng nam khinh nữ. Đặc biệt, hình ảnh rước kiệu thây ma và những hình nhân giấy không chỉ biểu trưng cho tai ương hay điềm dữ mà còn là hiện thân của nghiệp quả. Phim mới Linh Miêu: Quỷ Nhập Tràng có suất chiếu đặc biệt vào 19-21.11.2024 (không áp dụng movie voucher) và khởi chiếu chính thức 22.11.2024 tại các rạp chiếu phim toàn quốc. Đặt vé Linh Miêu: Quỷ Nhập Tràng ngay nha.', 3, '2024-11-10 09:22:04', 3, '2025-03-28 21:17:23', 1),
(32, 'Học Viện Anh Hùng: You\'re Next', 'học-viẹn-anh-hùng:-you-re-next', 110, 'film_6735940867350.jpg', 'film_6735940867350-2024.jpg', NULL, 'Okamura Tensai', 'Gerard Caster, Van Barr, Jr. Nasim Benelkour', 'Nhật Bản', 2024, 'P', 'Nội Dung Phim My Hero Academia: You\'re Next chuyển thể từ bộ truyện tranh ăn khách My Hero Academia Vào mùa xuân năm thứ hai, trong khi Nhật Bản đang bị tàn phá bởi các cuộc chiến, một người đàn ông bí ẩn bất ngờ xuất hiện có tên là Dark Might. Đối mặt với Deku và những người bạn, hắn tự xưng mình là biểu tượng mới thay thế All Might với tuyên bố hùng hồn: \"Tiếp theo là đến lượt ta!\". Với dã tâm của mình, Dark Might sử dụng năng lực để tạo ra một pháo đài khổng lồ và nhốt người dân cùng anh hùng vào đó.  Deku, Bakugo, Todoroki cùng lớp 1-A của trường U.A. dũng cảm đối đầu với Dark Might và tổ chức tội phạm bí ẩn do hắn cầm đầu, mang tên \"Gia đình Gollini\". Liệu họ có thể ngăn chặn tham vọng của biểu tượng mới Dark Might và bảo vệ thế giới? Phim mới My Hero Academia: You\'re Next / Học Viện Anh Hùng: You\'re Next dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 08.11.2024.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/my-hero-academia-youre-next/', 3, '2024-11-14 13:09:12', 3, '2024-11-14 13:09:12', 0),
(33, 'Ai Oán Trong Vườn Xuân', 'ai-oan-trong-vuon-xuan', 91, 'film_6735951c4a220.jpg', 'film_6735951c4a220-2024.jpg', NULL, 'Ku Born', 'Jo Yun Hie, Heo Dong Won, Kim Joo Ryung', 'Hàn Quốc', 2024, 'T18', 'Trong văn hóa đại chúng hiện đại tại Hàn Quốc, có ba địa điểm nổi tiếng với rất nhiều giai thoại ma ám bí ấn được truyền miệng, bao gồm bệnh viện Gonjiam, ngôi nhà ma Yeungdeok và nhà hàng Vườn Xuân. Sau khi đã đưa Bệnh viện Gonjiam lên màn ảnh cực kỳ thành công, giờ đây, Vườn Xuân với câu chuyện về những cái chết bí ẩn đầy ám ảnh hứa hẹn cũng sẽ kích thích sự tò mò và cả lòng can đảm của khán giả tới tận cùng.  Với Ai Oán Trong Vườn Xuân, nguyên nhân của những vụ án ma ám sẽ được hé mở dưới góc nhìn của đạo diễn Goo Tae Jin. Nhân vật chính của bộ phim là So Hee, một người phụ nữ trẻ vừa trải qua nỗi đau mất chồng khi anh tự sát bằng cách treo cổ ngay trong phòng ngủ của cả hai. Không chỉ thế, cô còn mất đi đứa con đang trong bụng ngay trong đám tang của chồng mình.  Cho dù người thân khuyên nhủ, So Hee vẫn quyết định sẽ sống một mình tại ngôi nhà xinh xắn mà hai vợ chồng ấp ủ biết bao kỳ vọng, tâm huyết. Thế nhưng, cô không ngờ rằng nơi tưởng chừng là tổ ấm yên bình cho cả gia đình, hóa ra lại ẩn chứa những bí mật kinh hoàng, và cái chết của chồng cô chỉ là khởi đầu cho hàng loạt sự kiện ghê rợn sau đó. Phim mới Spring Garden / Ai Oán Trong Vườn Xuân dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 08.11.2024.', 3, '2024-11-14 13:13:48', 3, '2024-11-14 13:13:48', 0),
(34, 'Robot Hoang Dã', 'robot-hoang-da', 102, 'film_67e6c192d7b53.jpg', 'film_67e6c192d7b53-2024.jpg', 'https://youtu.be/j6VeCxrGY8U', 'Chris Sanders', 'Stephanie Hsu, Kit Connor, Catherine O\'Hara, Bill Nighy, Pedro Pascal', 'Âu Mỹ', 2024, 'P', 'Cuộc phiêu lưu hoành tráng theo chân hành trình của một robot — đơn vị ROZZUM 7134, gọi tắt là Roz. Roz vô tình dạt vào hoang đảo sau một sự cố và nơi đây trở thành địa điểm sống mới của cô. Tại đây, Roz kết thân và nhận nuôi một chú ngỗng con, đặt tên là Brightbill. Roz và Brightbill dần dần thân thiết với các bạn thú trên đảo, song sau đó phải chống chọi, bảo vệ “nhà mới” trước sự xâm lăng của nhà máy từng sản xuất ra Roz. Phim mới The Wild Robot / Robot Hoang Dã có suất chiếu đặc biệt từ 05 - 06.10.2024 (không áp dụng movie voucher) và khởi chiếu chính thức 11.10.2024 tại các rạp chiếu phim trên toàn quốc.', 3, '2024-11-14 13:16:58', 3, '2025-03-28 22:34:42', 1),
(35, 'Cô dâu hào môn', 'co-dau-hao-mon', 114, 'film_6735966063d26.jpg', 'film_6735966063d26-2024.jpg', NULL, 'Vũ Ngọc Đãng', 'Uyển Ân, Samuel An, Kiều Minh Tuấn, Thu Trang, Lê Giang, NSND Hồng Vân', 'Việt Nam', 2024, 'T18', 'Uyển Ân chính thức lên xe hoa trong thế giới thượng lưu của đạo diễn Vũ Ngọc Đãng qua bộ phim Cô Dâu Hào Môn. Thừa thắng xông lên sau doanh thu trăm tỷ từ Chị Chị Em Em 2, nhà sản xuất Will Vũ và đạo diễn Vũ Ngọc Đãng bắt tay thực hiện dự án Cô Dâu Hào Môn. Bộ phim xoay quanh câu chuyện làm dâu nhà hào môn dưới góc nhìn hài hước và châm biếm, hé lộ những câu chuyện kén dâu chọn rể trong giới thượng lưu. Phối hợp cùng Uyển Ân ở các phân đoạn tình cảm trong bộ phim lần này là diễn viên Samuel An. Anh được đạo diễn Vũ Ngọc Đãng “đo ni đóng giày” cho vai cậu thiếu gia Bảo Hoàng với ngoại hình điển trai, phong cách lịch lãm và gia thế khủng. Cùng góp mặt với Uyển Ân trong bộ phim đình đám lần này là sự xuất hiện của những cái tên bảo chứng phòng vé như: Thu Trang, Kiều Minh Tuấn, Samuel An, Lê Giang, NSND Hồng Vân,... Phim mới Cô Dâu Hào Môn suất chiếu sớm từ 16.10 (Không áp dụng Movie Voucher), dự kiến ra mắt tại các rạp chiếu phim từ 18.10.2024.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/co-dau-hao-mon/', 3, '2024-11-14 13:19:12', 3, '2024-11-14 13:19:12', 0),
(36, 'Chuyến Xe Từ Địa Ngục', 'chuyen-xe-tu-dia-nguc', 0, 'film_673596fb20336.jpg', 'film_673596fb20336-2024.jpg', NULL, 'Phasit Panitijaroonrod', 'Nathan Bartling, Piyawat Piyawatcharavijit, Charoensak Prosrichai', 'Thái Lan', 2024, 'T18', 'Câu chuyện về Nick, một người lao động nước ngoài mang nửa dòng máu Thái mongmuốn trở về quê nhà để dành kỳ nghỉ dài bên gia đình. Anh đã dùng số tiền tiết kiệm và tiền thưởng để mua vé xe buýt VIP đến Phatthalung, cùng điểm đến mà anh đi hàng năm. Tuy nhiên, hành trình lần này lại khác biệt. Một bà lão bí ẩn với mùi hôi thối giống như mùi xác chết đã lên xe cùng những hành khách khác. Trong suốt chuyến đi, bà lão không may qua đời nhưng đột nhiên sống dậy và bắt đầu tấn công các hành khách, tạo nên cảnh hỗn loạn trên xe. Liệu họ có sống sót và đến được điểm đến của mình hay không? Phim mới VIP Death Seat / Chuyến Xe Từ Địa Ngục dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 15.11.2024.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/vip-death-seat/', 3, '2024-11-14 13:21:47', 3, '2024-11-14 13:21:47', 0),
(37, 'Haikyu!!: Trận Chiến Bãi Phế Liệu', 'haikyu!!:-tran-chien-bai-phe-lieu', 85, 'film_673597e28a3e3.jpg', 'film_673597e28a3e3-2024.jpg', 'https://youtu.be/OFB4mrupFX0', 'Mitsunaka Susumu', 'Ayumu Murase, Kaito Ishikawa, Yūki Kaji, Yuichi Nakamura, Kouki Uchiyama', 'Nhật Bản', 2024, 'P', 'Haikyuu!! The Dumpster Battle/ Haikyu!!: Trận Chiến Bãi Phế Liệu chuyển thể từ một trong những manga bóng chuyền xuất sắc nhất mọi thời đại! Trường trung học Karasuno và trường trung học Nekoma chính thức đối đầu lần đầu trong vòng thứ ba của Giải vô địch quốc gia mùa xuân. Điều đó có nghĩa là giấc mơ lâu đời của Karasuno và Nekoma đã thành hiện thực! Trận chiến thùng rác, trận chiến giữa quạ và mèo rừng sắp bắt đầu. Sau nhiều trận đấu tập trong năm qua, Shoyo Hinata và Kenma Kozume cuối cùng cũng có cơ hội đấu với nhau trong một trận đấu sẽ kết thúc ngay lập tức nếu họ thua và không thể chơi lại.', 3, '2024-11-14 13:25:38', 3, '2025-03-28 22:09:34', 1),
(38, 'Đôi Bạn Học Yêu', 'doi-ban-hoc-yeu', 118, 'film_673598a88cf7a.jpg', 'film_673598a88cf7a-2024.jpg', 'https://youtu.be/WOpnzT2Jb0A', 'E.Oni', 'Kim Go Eun, Steve Sanghyun Noh', 'Hàn Quốc', 2024, 'T18', 'Đôi Bạn Học Yêu là bộ phim kể về Jae-hee (Kim Go-eun) - một cô gái tự do, phóng khoáng, không quan tâm người khác nghĩ gì về mình và Heung-soo - một chàng trai tự cô lập mình ra khỏi thế giới bởi một bí mật không thể tiết lộ. Khi Jae-hee tình cờ phát hiện ra điều thầm kín của Heung-soo, cả hai đã hình thành nên một mối quan hệ không tưởng với cuộc sống chung đầy màu sắc. Phim mới Love In The Big City / Đôi Bạn Học Yêu suất chiếu sớm từ 07.11.2024 (Không áp dụng Movie Voucher), dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 08.11.2024.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/love-in-the-big-city/', 3, '2024-11-14 13:28:56', 3, '2025-03-28 22:37:47', 1),
(39, 'Kẻ đóng thế', 'ke-dong-the', 114, 'film_673599c1436d9.jpg', 'film_673599c1436d9-2024.jpg', NULL, 'Lương Quán Thuấn, Lương Quán Nghiêu', 'Lưu Tuấn Khiêm, Đổng Vĩ, Ngũ Doãn Long, Thái Tư Vận', 'Hồng Kông', 2024, 'T13', 'Một đạo diễn đóng thế hết thời đang vật lộn để tìm lối đi trong ngành công nghiệp điện ảnh nhiều biến động. Ông đánh cược tất cả để tạo nên màn tái xuất cuối cùng, đồng thời cố gắng hàn gắn mối quan hệ với cô con gái xa cách của mình. Phim mới Stuntman / Kẻ Đóng Thế dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 15.11.2024.\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/stuntman/', 3, '2024-11-14 13:33:37', 3, '2025-03-16 17:48:31', 2),
(40, 'Kỳ Án Trên Đồi Tuyết', 'ky-an-tren-doi-tuyet', 151, 'film_67359aab2827a.png', 'film_67359aab2827a-2024.jpg', NULL, 'Justine Triet', 'Sandra Hüller, Swann Arlaud, Milo Machado-Graner', 'Pháp', 2024, 'T16', 'Cuộc sống của nhà văn Sandra cùng chồng Samuel và cậu con trai mù Daniel ở căn nhà gỗ hẻo lánh trên dãy Alps bất ngờ bị xáo trộn khi Samuel được tìm thấy đã chết một cách bí ẩn trên tuyết, khiến Sandra trở thành nghi phạm chính và mối quan hệ đầy mâu thuẫn giữa cô và chồng dần được phơi bày trước phiên tòa. Phim hay  Kỳ Án Trên Đồi Tuyết dự kiến trình chiếu tại rạp chiếu phim Galaxy Mipec Long Biên vào 16 & 20.11.2024  \r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/anatomy-of-a-fall/', 3, '2024-11-14 13:37:31', 3, '2024-11-14 13:37:43', 0),
(41, 'Địa Đạo', 'dia-dao', 0, 'film_67d7109c03dca.jpg', 'film_67d7109c03dca-2025.jpg', 'https://www.youtube.com/watch?v=-OGDDtsIBHA', 'Bùi Thạc Chuyên', 'Thái Hòa; Quang Tuấn; Diễm Hằng Lamoon; Anh Tú Wilson; Hồ Thu Anh; Uyển Ân', 'Việt Nam', 2025, 'T18', 'Địa Đạo: Mặt Trời Trong Bóng Tối là dự án điện ảnh kỷ niệm 50 năm hòa bình thống nhất đất nước, dự kiến khởi chiếu 30.04.2025. Phim do đạo diễn Bùi Thạc Chuyên cầm trịch, với sự tham gia của dàn diễn viên thực lực – Thái Hòa, Quang Tuấn và diễn viên trẻ Hồ Thu Anh. Vào năm 1967, chiến tranh Việt Nam ngày càng khốc liệt. Đội du kích 21 người do BẢY THEO chỉ huy tại căn cứ Bình An Đông trở thành mục tiêu mà quân đội Mỹ TÌM VÀ DIỆT số 1 khi nhận nhiệm vụ bằng mọi giá phải bảo vệ một nhóm thông tin tình báo chiến lược mới đến ẩn náu tại căn cứ. Các cuộc liên lạc vô tuyến điện từ với nhóm tình báo bị quân đội Mỹ phát hiện và định vị, lấy đi lợi thế duy nhất của đội du kích là sự vô hình trong hệ thống địa đạo rộng khắp, phức tạp và bí ẩn. Bộ phim là những câu chuyện đan xen giữa tình đồng đội, tình yêu và khát khao sống ở những người lính. Trên hết, vẫn là nghĩa vụ và sự hi sinh vì Tổ Quốc. Đạo diễn Bùi Thạc Chuyên nung nấu 10 năm trời để chuẩn bị cho phim điện ảnh Địa Đạo, đem câu chuyện huyền thoại về nhân dân miền Nam tài trí thông minh và tinh thần yêu nước ngoan cường ngày ấy lên màn ảnh rộng. Lịch sử đã chứng minh, dẫu cho trên đầu là bom rơi đạn nổ, dưới hầm là không khí đặc quánh đến hít thở cũng khó khăn, chỉ cần trong tim mỗi người chiến sĩ luôn hướng đến ánh sáng tự do của một dân tộc tự do trong tương lai, họ sẽ kiên trì đứng vững mà chiến đấu. Như có mặt trời trong bóng tối luôn soi sáng dẫn đường. Phim mới Địa Đạo: Mặt Trời Trong Bóng Tối dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 04.04.2025. PHIM ĐANG CHIẾU Mua vé 8.8 T18 Mickey 17 Mua vé 8.7 T18 Quỷ Nhập Tràng Mua vé 8.7 T16 Sát Thủ Vô Cùng Cực Hài Xem thêm GIỚI THIỆU Về Chúng Tôi Thoả Thuận Sử Dụng Quy Chế Hoạt Động Chính Sách Bảo Mật GÓC ĐIỆN ẢNH Thể Loại Phim Bình Luận Phim Blog Điện Ảnh Phim Hay Tháng Phim IMAX HỖ TRỢ Góp Ý Sale & Services Rạp / Giá Vé Tuyển Dụng FAQ CÔNG TY CỔ PHẦN PHIM THIÊN NGÂN 3/9 Võ Văn Tần, Phường Võ Thị Sáu, Quận 3, Tp. Hồ Chí Minh, Việt Nam : 028.39.333.303 - : 19002224 (9:00 - 22:00) - : hotro@galaxystudio.vn Đặt vé phim Địa Đạo: Mặt Trời Trong Bóng Tối (2025) | Galaxy Cinema\r\n\r\nXem thêm tại: https://www.galaxycine.vn/dat-ve/dia-dao-mat-troi-trong-bong-toi/', 3, '2025-03-17 00:55:40', 3, '2025-03-17 00:55:40', 1),
(42, 'TRỪ TÀ KÝ: KHỞI NGUYÊN HẮC ÁM', 'tru-ta-ky:-khoi-nguyen-hac-am', 85, 'film_67d713e453938.jpg', 'film_67d713e453938-21032025.jpg', 'https://youtu.be/v0QbICOjhxY', 'Kim Dong-Chul', 'Choi Han, Nam Doh Hyeong, Kim Yeon Woo, Chung Yu Chung', 'Hàn Quốc', 2025, 'T13', 'Cha sứ Park – một linh mục vốn là bác sĩ đã bị khai trừ sau khi thực hiện những nghi lễ trừ tà mà Giáo hội cho là cực đoan, bởi những người trong Giáo hội từ chối tin rằng những thế lực vô hình đang rình rập các linh hồn vô tội. Những tưởng cha Park an phận giải nghệ, một nhà sư đến từ ngôi chùa bí ẩn cất giữ những bí thuật bất ngờ tìm tới ông với một lời khẩn cầu: Bảo vệ một đứa trẻ tên Joon Hoo khỏi vị sư phụ đã hắc hóa của cậu bé. Cha Park buộc phải đối mặt với bóng ma quá khứ để giải cứu đứa trẻ và ngăn chặn bi kịch lặp lại.', 3, '2025-03-17 01:09:40', 3, '2025-03-17 01:09:40', 1),
(43, 'ĐÊM THÁNH: ĐỘI SĂN QUỶ', 'dem-thanh:-doi-san-quy', 0, 'film_67d714c6aae94.jpg', 'film_67d714c6aae94-25042025.jpg', 'https://youtu.be/Q0SU5_LloFQ', 'Lim Dae-hee', 'Don Lee; Seo Hyun; David Lee', 'Hàn Quốc', 2025, 'T18', 'Tổ đội săn lùng và tiêu diệt các thế lực tôn thờ quỷ dữ với những sức mạnh siêu nhiên khác nhau gồm “tay đấm” Ma Dong-seok, Seohuyn (SNSD) và David Lee hứa hẹn mở ra cuộc chiến săn quỷ khốc liệt nhất dịp lễ 30/4 này!', 3, '2025-03-17 01:13:26', 3, '2025-03-17 01:13:26', 2),
(44, 'BÍ KÍP LUYỆN RỒNG', 'bi-kip-luyen-rong', 0, 'film_67d7171f7c9a1.jpg', 'film_67d7171f7c9a1-13062025.jpg', 'https://youtu.be/6lnYqNYj0o8', 'Dean DeBlois', 'Mason Thames, Nico Parker, Gerard Butler', 'Âu Mỹ', 2025, 'T16', 'Câu chuyện về một chàng trai trẻ với ước mơ trở thành thợ săn rồng, nhưng định mệnh lại đưa đẩy anh đến tình bạn bất ngờ với một chú rồng.', 3, '2025-03-17 01:23:27', 3, '2025-03-17 01:23:27', 2),
(45, 'NHIỆM VỤ: BẤT KHẢ THI - NGHIỆP BÁO CUỐI CÙNG', 'nhiem-vu:-bat-kha-thi---nghiep-bao-cuoi-cung', 0, 'film_67d718a16b8a2.jpg', 'film_67d718a16b8a2-23052025.jpg', 'https://youtu.be/B42IWDu4HOs', 'Christopher McQuarrie', 'Tom Cruise', 'Âu Mỹ', 2025, 'T18', 'Cuộc đời là tất thảy những lựa chọn. Tom Cruise thủ vai Ethan Hunt trở lại trong Nhiệm Vụ: Bất Khả Thi – Nghiệp Báo Cuối Cùng.', 3, '2025-03-17 01:29:53', 3, '2025-03-17 01:29:53', 2),
(46, 'MICKEY 17', 'mickey-17', 137, 'film_67d71a0a07c2d.jpg', 'film_67d71a0a07c2d-14032025.jpg', 'https://youtu.be/2kEFWCw7tKU', 'Bong Joon Ho', 'Robert Pattinson; Naomi Ackie; Steven Yeun; Toni Collette; Mark Ruffalo', 'Âu Mỹ', 2025, 'T18', 'Được chuyển thể từ tiểu thuyết Mickey 7 của nhà văn Edward Ashton, Cuốn tiểu thuyết xoay quanh các phiên bản nhân bản vô tính mang tên “Mickey”, dùng để thay thế con người thực hiện cuộc chinh phạt nhằm thuộc địa hóa vương quốc băng giá Niflheim. Mỗi khi một Mickey chết đi, một Mickey mới sẽ được tạo ra, với phiên bản được đánh số 1, 2, 3 tiếp theo. Mickey số 17 được cho rằng đã chết, để rồi một ngày kia, hắn quay lại và bắt gặp phiên bản tiếp theo của mình.', 3, '2025-03-17 01:35:54', 3, '2025-03-17 01:35:54', 1),
(47, 'SÁT THỦ VÔ CÙNG CỰC', 'sat-thu-vo-cung-cuc', 107, 'film_67d71aaeaf3aa.jpg', 'film_67d71aaeaf3aa-14032025.jpg', 'https://youtu.be/9d5FMHom5zY', 'Choi Won-sub', 'Kwon Sang-woo, Jung Joon-ho, Lee Yi-kyung, Hwang Woo-seul-hye, Kim Sung-oh, Lee Ji-won', 'Hàn Quốc', 2025, 'T16', 'Câu chuyện tiếp nối về cuộc đời làm hoạ sĩ webtoon Jun, người nổi tiếng trong thời gian ngắn với tư cách là tác giả của webtoon Đặc vụ ám sát Jun, nhanh chóng mang danh là \"nhà văn thiếu não\" sau khi Phần 2 bị chỉ trích thảm hại, nhưng mọi thứ thay đổi khi một cuộc tấn công khủng bố ngoài đời thực giống hệt với phần 2 anh vừa xuất bản, khiến Jun bị NIS buộc tội sai là kẻ chủ mưu đằng sau tội ác.', 3, '2025-03-17 01:38:38', 3, '2025-03-17 01:38:38', 1),
(48, 'QUỶ NHẬP TRÀNG', 'quy-nhap-trang', 121, 'film_67d71b08e72d8.jpg', 'film_67d71b08e72d8-07032025.jpg', 'https://youtu.be/qOeNdCmKl3U', 'Pom Nguyễn', 'Quang Tuấn, Khả Như, NSƯT Phú Đôn, Vân Dung, NSND Thanh Nam, Hoàng Mèo, Thanh Tân, Trung Ruồi, Kiều Chi,…', 'Việt Nam', 2025, 'T18', 'Phim lấy cảm hứng từ câu chuyện có thật và “truyền thuyết kinh dị nhất về người chết sống lại” - Ở một ngôi làng vùng cao, cặp vợ chồng Quang và Như sống bằng nghề mai táng. Cuộc sống yên bình của họ bị xáo trộn khi phát hiện một cỗ quan tài vô chủ trên mảnh đất nhà mình. Từ đây, những hiện tượng kỳ lạ bắt đầu xảy ra và ám ảnh cả ngôi làng.', 3, '2025-03-17 01:40:08', 3, '2025-03-17 01:40:08', 1),
(49, 'LẠC TRÔI', 'lac-troi', 89, 'film_67d71c31dc6dc.jpg', 'film_67d71c31dc6dc-2025.jpg', 'https://youtu.be/bFRr7bv--70', 'Gints Zilbalodis', 'Đang cập nhật', 'Latvia', 2025, 'P', 'Trước bối cảnh hậu tận thế, chú mèo xám nhút nhát, vốn luôn sợ nước phải rời bỏ vùng an toàn khi căn nhà thân yêu bị cuốn trôi bởi cơn lũ dữ. Trên hành trình vượt đại dương mênh mông, chú mèo cùng những người bạn đồng hành (Capybara, chó Labrador Retriever, Vượn Cáo, chim Thư ký) phải học cách vượt qua nỗi sợ và chấp nhận những điểm khác biệt để cùng nhau tồn tại.', 3, '2025-03-17 01:45:05', 3, '2025-03-17 01:45:05', 1),
(50, 'NHÀ GIA TIÊN', 'nha-gia-tien', 117, 'film_67d71ca63bd55.jpg', 'film_67d71ca63bd55-2025.jpg', 'https://youtu.be/5b5oEQotzXo', 'Huỳnh Lập', 'Huỳnh Lập, Phương Mỹ Chi, NSƯT Hạnh Thuý, NSƯT Huỳnh Đông, Puka, Đào Anh Tuấn, Trung Dân, Kiều Linh, Lê Nam, Chí Tâm, Thanh Thức, Trác Thuý Miêu, Mai Thế Hiệp, NS Mạnh Dung, NSƯT Thanh Dậu, NS Thanh Hiền, Nguyễn Anh Tú,…', 'Việt Nam', 2025, 'T18', 'Nhà Gia Tiên xoay quanh câu chuyện đa góc nhìn về các thế hệ khác nhau trong một gia đình, có hai nhân vật chính là Gia Minh (Huỳnh Lập) và Mỹ Tiên (Phương Mỹ Chi). Trở về căn nhà gia tiên để quay các video “triệu view” trên mạng xã hội, Mỹ Tiên - một nhà sáng tạo nội dung thuộc thế hệ Z vốn không tin vào chuyện tâm linh, hoàn toàn mất kết nối với gia đình, bất ngờ nhìn thấy Gia Minh - người anh trai đã mất từ lâu. Để hồn ma của Gia Minh có thể siêu thoát và không tiếp tục làm phiền mình, Mỹ Tiên bắt tay cùng Gia Minh lên kế hoạch giữ lấy căn nhà gia tiên đang bị họ hàng tranh chấp, đòi ông nội chia tài sản. Đứng trước hàng loạt bí mật động trời trong căn nhà gia tiên, liệu Mỹ Tiên có vượt qua được tất cả để hoàn thành di nguyện của Gia Minh?', 3, '2025-03-17 01:47:02', 3, '2025-03-17 01:47:02', 1),
(51, 'VIETNAMESE CONCERT FILM: CHÚNG TA LÀ NGƯỜI VIỆT NAM', 'vietnamese-concert-film:-chung-ta-la-nguoi-viet-nam', 98, 'film_67d71dcf64512.jpg', 'film_67d71dcf64512-2025.jpg', 'https://youtu.be/i0rF0-4eaeE', 'Kawaii Tuấn Anh, Hoàng Thùy Linh', 'Hoàng Thùy Linh', 'Việt Nam', 2025, 'P', 'Bộ phim tài liệu về sự kiện âm nhạc kỷ niệm 13 năm ca hát của ca sĩ – nghệ sĩ Hoàng Thùy Linh. Phim đưa công chúng đến gần hơn với ý tưởng, quá trình sáng tạo, rèn luyện của nghệ sĩ và các cộng sự, hậu trường của “Vietnamese Concert Film: Chúng ta là người Việt Nam”. Đằng sau những màn trình diễn bùng nổ hay các thước phim hoàn mỹ trên sân khấu là nỗ lực của toàn ê-kip.', 3, '2025-03-17 01:51:59', 3, '2025-03-17 01:51:59', 1),
(52, 'ĐẠI CHIẾN NGƯỜI KHỔNG LỒ: LẦN TẤN CÔNG CUỐI CÙNG', 'dai-chien-nguoi-khong-lo:-lan-tan-cong-cuoi-cung', 144, 'film_67d71ece44729.jpg', 'film_67d71ece44729-2025.jpg', 'https://www.youtube.com/watch?v=i_gcT9PR4Oc', 'Yûichirô Hayashi', 'Yûki Kaji, Yui Ishikawa, Marina Inoue, Hiroshi Kamiya,...', 'Nhật Bản', 2025, 'T16', 'Trong cuộc chiến cuối cùng định đoạt số phận thế giới, Eren Yeager đã giải phóng sức mạnh tối thượng của các Titan. Dẫn đầu đội quân Titan Đại hình khổng lồ, Eren quyết tâm hủy diệt mọi kẻ thù đe dọa đến quê hương Eldia. Thế nhưng, cuộc chiến này không chỉ là về sự sống còn, mà còn là cuộc đối đầu giữa lòng thù hận và hy vọng. Kết thúc khúc hùng ca đầy bi tráng, di sản của chiến tranh và những ám ảnh về tự do vẫn tiếp tục đeo bám nhân loại, để lại câu hỏi về giá trị của sự hy sinh và tự do thật sự.', 3, '2025-03-17 01:56:14', 3, '2025-03-17 01:56:14', 1),
(53, 'INTERSTELLAR (CHIẾU LẠI)', 'interstellar-(chieu-lai)', 169, 'film_67d71f918756c.jpg', 'film_67d71f918756c-2025.jpg', 'https://youtu.be/l-CISe_P7F4', 'Christopher Nolan', 'Matthew McConaughey, Anne Hathaway, Jessica Chastain', 'Âu Mỹ', 2025, 'T13', 'Một đoàn thám hiểm vũ trụ sử dụng một hố đen mới được khám phá để du hành xuyên không gian đến những vì sao xa xôi và tìm kiếm hy vọng cho loài người. “Interstellar” là biên niên ký về cuộc phiêu lưu vĩ đại của một nhóm các nhà thám hiểm sử dụng khám phá mới về lỗ đen vũ trụ để vượt qua các giới hạn thông thường trong du hành không gian, chinh phục khoảng không mênh mông trên một chuyến hành trình xuyên dải ngân hà.. Cùng trải nghiệm một INTERSTELLAR hoàn toàn khác biệt. Siêu phẩm của đạo diễn Christopher Nolan sẽ trở lại ĐỘC QUYỀN VỚI ĐỊNH DẠNG IMAX từ ngày 28.02.2025', 3, '2025-03-17 01:59:29', 3, '2025-03-17 01:59:29', 1),
(54, 'THE MONKEY: TIẾNG VỌNG KINH HOÀNG', 'the-monkey:-tieng-vong-kinh-hoang', 97, 'film_67d78633ebcae.jpg', 'film_67d78633ebcae-2025.jpg', 'https://youtu.be/E_Xt-GKT1vc', 'Osgood Perkins', 'Theo James, Tatiana Maslany, Christian Convery', 'Âu Mỹ', 2025, 'T18', '\"Món đồ chơi từ địa ngục\" The Monkey - Tiếng Vọng Kinh Hoàng kể về hàng loạt số phận bi thảm xung quanh món đồ chơi bị nguyền rủa ghê rợn nhất 2025. Tác phẩm cũng đánh dấu sự kết hợp lần đầu tiên giữa ông hoàng tiểu thuyết Stephen King và bậc thầy kinh dị James Wan.', 3, '2025-03-17 09:17:23', 3, '2025-03-17 09:17:23', 1),
(55, 'EMMA VÀ VƯƠNG QUỐC TÍ HON', 'emma-va-vuong-quoc-ti-hon', 80, 'film_67d7873022b09.jpg', 'film_67d7873022b09-2025.jpg', 'https://youtu.be/xw5hzokPKYo', 'Leo Lewis Liao', 'Travis Cloer, Niko Gerentes, Natalie Grace, ...', 'Âu Mỹ', 2025, 'P', 'Emma, một cô gái tí hon được nhận nuôi bởi các động vật, khao khát tìm ra sự thật về nguồn gốc con người của mình. Nhưng khi cô phát hiện ra một hòn đảo ẩn chứa đầy những người tí hon, đó không phải là câu chuyện cổ tích mà cô mong đợi. Liệu cô có dám đánh đổi tất cả những gì mình từng biết để khám phá những bí mật từ quá khứ?', 3, '2025-03-17 09:21:36', 3, '2025-03-17 09:21:36', 1),
(56, 'THẾ GIỚI KHỦNG LONG: TÁI SINH', 'the-gioi-khung-long:-tai-sinh', 0, 'film_67d788b00880d.jpg', 'film_67d788b00880d-2025.jpg', 'https://youtu.be/WajvLoypmeQ', 'Gareth Edwards', 'Scarlett Johansson, Mahershala Ali, Jonathan Bailey,….', 'Âu Mỹ', 2025, 'T16', '', 3, '2025-03-17 09:28:00', 3, '2025-03-17 09:28:00', 2),
(57, 'MỘT BỘ PHIM MINECRAFT', 'mot-bo-phim-minecraft', 0, 'film_67d7897cb7fff.jpg', 'film_67d7897cb7fff-2025.jpg', 'https://youtu.be/Q0iybb96Bx0', 'Jared Hess', 'Jason Momoa, Jack Black, Emma Myers, Sebastian Eugene Hansen, Danielle Brooks,...', 'Âu Mỹ', 2025, 'P', 'Chào mừng bạn đến với thế giới của Minecraft, nơi sự sáng tạo không chỉ giúp bạn chế tạo mà còn là yếu tố quan trọng để sống sót! Bốn kẻ lạc lõng - Garrett “The Garbage Man” Garrison (Momoa), Henry (Hansen), Natalie (Myers) và Dawn (Brooks) - bất ngờ gặp rắc rối khi họ bị kéo qua cánh cửa bí ẩn dẫn đến Overworld: một thế giới kỳ lạ được tạo bởi những khối lập phương và phát triển nhờ vào trí tưởng tượng. Để trở về nhà, họ cần phải làm chủ được thế giới này (và bảo vệ nó khỏi những thực thể tà ác như Piglins và Thây Ma) trong khi dấn thân vào chuyến phiêu lưu màu nhiệm với một thợ chế tạo chuyên nghiệp và khó lường - Steve (Black). Chuyến hành trình này sẽ thách thức sự can đảm của cả năm người, thúc đẩy họ tìm lại với những phẩm chất làm nên sự đặc biệt của riêng mình,… đồng thời là những kỹ năng cần thiết để trở lại với thế giới thật.', 3, '2025-03-17 09:31:24', 3, '2025-03-17 09:31:24', 2),
(58, 'PHIM ĐIỆN ẢNH DORAEMON: NOBITA VÀ CUỘC PHIÊU LƯU VÀO THẾ GIỚI TRONG TRANH', 'phim-dien-anh-doraemon:-nobita-va-cuoc-phieu-luu-vao-the-gioi-trong-tranh', 0, 'film_67d78a4cef259.jpg', 'film_67d78a4cef259-2025.jpg', 'https://youtu.be/Bz0zCdNBj1Q', 'Yukiyo Teramoto', 'Wasabi Mizuta, Megumi Ôhara, Yumi Kakazu, Subaru Kimura, Tomokazu Seki,...', 'Nhật Bản', 2025, 'P', 'Thông qua món bảo bối mới của Doraemon, cả nhóm bạn bước thế giới trong một bức tranh nổi tiếng và bắt gặp cô bạn bí ẩn tên Claire. Với lời mời của Claire, cả nhóm cùng đến thăm vương quốc Artoria, nơi ẩn giấu một viên ngọc quý mang tên Artoria Blue đang ngủ yên. Trên hành trình tìm kiếm viên ngọc, nhóm bạn Doraemon phát hiện một truyền thuyết về sự hủy diệt của thế giới, mà truyền thuyết đó dường như đang sống dậy! Liệu cả nhóm có thể phá hủy lời nguyền này và bảo vệ cả thế giới?', 3, '2025-03-17 09:34:52', 3, '2025-03-17 09:34:52', 2),
(59, 'SUPERMAN', 'superman', 0, 'film_67d78b9f78b14.jpg', 'film_67d78b9f78b14-2025.jpg', 'https://youtu.be/QZbk3DtUpt0', 'James Gunn', 'David Corenswet, Rachel Brosnahan, Nicholas Hoult,...', 'Âu Mỹ', 2025, 'P', 'Mùa hè tới đây, Warner Bros. Pictures sẽ mang “Superman” - phim điện ảnh đầu tiên của DC Studios đến các rạp chiếu trên toàn cầu. Với phong cách riêng biệt của mình, James Gunn sẽ khắc họa người hùng huyền thoại trong vũ trụ DC hoàn toàn mới, với sự kết hợp độc đáo của các yếu tố hành động đỉnh cao, hài hước và vô cùng cảm xúc. Một Superman với lòng trắc ẩn và niềm tin vào sự thiện lương của con người sẽ xuất hiện đầy hứa hẹn trên màn ảnh.', 3, '2025-03-17 09:40:31', 3, '2025-03-17 09:40:31', 2),
(60, 'Thunderbolts', 'thunderbolts', 0, 'film_67d78cc32524a.jpg', 'film_67d78cc32524a-2025.jpg', 'https://youtu.be/1OMruGR_d1I', 'Jake Schreier', 'Florence Pugh, Sebastian Stan, David Harbour, Wyatt Russell, Olga Kurylenko, Lewis Pullman, Geraldine Viswanathan, Chris Bauer, Wendell Edward Pierce, with David Harbour, with Hannah John-Kamen, Julia Louis-Dreyfus.', 'Âu Mỹ', 2025, 'T18', 'Ai trong team này cũng từng làm việc ác, giờ là lúc làm việc ác cùng nhau. Các thành phần bất hảo trong vũ trụ điện ảnh Marvel giờ đây đã được triệu tập trở thành một nhóm gọi là “Biệt Đội Sấm Sét”, để làm những nhiệm vụ nguy hiểm bậc nhất mà có thể sẽ thay đổi con người, cuộc đời họ mãi mãi.', 3, '2025-03-17 09:45:23', 3, '2025-03-17 09:45:23', 2),
(61, 'NGHỀ SIÊU KHÓ NÓI', 'nghe-sieu-kho-noi', 102, 'film_67da7b12cd648.jpg', 'film_67da7b12cd648-2025.jpg', 'https://youtu.be/itEW-EUeFrQ', 'LEE Jong-suk', 'PARK Ji-hyun, CHOI Si-won, SUNG Dong-il', 'Hàn Quốc', 2025, 'T18', 'Dan-bi vốn mơ ước trở thành một tác giả truyện thiếu nhi, nhưng trớ trêu thay, cô lại khởi đầu sự nghiệp tại Đội Bảo vệ Thanh thiếu niên, nơi chuyên kiểm duyệt nội dung khiêu dâm bất hợp pháp. Một ngày nọ, Dan-bi vô tình gây ra tai nạn và phải bồi thường một khoản tiền khổng lồ cho CEO Hwang – ông trùm trong ngành văn học mạng 18+. Từ đây, cô buộc phải ký thỏa thuận viết truyện người lớn để trả nợ. Vốn chưa từng viết truyện người lớn, Dan-bi gặp đủ tình huống dở khóc dở cười. Nhưng nhờ sự cổ vũ của đồng nghiệp Jung-seok - người đang vật lộn với chứng khó “lên”, và nhờ vốn sống phong phú từ hội bạn thân mê buôn chuyện giường chiếu, cô bỗng phát hiện ra tài năng sáng tác thiên phú mà chính mình cũng không ngờ tới…', 3, '2025-03-19 15:06:42', 3, '2025-03-19 15:06:42', 1),
(62, 'M3GAN 2.0', 'm3gan-2.0', 0, 'film_67da7c7e1e949.jpg', 'film_67da7c7e1e949-2025.png', 'https://youtu.be/oj3F7LgsHgQ', 'Gerard Johnstone', 'Jemaine Clement; Amie Donald; Allison Williams', 'Âu Mỹ', 2025, 'T18', 'Phim lấy bối cảnh 2 năm sau các sự kiện ở phần 1. Lúc này, Gemma phát hiện công nghệ sản xuất MEGAN đã bị đánh cắp. Kẻ gian đã tạo ra một robot AI khác với chức năng tương tự MEGAN, nhưng được trang bị sức mạnh chiến đấu \"khủng\" hơn mang tên Amelia. Để \"đối đầu\" với Amelia, Gemma buộc phải \"hồi sinh\" và cải tiến MEGAN, hứa hẹn một trận chiến \"nảy lửa\" trên màn ảnh vào năm 2025.', 3, '2025-03-19 15:12:46', 3, '2025-03-19 15:12:46', 2),
(63, 'NHÀ GA MA CHÓ', 'nha-ga-ma-cho', 89, 'film_67da7d32a2ac1.jpg', 'film_67da7d32a2ac1-2025.jpg', 'https://youtu.be/iQ30rfOTwnE', 'Luis Prieto', 'Natalia Azahara, Valèria Sorolla, Javier Gutiérrez', 'Tây Ban Nha', 2025, 'T18', 'Một bí ẩn đã khiến ga tàu điện ngầm Rocafort ở Barcelona phải rúng động suốt nhiều năm, và điều này đã hoàn toàn xâm nhập vào cuộc sống của Laura kể từ khi cô bắt đầu làm việc tại đây. Cô dần khám phá ra rằng nhiều người đã qua đời tại đây trong những hoàn cảnh hết sức kỳ lạ. Vậy sự thật ẩn sau những cái chết bí ẩn này là gì?', 3, '2025-03-19 15:15:46', 3, '2025-03-19 15:15:46', 1),
(64, 'PHIM ĐIỆN ẢNH NINJA RANTARO: GIẢI CỨU QUÂN SƯ', 'phim-dien-anh-ninja-rantaro:-giai-cuu-quan-su', 90, 'film_67da7dae9df5a.jpg', 'film_67da7dae9df5a-2025.jpg', 'https://youtu.be/qBViSokPeic', 'Masaya Fujimori', 'Mayumi, Minami TAKAYAMA, Teiyū ICHIRYŪSAI, Toshihiko SEKI', 'Nhật Bản', 2025, 'P', 'Sau khi thầy Doi chấp nhận quyết đấu với Moroizumi Sonemon, ông đã mất tích không rõ tung tích. Khi nghe tin này, các thầy giáo cùng các học sinh lớp 6 lập tức tiến hành một cuộc tìm kiếm toàn diện. Giữa tình thế hỗn loạn, Kirimaru vô tình tìm được manh mối về tung tích của thầy Doi. Cùng lúc đó, trong khi nhóm học sinh lớp 6 đang ráo riết tìm kiếm, quân sư lạnh lùng của đội Ninja Dokutake - Tenki bất ngờ xuất hiện. Điều khiến mọi người kinh ngạc là khuôn mặt của Tenki lại giống hệt thầy Doi! Kẻ địch hùng mạnh đang ở trước mắt, các học viên Ninja của Học viện Nhẫn Thuật buộc phải thể hiện sự gắn kết mạnh mẽ mới có thể vượt qua thử thách chưa từng có này. Liệu Rantarou, Kirimaru và Shinbei có thể giải cứu thầy Doi thành công không?', 3, '2025-03-19 15:17:50', 3, '2025-03-19 15:17:50', 2),
(65, 'MẬT VỤ PHỤ HỒ', 'mat-vu-phu-ho', 116, 'film_67da7e1675ba2.jpg', 'film_67da7e1675ba2-2025.jpg', 'https://youtu.be/7pKs-eGzfYk', 'David Ayer', 'Jason Statham, David Harbour, Michael Peña, Jason Flemyng', 'Âu Mỹ', 2025, 'T18', 'Levon Cade - cựu biệt kích tinh nhuệ thuộc lực lượng Thủy quân Lục chiến Hoàng gia Anh. Sau khi nghỉ hưu, anh sống cuộc đời yên bình là một công nhân xây dựng tại Chicago (Mỹ). Levon có mối quan hệ rất tốt với gia đình ông chủ Joe Garcia (Michael Peña). Một ngày nọ, cô con gái tuổi teen Jenny (Arianna Rivas) của Joe bị bắt cóc khiến chàng cựu quân nhân phải sử dụng lại các kỹ năng giết chóc của mình để giúp đỡ.', 3, '2025-03-19 15:19:34', 3, '2025-03-19 15:19:34', 2),
(66, 'THÁM TỬ KIÊN: KỲ ÁN KHÔNG ĐẦU', 'tham-tu-kien:-ky-an-khong-dau', 0, 'film_67da7ea282d39.jpg', 'film_67da7ea282d39-2025.jpg', 'https://youtu.be/MXFYeEldOkM', 'Victor Vũ', 'Quốc Huy, Đinh Ngọc Diệp, Quốc Anh, Minh Anh, Anh Phạm', 'Việt Nam', 2025, 'T18', 'Thám Tử Kiên là một nhân vật được yêu thích trong tác phẩm điện của ăn khách của NGƯỜI VỢ CUỐI CÙNG của Victor Vũ, Thám Tử Kiên: Kỳ Không Đầu sẽ là một phim Victor Vũ trở về với thể loại sở trường Kinh Dị - Trinh Thám sau những tác phẩm tình cảm lãng mạn trước đó', 3, '2025-03-19 15:21:54', 3, '2025-03-19 15:21:54', 2),
(67, 'Elio Cậu Bé Đến Từ Trái Đất', 'elio-cau-be-den-tu-trai-dat', 0, 'film_67da7f825deef.jpg', 'film_67da7f825deef-2025.jpg', 'https://youtu.be/rdzfDoJcrxA', 'Adrian Molina, Madeline Sharafian, Domee Shi', 'Yonas Kibreab, Zoe Saldana, Brad Garrett', 'Âu Mỹ', 2025, 'P', 'Elio là một cậu bé đam mê vũ trụ với trí tưởng tượng phong phú. Một hôm, cậu bất ngờ phải tham gia một cuộc phiêu lưu ngoài vũ trụ, nơi cậu phải xây dựng mối quan hệ mới với các dạng sống ngoài hành tinh. Elio phải vượt qua cuộc chiến ở quy mô liên thiên hà và khám phá ra con người thực sự của mình.', 3, '2025-03-19 15:25:38', 3, '2025-03-19 15:25:38', 2),
(68, 'F1®', 'f1®', 0, 'film_67da8020d79e4.jpg', 'film_67da8020d79e4-2025.jpg', 'https://youtu.be/llrZvUGzUUk', 'Joseph Kosinski', 'Brad Pitt, Simone Ashley, Javier Bardem, ...', 'Âu Mỹ', 2025, 'T18', 'Sonny Hayes (Brad Pitt) được mệnh danh là \"Huyền thoại chưa từng được gọi tên\" là ngôi sao sáng giá nhất của FORMULA 1 trong những năm 1990 cho đến khi một vụ tai nạn trên đường đua suýt nữa đã kết thúc sự nghiệp của anh.. Ba mươi năm sau, Sonny trở thành một tay đua tự do, cho đến khi người đồng đội cũ của anh, Ruben Cervantes (Javier Bardem), chủ sở hữu một đội đua F1 đang trên bờ vực sụp đổ, tìm đến anh. Ruben thuyết phục Sonny quay lại với F1® để có một cơ hội cuối cùng cứu lấy đội và khẳng định mình là tay đua xuất sắc nhất thế giới. Anh sẽ thi đấu cùng Joshua Pearce (Damson Idris), tay đua tân binh đầy tham vọng của đội, người luôn muốn tạo ra tốc độ của riêng mình. Tuy nhiên, khi động cơ gầm rú, quá khứ của Sonny sẽ đuổi theo anh và anh nhận ra rằng trong F1, người đồng đội chính là đối thủ cạnh tranh lớn nhất—và con đường chuộc lại lỗi lầm không phải là điều có thể đi một mình.', 3, '2025-03-19 15:28:16', 3, '2025-03-19 15:28:16', 2),
(69, 'NÀNG BẠCH TUYẾT', 'nang-bach-tuyet', 108, 'film_67e2b220e8edc.jpg', 'film_67e2b220e8edc-2025.jpg', 'https://youtu.be/JtdaIC1ifV8', 'Marc Webb', 'Rachel Zegler, Gal Gadot, Andrew Burnap', 'Âu Mỹ', 2025, 'P', 'Câu chuyện của Nàng Bạch Tuyết ban đầu cũng giống như cổ tích, khi nàng công chúa mới chào đời, mang niềm vui và sự ấm áp tới cả vương quốc xinh đẹp. Mẹ mất sớm, cha bao bọc nàng bằng tất cả tình yêu thương, dạy nàng phải sống không sợ hãi, công bằng, dũng cảm và chân thành. Bạch Tuyết càng lớn lên càng lay động lòng người, với vẻ đẹp thuần khiết như ánh nắng ban mai và một trái tim thiện lương, nhân hậu. Thế nhưng, những ngày tháng vui vẻ không kéo dài lâu khi cha cô cũng qua đời. Ngày hoàng hậu mới lên ngôi, bóng tối bao trùm cả vương quốc. Độc ác và đầy dã tâm, ả không có lòng khoan dung, sẵn sàng trừng phạt bất cứ ai dám làm trái lệnh. Sự ghen ghét, đố kỵ của mẹ kế đẩy Bạch Tuyết vào cảnh nguy hiểm. Nàng phải chạy trốn vào rừng sâu, nơi cuộc phiêu lưu của nàng bắt đầu với những người bạn tốt bụng mới.', 3, '2025-03-25 20:39:44', 3, '2025-03-25 20:39:44', 1),
(70, 'Thanh Gươm Diệt Quỷ: Vô Hạn Thành', 'thanh-guom-diet-quy:-vo-han-thanh', 0, 'film_67e2b4e407d60.jpg', 'film_67e2b4e407d60-2025.jpeg', 'https://youtu.be/U0eSjZtRq8o', 'Sotozaki Haruo', 'Hanae Natsuki, Matsuoka Yoshitsugu, Kito Akari, Shimono Hiro', 'Nhật Bản', 2025, 'P', 'Kamado Tanjiro gia nhập Sát Quỷ Đoàn sau khi em gái Nezuko bị biến thành quỷ. Trong quá trình trưởng thành, Tanjiro đã chiến đấu với nhiều con quỷ cùng với các đồng đội Agatsuma Zenitsu và Hashibira Inosuke. Hành trình đưa cậu đến với cuộc chiến cùng những kiếm sĩ cấp cao nhất của Sát Quỷ Đoàn - các Trụ Cột - gồm Viêm Trụ Rengoku Kyojuro trên Chuyến Tàu Vô Tận, Âm Trụ Uzui Tengen tại Kỹ Viện Trấn, cũng như Hà Trụ Tokito Muichiro và Luyến Trụ Kanroji Mitsuri tại Làng Thợ Rèn.\r\nKhi các thành viên của Sát Quỷ Đoàn và Trụ Cột tham gia vào chương trình đặc huấn để chuẩn bị cho trận chiến sắp với lũ quỷ, Kibutsuji Muzan xuất hiện tại Dinh thự Ubuyashiki. Khi thủ lĩnh của Sát Quỷ Đoàn gặp nguy hiểm, Tanjiro và các Trụ Cột trở về trụ sở Thế nhưng, Muzan bất ngờ kéo toàn bộ Sát Quỷ Đoàn đến hang ổ cuối cùng của lũ quỷ là Vô Hạn Thành, mở màn cho trận đánh cuối cùng của cả hai phe.', 3, '2025-03-25 20:51:32', 3, '2025-03-25 20:51:32', 2),
(71, 'ÂM DƯƠNG LỘ', 'am-duong-lo', 119, 'film_67e2b6d8e128d.jpg', 'film_67e2b6d8e128d-2025.jpg', 'https://youtu.be/GOeKx7L8yyk', 'Hoàng Tuấn Cường', 'Bạch Công Khanh; Lan Thy; Minh Hoàng; Tuấn Dũng; Đại Nghĩa; Hạnh Thúy', 'Việt Nam', 2025, 'T16', 'Vì mưu sinh, một cử nhân thất nghiệp lén cha chở một thi thể nữ về Tây Nguyên ngay giữa đêm khuya. Trên hành trình, anh buộc phải đối mặt với một thế giới siêu nhiên đầy rẫy vong linh, một cô gái bí ẩn anh đem lòng tơ tưởng và một sự thật hắc ám gắn liền với chiếc xe cứu thương mà anh đang cầm lái', 3, '2025-03-25 20:59:52', 3, '2025-03-25 20:59:52', 1),
(72, 'CUỐC XE KINH HOÀNG', 'cuoc-xe-kinh-hoang', 88, 'film_67e2b76a769f1.jpg', 'film_67e2b76a769f1-2025.jpg', 'https://youtu.be/OW-hErjvlo8', 'Bruce Goodison', 'George Bukhari, Nick Frost, Synnove Karlsen, ...', 'Âu Mỹ', 2025, 'T18', 'Một tên tài xế taxi đưa một cặp đôi tới một con đường hẻo lánh bị ma ám, tiết lộ động cơ ghê rợn cùng ý định thật sự của hắn.\r\n', 3, '2025-03-25 21:02:18', 3, '2025-03-25 21:02:18', 2),
(73, 'HUYẾT ÁN TRUY HÀNH', 'huyet-an-truy-hanh', 83, 'film_67e2b7c67e742.jpg', 'film_67e2b7c67e742-2025.jpg', 'https://youtu.be/0FO7siaaRCI', 'Man Ki Kwok', 'Louis Koo, Ka-Tung Lam, Stephanie Che, Summer Chan', 'Trung Quốc', 2025, 'T18', 'Vào một đêm mưa, thi thể Gia Kỳ - con gái của cảnh sát Lạc Nhất Ngôn phát hiện tử vong. Vì không đủ bằng chứng kết tội, Khâu Tuấn Văn (nghi phạm) được thả tự do. Lạc Nhất Ngôn rời khỏi lực lượng cảnh sát. Thế nhưng, những cái chết không hề dừng lại, Lạc Nhất Ngôn nhận ra nhiều cô gái khác cũng bị sát hại dã man với cách thức giống nhau khiến ông tin rằng hung thủ thực sự vẫn còn đang nhởn nhơ ngoài vòng pháp luật. Qua quá trình điều tra, ông dần tìm ra nhân chứng duy nhất chứng kiến cảnh phạm tội của hung thủ. Đáng tiếc thay, nhân chứng lại là một cô bé thiểu năng trí tuệ. Bao nhiêu biến cố dần ập đến khiến người cha, người chồng, Lạc Nhất Ngôn gần như ngã quỵ… Liệu rằng Lạc Nhất Ngôn sẽ buông bỏ hiện thực hay ông sẽ vùng lên giành lại công lý cho con gái bị sát hại thảm thương?', 3, '2025-03-25 21:03:50', 3, '2025-03-28 20:56:22', 1),
(74, 'KAYARA: CÔ BÉ CHIẾN BINH', 'kayara:-co-be-chien-binh', 0, 'film_67e2b8663fa59.jpg', 'film_67e2b8663fa59-2025.jpg', 'https://youtu.be/eaiMFYbviF8', 'César Zelada', 'Đang cập nhật', 'Việt Nam', 2025, 'P', 'Kayara, một thiếu nữ xinh đẹp và mạnh mẽ, quyết tâm trở thành nữ sứ giả đầu tiên của Đế chế Inca. Trên hành trình đầy thử thách, cô gái phải vượt qua nhiều khó khăn và sự hiểm trở để bảo vệ thành phố Vàng khỏi những nguy cơ khai thác và cứu bạn bè, gia đình khỏi những mối đe dọa bất ngờ. Trong hành trình đầy thử thách đó, Kayara học được rằng sức mạnh thực sự không chỉ nằm ở thể chất mà còn ở sức mạnh của trí tuệ và sự đoàn kết.', 3, '2025-03-25 21:06:30', 3, '2025-03-25 21:06:30', 2),
(75, 'TÌM XÁC: MA KHÔNG ĐẦU', 'tim-xac:-ma-khong-dau', 0, 'film_67e2b8c9bcb96.jpg', 'film_67e2b8c9bcb96-2025.jpg', 'https://youtu.be/eNjevbgXQpw', 'Bùi Văn Hải', 'Tiến Luật; Ngô Kiến Huy; NSND Hồng Vân; NSƯT Hữu Châu; NSƯT Đại Nghĩa, Thanh Hương, Hoàng Mèo, Nghệ sĩ Phi Phụng, Phan Vũ.', 'Việt Nam', 2025, 'T18', 'Bộ đôi Tiến Luật và Ngô Kiến Huy, với nghề nghiệp \"độc lạ\" hốt xác và lái xe cứu thương, hứa hẹn mang đến những tràng cười không ngớt cho khán giả qua hành trình tìm xác có một không hai trên màn ảnh Việt. Nhờ sự trợ giúp của thế lực tâm linh, họ không chỉ đối mặt với những tình huống \"dở khóc dở cười\" mà còn khám phá ra những bí mật rợn người ẩn sau những thi thể. Liệu họ có hoàn thành nhiệm vụ \"khó nhằn\" này hay sẽ gặp phải những \"biến cố\" nào?', 3, '2025-03-25 21:08:09', 3, '2025-03-25 21:08:09', 2),
(76, 'PANOR: TÀ THUẬT HUYẾT NGẢI', 'panor:-ta-thuat-huyet-ngai', 117, 'film_67e2b91f428dd.jpg', 'film_67e2b91f428dd-2025.jpg', 'https://youtu.be/PFI1EkszP1o', 'Putipong Saisikaew', 'Cherprang Areekul, Jackrin Kungwankiatichai, Chalita Suansane', 'Thái Lan', 2025, 'T18', 'Câu chuyện xoay quanh PANOR, một cô gái trẻ ngây thơ sinh ra vào ngày đen tối khi một người nào đó trong làng giải phóng lời nguyền ma thuật đen. Panor được coi là điềm xấu, một người phụ nữ bị nguyền rủa mang lại vận rủi cho ngôi làng và bất kỳ ai dành thời gian với cô đều có nguy cơ trở thành nạn nhân của ma thuật đen. Panor sớm phát hiện ra rằng có thứ gì đó đen tối và mạnh mẽ đã theo dõi cô kể từ ngày cô được sinh ra, nguyền rủa cô phải sống một cuộc sống khốn khổ.', 3, '2025-03-25 21:09:35', 3, '2025-03-25 21:09:35', 2),
(77, 'LẬT MẶT 8: VÒNG TAY NẮNG', 'lat-mat-8:-vong-tay-nang', 0, 'film_67e2b9b4b5191.jpg', 'film_67e2b9b4b5191-2025.jpg', 'https://youtu.be/YzpGJXJU3Ug', 'Lý Hải', 'NSƯT Kim Phương, Long Đẹp Trai, NSƯT Tuyết Thu, Quách Ngọc Tuyên, Đoàn Thế Vinh, Hồng Thu, Yuno Bigboi, Anh Tú Wilson, Bảo Ngọc, Tín Nguyễn, Hồ Đông Quan, Cherry Hải My, Rio Hạo Nhiên,…', 'Việt Nam', 2025, 'P', 'Một bộ phim về sự khác biệt quan điểm giữa ba thế hệ ông bà cha mẹ con cháu. Ai cũng đúng ở góc nhìn của mình nhưng đứng trước hoài bão của tuổi trẻ, cuối cùng thì ai sẽ là người phải nghe theo người còn lại? Và nếu ước mơ của những đứa trẻ bị cho là viển vông, thì cơ hội nào và bao giờ tuổi trẻ mới được tự quyết định tương lai của mình?', 3, '2025-03-25 21:12:04', 3, '2025-03-25 21:12:04', 2),
(78, 'LILO & STITCH', 'lilo-&-stitch', 0, 'film_67e2ba36833c4.jpg', 'film_67e2ba36833c4-2025.jpg', 'https://youtu.be/A7jw6CZ7sAY', 'Dean Fleischer Camp', 'Maia Kealoha, Sydney Elizabeth Agudong, Tia Carrere, Chris Sanders', 'Âu Mỹ', 2025, 'P', 'Phiên bản live action của series Lilo & Stitch.', 3, '2025-03-25 21:14:14', 3, '2025-03-25 21:14:14', 2),
(79, 'YÊU VÌ TIỀN, ĐIÊN VÌ TÌNH', 'yeu-vi-tien--dien-vi-tinh', 114, 'film_67e2bafaa6562.jpg', 'film_67e2bafaa6562-2025.jpg', 'https://youtu.be/xZdBovEjalg', 'Hồ Miêu Kỵ', 'Ngô Quân Như, MC Trương Thiên Phú,…', 'Việt Nam', 2025, 'T16', 'Một tổ chức lừa đảo trực tuyến vừa bị triệt phá. Một bác sĩ nổi tiếng, thành đạt - Tiến sĩ Veronica Yu, được cho là nạn nhân, và chàng trai trẻ Joe Lee, được nhìn thấy gần hang ổ của tổ chức lừa đảo. Khi ranh giới giữa giả dối và cảm xúc dần xóa nhòa, tình yêu liệu có thật sự tồn tại hay chỉ là một màn kịch hoàn hảo?', 3, '2025-03-25 21:17:30', 3, '2025-03-25 21:17:30', 1),
(80, 'CÔ GÁI NĂM ẤY CHÚNG TA CÙNG THEO ĐUỔI', 'co-gai-nam-ay-chung-ta-cung-theo-duoi', 102, 'film_67e2bbc0e6ea2.jpg', 'film_67e2bbc0e6ea2-2025.jpg', 'https://youtu.be/SwNrR2-6wBM', 'Cho Young-Myoung', 'Jung Jinyoung, Kim Da-Hyun...', 'Hàn Quốc', 2025, 'T16', 'You Are the Apple of My Eye khắc họa một cách sống động những khoảnh khắc tươi trẻ của tuổi trẻ vào những năm 2000, những cảm xúc tinh tế của mối tình đầu. Jin-woo và những người bạn của anh ấy đều trải qua những thăng trầm của tuổi mới lớn với những sở thích và rắc rối riêng, lại được kết nối bởi một điều chung: Sun-Ah – cô học sinh mẫu mực, duyên dáng và xinh đẹp. Dù là bạn cùng lớp, nhưng trong mắt họ, Sun-Ah vẫn như một giấc mơ, khó có thể với tới. Bất chấp sự khác biệt về tính cách và thành tích học tập, mối liên kết giữa Jin-woo và Sun-Ah ngày càng bền chặt qua những lần cùng nhau khám phá những khía cạnh khác nhau của nhau. Mối quan hệ ấy lướt qua những cung bậc lãng mạn, ngọt ngào xen lẫn chút đắng cay của thời trung học, chạm đến tận sâu trái tim tuổi trẻ đầy cảm xúc.', 3, '2025-03-25 21:20:48', 3, '2025-03-25 21:20:48', 1),
(81, 'CÔNG CHÚA BĂNG GIÁ VÀ XỨ SỞ TRONG GƯƠNG', 'cong-chua-bang-gia-va-xu-so-trong-guong', 76, 'film_67e2bca85d948.jpg', 'film_67e2bca85d948-2025.jpg', 'https://youtu.be/3QGRVnXNofk', 'Andrey Korenkov, Alexey Tsitsilin', 'Đang cập nhật', 'Âu Mỹ', 2025, 'P', 'Phim xoay quanh công chúa băng giá Ila - con gái của Nữ hoàng Tuyết đang cai trị tại vùng đất Gương. Vốn là một cô bé tinh nghịch và khát khao khám phá thế giới, nhưng cô luôn bị mẹ quản nghiêm ngặt vì còn quá trẻ và chưa khai mở được bản năng phép thuật của mình. Một ngày, Ila tình cờ gặp gỡ 3 yêu tinh nhí. Họ là những du khách xuất hiện từ bên kia cánh cổng ma thuật. Ila quyết định kết bạn và hé lộ cho họ một bí mật tại vùng đất Gương. Ở hồ băng Gao có một phong ấn ma thuật bí ẩn - nơi giam giữ những linh hồn băng hàng nghìn năm. Trong lúc trổ tài trượt băng trên hồ Gao, Ila bất cẩn làm vỡ phong ấn khiến cho những linh hồn băng thoát ra ngoài. Để ngăn chặn mối nguy hiểm, Nữ hoàng Tuyết đã yêu cầu Ila cùng 3 yêu tính nhí đến thế giới loài người tìm kiếm Kai và Gerda, vì họ là những người duy nhất có thể giúp cô bé chống lại sức mạnh của những linh hồn băng. Từ đây, Ila bắt đầu hành trình khám phá thế giới mới với trọng trách to lớn nhằm chuộc lại lỗi lầm mà mình gây ra.', 3, '2025-03-25 21:24:40', 3, '2025-03-25 21:24:40', 1),
(82, 'IU CONCERT: THE WINNING', 'iu-concert:-the-winning', 124, 'film_67e2bdd1b2c12.jpg', 'film_67e2bdd1b2c12-2025.jpg', 'https://youtu.be/FOD0xlY2cjI', 'YU YANG', 'IU (Lee Ji-eun)', 'Hàn Quốc', 2025, 'P', 'IU CONCERT: THE WINNING tái hiện lại Hereh World Tour của nữ thần IU. Bộ phim là những khoảnh khắc tuyệt vời với những bản hit đình đám trong buổi hòa nhạc tại Sân vận động World Cup Seoul của IU.', 3, '2025-03-25 21:29:37', 3, '2025-03-25 21:29:37', 1),
(83, 'Rerun: EXHUMA: QUẬT MỘ TRÙNG MA', 'rerun:-exhuma:-quat-mo-trung-ma', 133, 'film_67e2be566e378.png', 'film_67e2be566e378-2024.jpg', 'https://youtu.be/7LH-TIcPqks', 'Jae-hyun Jang', 'Lee Do-hyun, Choi Min-sik', 'Hàn Quốc', 2024, 'T16', 'Một pháp sư được cấp một số tiền lớn để di dời một ngôi mộ. Anh ấy di chuyển cùng với người bạn đồng hành của mình, Ji Gwan.', 3, '2025-03-25 21:31:50', 3, '2025-03-25 21:31:50', 1),
(84, 'TỘI ĐỒ', 'toi-do', 0, 'film_67e407f2b3f1e.jpg', 'film_67e407f2b3f1e-2025.png', 'https://youtu.be/LxbcPHt_uNM', 'Ryan Coogler', 'Hailee Steinfeld, Jack O\'Connell, Michael B. Jordan', 'Âu Mỹ', 2025, 'T18', 'Mắc kẹt trong cuộc sống thực tại rối ren, cả hai quay trở lại quê nhà để có một khởi đầu mới, để rồi phát hiện một thế lực ác quỷ đang nhăm nhe chờ đợi họ.', 3, '2025-03-26 20:58:10', 3, '2025-03-26 20:58:10', 2),
(85, 'CƯỚI MA GIẢI HẠN', 'cuoi-ma-giai-han', 128, 'film_67e408a01fc8a.jpg', 'film_67e408a01fc8a-2025.jpg', 'https://youtu.be/CkVv1hHJl-M', 'Chayanop Boonprakob', 'Billkin, PP Krit', 'Thái Lan', 2025, 'P', 'Menn, một tên trộm cắp đang làm tay trong cho cảnh sát, đồng thời cũng là một gã trai thẳng chính hiệu. Ngày nọ, Menn vô tình nhặt được một bao lì xì đỏ bí ẩn và bị ràng buộc bởi khế ước siêu nhiên, bắt anh phải kết hôn với một hồn ma. Không dừng lại ở đó, số phận càng trớ trêu hơn khi “vợ” của Menn không chỉ là người cõi âm, mà còn là một “mỹ” vong dễ thương với tư tưởng cấp tiến tên Titi. Menn buộc phải giúp Titi tìm ra sự thật đằng sau vụ tai nạn cướp đi sinh mạng của cậu để Titi được siêu thoát và trả lại bình yên cho mình. Trùng hợp làm sao, tất cả đầu mối đều dẫn đến vụ buôn ma túy bất hợp pháp do Menn và Goi, nữ cảnh sát lớn tuổi mà Menn yêu mến, đang điều tra. Tin rằng việc phá án sẽ có lợi cho sự nghiệp và tình yêu của mình, Menn quyết định tham gia phi vụ bất bình thường này để giúp Titi, từ đó tạo nên một mối liên kết không tưởng giữa đồng tính và trai thẳng, giữa người sống và kẻ chết.', 3, '2025-03-26 21:01:04', 3, '2025-03-26 21:01:04', 2);
INSERT INTO `phim` (`MaPhim`, `TenPhim`, `TenRutGon`, `ThoiLuong`, `Anh`, `Banner`, `Trailer`, `DaoDien`, `DienVien`, `QuocGia`, `NamPhatHanh`, `PhanLoai`, `MoTa`, `NguoiTao`, `NgayTao`, `NguoiCapNhat`, `NgayCapNhat`, `TrangThai`) VALUES
(86, 'Chốt Đơn!', 'chot-don!', 0, 'film_67e4098d4155a.jpg', 'film_67e4098d4155a-2025.jpg', 'https://youtu.be/FWOuq8Blpcc', 'Bảo Nhân, NamCito', 'Nguyễn Thúc Thùy Tiên, Quyền Linh, Hồng Đào, NSND Hồng Vân, Khương Lê', 'Việt Nam', 2025, 'P', 'Chốt Đơn! xoay quanh cuộc sống tất bật của Hoàng Linh - nữ “chiến thần” chốt đơn trẻ đang thành công và chú An (Quyền Linh) một nhân viên văn phòng kiêm tài xế xe ôm công nghệ. Giữa những mơ hồ, thay đổi, áp lực của xã hội lên hai thế hệ, Hoàng Linh và chú An vốn đối lập từ tuổi tác, hoàn cảnh đến tính cách, lại tìm thấy một tình bạn thật trong sáng, khởi tạo nên những nhiệt huyết mới để mang đến những phiên “Chốt đơn!” thắng đậm.', 3, '2025-03-26 21:05:01', 3, '2025-03-26 21:05:01', 2),
(87, 'Phim Xì Trum', 'phim-xi-trum', 0, 'film_67e40a4f8e990.jpg', 'film_67e40a4f8e990-2025.jpg', 'https://youtu.be/LoB7btq9Bpo', 'Chris Miller', 'Rihanna, James Corden, Nick Offerman', 'Âu Mỹ', 2025, 'P', 'Kể về câu chuyện về ngôi làng Xì Trum, nơi mà mỗi ngày đều là lễ hội. Bỗng một ngày, sự yên bình của ngôi làng bị phá vỡ khi Tí Vua bị bắt cóc một cách bí ẩn bởi hai phù thủy độc ác Gà Mên và Cà Mên. Từ đây, Tí Cô Nương phải dẫn dắt các Tí đi vào thế giới thực để giải cứu ông. Với sự giúp đỡ của những người bạn mới, các Tí sẽ bước vào cuộc phiêu lưu khám phá định mệnh của mình để cứu lấy vũ trụ.', 3, '2025-03-26 21:08:15', 3, '2025-03-26 21:08:15', 2),
(88, 'Anh Trai \"Say Hi\": Kẻ Phản Diện Tạo Nên Người Hùng', 'anh-trai--say-hi-:-ke-phan-dien-tao-nen-nguoi-hung', 120, 'film_67e6abbb2c5d6.jpg', 'film_67e6ac18e5cf5-2025.jpeg', 'https://youtu.be/o2UFoLEalxE', 'Lê Hoàng Tuấn (Jason) & Nguyễn Duy Anh (Mr Blue)', 'Đang cập nhật', 'Việt Nam', 2025, 'P', 'Anh trai ‘say hi’”, hơn cả một chương trình âm nhạc thực tế sống còn 100% thuần Việt, được sáng tạo bởi trí tuệ Việt Nam, đáp ứng khao khát “đu idol quốc nội” của người trẻ Việt và được yêu thương, ủng hộ bởi người hâm mộ văn hoá bản địa. “Anh trai ‘say hi’” là người hùng trong công cuộc thay đổi nền công nghiệp giải trí Việt Nam, và người hùng “Anh trai ‘say hi’” đã chiến đấu với những “kẻ phản diện” của chính mình để viết nên lịch sử. “Kẻ phản diện” mang tên hoài nghi, lo sợ trước cam kết “100% mới”: format hoàn toàn mới, âm nhạc hoàn toàn mới, diện mạo thần tượng hoàn toàn mới; “kẻ phản diện” mang tên “định kiến thần tượng quốc nội” luôn thua kém những tên tuổi quốc tế. Chưa bao giờ trong lịch sử concert âm nhạc Việt Nam được chứng kiến chuỗi đêm diễn tại các thành phố lớn đạt kỷ lục “cháy” hơn 178,000 vé mà không cần bất cứ “idol” quốc tế nào tham gia. “Kẻ phản diện” thậm chí ẩn náu trong mỗi anh trai, họ không thấy mặt, không gọi được tên và tất nhiên không thể vượt qua nếu không cùng “Anh trai ‘say hi’” trải qua hành trình lịch sử. KHÔNG CÓ NGƯỜI HÙNG VĨ ĐẠI NẾU THIẾU KẺ PHẢN DIỆN ĐÁNG GỜM. \"Anh trai \'say hi\'” đã thay đổi nền văn hoá thần tượng Việt Nam mãi mãi.\r\n', 3, '2025-03-28 21:01:31', 3, '2025-03-28 21:03:20', 1),
(89, 'Nụ Hôn Bạc Tỷ', 'nu-hon-bac-ty', 100, 'film_67e6acea27683.jpg', 'film_67e6acea27683-2025.jpg', 'https://youtu.be/vUGel4p21yo', 'Thu Trang', 'Thu Trang, Đoàn Thiên Ân, Lê Xuấn Tiến, Tiến Luật', 'Việt Nam', 2025, 'T13', 'Câu chuyện xoay quanh Vân - cô gái bán bánh mì vô tình gặp phải hai chàng trai trong một tai nạn nhỏ. Làm thế nào khi tiếng sét ái tình đánh một lúc cả ba người? Liệu giữa một chàng trai chững chạc, nam tính và một chàng trai đôi chút ngông nghênh, cool ngầu - đâu sẽ là “Nụ Hôn Bạc Tỷ” của cô gái xinh đẹp?', 3, '2025-03-28 21:06:34', 3, '2025-03-28 21:06:34', 1),
(90, 'Bộ Tứ Báo Thủ', 'bo-tu-bao-thu', 132, 'film_67e6addfaf346.jpg', 'film_67e6addfaf346-2025.jpg', 'https://youtu.be/ADxzYuEN9fM', 'Trấn Thành', 'Trấn Thành, Lê Giang, Lê Dương Bảo Lâm, Uyển Ân, Trần Tiểu Vy, Nguyễn Cao Kỹ Duyên, Trần Quốc Anh', 'Việt Nam', 2025, 'T16', 'Trấn Thành là một trong những đạo diễn ăn khách nhất thị trường phim Việt hiện nay, những tác phẩm mà anh làm ra thường có doanh thu hàng trăm tỷ đồng và làm nên sự sôi động của thị trường phim Việt. Ba bộ phim.\r\nĐã đem về doanh thu phòng vé lên đến hàng nghìn tỷ đồng và đưa tên tuổi Trấn Thành trở thành “đạo diễn nghìn tỷ”. Năm nay, Trấn Thành tiếp tục quay lại đường đua phim tết với Bộ Tứ Báo Thủ.\r\nBộ phim diễn ra khi Quốc Anh (Quốc Anh) và Quỳnh Anh (Tiểu Vy) yêu nhau đang đến lúc “nhạt”. Nhận ra điều này, Quỳnh Anh lên kế hoạch hâm nóng mối quan hệ của mình, với sự quân sư giúp đỡ Bộ tứ thân thiết gồm Dì 4 (Lê Giang), Cậu 11(Trấn Thành), Kiều (Uyển Ân) và Jessica (Lê Dương Bảo Lâm). Tuy nhiên, “giúp đâu, hỏng đấy”, hành trình “thêm muối” của những Báo Thủ này gặp phải những trở ngại gì nữa?', 3, '2025-03-28 21:10:39', 3, '2025-03-28 21:10:39', 1),
(91, 'MAI (Chiếu Lại)', 'mai-(chieu-lai)', 131, 'film_67e6aec2bf6b3.jpg', 'film_67e6aec2bf6b3-2024.jpg', 'https://youtu.be/Yz96EBNwMGw', 'Trấn Thành', 'Tuấn Trần , Phương Anh Đào, Trấn Thành, Hồng Đào, Anh Đức, Khả Như', 'Việt Nam', 2024, 'T18', 'Mai xoay quanh câu chuyện về cuộc đời của một người phụ nữ cùng tên với bộ phim. Trên First-look Poster, Phương Anh Đào tạo ấn tượng mạnh với cái nhìn tĩnh lặng, xuyên thấu, đặc biệt, trên bờ môi nữ diễn viên là hình ảnh cô đang nằm nghiêng trên mặt nước. Được phủ một màn sương mờ ảo, poster đậm chất nghệ thuật của Mai gây tò mò với lời tựa: “Quá khứ chưa ngủ yên, ngày mai liệu sẽ đến?”.', 3, '2025-03-28 21:14:26', 3, '2025-03-28 21:14:26', 1),
(92, 'Năm Mười', 'nam-muoi', 0, 'film_67e6b0b9cb785.jpg', 'film_67e6b0b9cb785-2025.jpg', '', 'Tấn Hoàng Thông', 'Huỳnh Tú Uyên, Trần Vân Anh, Trần Phong', 'Việt Nam', 2025, 'T18', 'Năm Mười lấy cảm hứng từ trò chơi quen thuộc Năm Mười, câu chuyện xoay quanh một nhóm bạn cùng nhau đi nghỉ dưỡng tại Đà Lạt. Chuyến đi tưởng như chữa lành bỗng nhiên trở thành tai hoạ khi họ cùng chơi trò Năm Mười và một bí mật kinh hoàng năm xưa được hé lộ.', 3, '2025-03-28 21:22:49', 3, '2025-03-28 21:22:49', 2),
(93, 'Pororo Thám Hiểm Đại Dương Xanh', 'pororo-tham-hiem-dai-duong-xanh', 0, 'film_67e6b1665dc4c.jpg', 'film_67e6b1665dc4c-2025.jpg', 'https://youtu.be/H7OO5Ivcy1M', 'Kim Hyun Ho', 'Đang cập nhật', 'Hàn Quốc', 2025, 'P', 'Pororo: Underwater Adventure/ Pororo Thám Hiểm Đại Dương Xanh kể về Pororo và những người bạn trong chuyến phiêu lưu thám hiểm đại dương cùng vô vàn những điều kỳ bí và những bài học bổ ích về biển xanh dành cho các bạn nhỏ. Ước mơ trở thành vệ binh bảo vệ biển cả, Pororo cùng các bạn đã đến thăm binh đoàn Red Hunter nhưng lại vô tình bị \'quái vật\' Seatus nuốt chửng. Để giải cứu bạn của mình, Pororo đã vô tình chạm mặt với Marine và phát hiện ra những âm mưu phía sau của binh đoàn Red Hunter.', 3, '2025-03-28 21:25:42', 3, '2025-03-28 21:25:42', 2),
(94, 'Lưỡi Hái Tử Thần: Huyết Thống', 'luoi-hai-tu-than:-huyet-thong', 109, 'film_67e6b25d7b192.jpg', 'film_67e6b25d7b192-2025.jpg', 'https://youtu.be/E3Z-L0a-VVU', 'Đang cập nhật', 'Kaitlyn Santa Juana, Teo Briones, Richard Harmon, Owen Patrick Joyner, Anna Lore', 'Âu Mỹ', 2025, 'T18', 'Thương hiệu kinh dị đình đám Hollywood Final Destination sẽ trở lại với phần phim mới, hứa hẹn khuấy đảo phòng vé mùa hè 2025. Final Destination: Bloodlines là phần thứ 6 trong series, và cho đến hiện tại, các thông tin về nội dung phần phim này vẫn đang được giữ kín. Bộ đôi Zach Lipovsky và Adam Stein được chọn từ hơn 200 ứng viên để ngồi ghế đạo diễn, trong khi Guy Busick - biên kịch của Ready or Not sẽ chấp bút cho bộ phim. Tony Todd - gương mặt quen thuộc của series cũng sẽ trở lại trong phần 6 với vai diễn William Bludworth. Phim dự kiến ra mắt tháng 05.2025.', 3, '2025-03-28 21:29:49', 3, '2025-03-28 21:29:49', 2),
(95, 'Bí Mật Kinh Hoàng', 'bi-mat-kinh-hoang', 0, 'film_67e6b311c8ea5.jpg', 'film_67e6b311c8ea5-2025.jpg', 'https://youtu.be/L2r9X--a3oQ', 'David F. Sandberg', 'Ella Rubin, Michael Cimino, Odessa A\'zion, Ji-young Yoo, Belmont Cameli', 'Âu Mỹ', 2025, 'T18', '10 năm sau Until Dawn, thế giới kinh dị nay bước lên màn ảnh rộng. Một nhóm bạn lạc lõng giữa bóng tối, một ngôi nhà chứa đầy bí mật, và một sát nhân đeo mặt nạ mang theo lời nguyền chết chóc.', 3, '2025-03-28 21:32:49', 3, '2025-03-28 21:32:49', 2),
(96, 'Code: Phản Ước', 'code:-phan-uoc', 0, 'film_67e6b3bac644c.jpg', 'film_67e6b3bac644c-2025.jpg', '', 'V Pictures, Silver Moonlight Entertainment', 'Đang cập nhật', 'Âu Mỹ', 2025, 'T18', 'Đăng Thức, một nhân viên ngân hàng đang gặp khủng hoảng tài chính \'vô tình\' được người bạn cũ giới thiệu một ứng dụng điện thoại bí ẩn tên CODE giúp người sử dụng đạt được bất kỳ mong ước nào nhưng không biết rằng đây chính là cái bẫy công nghệ được thiết lập dành riêng cho mình...', 3, '2025-03-28 21:35:38', 3, '2025-03-28 21:35:48', 2),
(97, 'Đèn Âm Hồn', 'den-am-hon', 101, 'film_67e6b45f76a57.jpg', 'film_67e6b45f76a57-2025.jpg', 'https://youtu.be/PWdeLkzoJ5s', 'Hoàng Nam', 'Chiều Xuân, NSƯT Quang Tèo, Hạo Khang, Hoàng Kim Ngọc, Diễm Trang', 'Việt Nam', 2025, 'T18', 'Lấy cảm các từ Chuyện Người Con Gái Nam Xương, Đèn Âm Hồn xảy tại một ngôi làng miền Bắc vào thời phong kiến. Thương một mình nuôi con trai chờ chồng đi lính trở về. Lĩnh (con Thương) vô tình nhặt được một cây đèn, từ đó cậu gọi chiếc bóng hiện trên tường là cha. Theo lời của cô đồng trong làng, đây là cây đèn âm hồn, có thể đã triệu hồn một ác linh quay lại báo thù. Từ đây, những sự kiện bất thường ma quái xảy ra với Thương và cả dân làng. Liệu chiếc bóng đó có phải là chồng của Thương, cha của Lĩnh hay không?', 3, '2025-03-28 21:38:23', 3, '2025-03-28 21:38:23', 1),
(98, 'Tay Nghiệp Dư', 'tay-nghiep-du', 0, 'film_67e6b5c468a36.jpg', 'film_67e6b5c468a36-2025.jpg', 'https://youtu.be/W8w9iOqkP1U', 'James Hawes', 'Rami Malek, Rachel Brosnahan, Caitriona Balfe, Laurence Fishburne, Holt McCallany', 'Âu Mỹ', 2025, 'P', 'Theo chân một nhà mật mã học của CIA, người đã tống tiền cơ quan của anh ta để thả anh ta ra truy đuổi một nhóm khủng bố đã giết vợ anh ta ở London.', 3, '2025-03-28 21:44:20', 3, '2025-03-28 21:44:20', 2),
(99, '28 Năm Sau: Hậu Tận Thế', '28-nam-sau:-hau-tan-the', 0, 'film_67e6b61214ca6.jpg', 'film_67e6b61214ca6-2025.jpg', 'https://youtu.be/ayEp01lTdJs', 'Danny Boyle', 'Cillian Murphy, Jodie Comer, Aaron Taylor-Johnson, Ralph Fiennes, Jack O\'Connell', 'Âu Mỹ', 2025, 'T18', '28 Năm Sau: Hậu Tận Thế kể về nơi không còn ranh giới giữa sự sống và cái chết. Trong thế giới đổ nát này, một nhóm người sống sót quyết định bước ra khỏi nơi ẩn náu để tìm kiếm một tương lai mới. Nhưng ngoài kia, xác sống đã tiến hóa, và chính con người mới là hiểm họa lớn nhất.', 3, '2025-03-28 21:45:38', 3, '2025-03-28 21:45:38', 2),
(100, 'Mortal Kombat 2', 'mortal-kombat-2', 0, 'film_67e6b6e796b90.jpg', 'film_67e6b6e796b90-2025.jpg', 'https://youtu.be/hmfFKkvvflg', 'Simon McQuoid', 'Karl Urban, Lewis Tan, Jessica McNamee, Mehcad Brooks, Ludi Lin', 'Âu Mỹ', 2025, 'T18', 'Và khép lại một năm đầy hứa hẹn của nhà Warner Bros. sẽ là Mortal Kombat 2, phần tiếp theo của Mortal Kombat năm 2021, dựa trên tựa game đối kháng nổi tiếng cùng tên. Dàn diễn viên của phần trước bao gồm các ngôi sao võ thuật như Lewis Tan, Jessica McNamee, Mehcad Brooks, Tadanobu Asano, Ludi Lin, Joe Taslim, Hiroyuki Sanada và Max Huang đều sẽ trở lại, cùng với sự bổ sung gương mặt mới Karl Urban trong vai Johnny Cage.', 3, '2025-03-28 21:49:11', 3, '2025-03-28 21:49:11', 2),
(101, 'Heo Năm Móng', 'heo-nam-mong', 0, 'film_67e6b745ba66f.jpg', 'film_67e6b745ba66f-2025.jpg', '', 'Đang cập nhật', 'Đang cập nhật', 'Việt Nam', 2025, 'T18', 'Từ nhà sản xuất của Quỷ Cẩu và Linh Miêu, Heo Năm Móng là bộ phim kinh dị nằm trong vũ trũ linh dị. Heo Năm Móng là câu chuyện về loài vật xuất hiện trong văn hoá dân gian của người Khmer.', 3, '2025-03-28 21:50:45', 3, '2025-03-28 21:50:45', 2),
(102, 'Đại Hải Chiến Noryang: Biển Chết', 'dai-hai-chien-noryang:-bien-chet', 152, 'film_67e6b84ee8c95.jpg', 'film_67e6b84ee8c95-2024.jpg', 'https://youtu.be/zn-LXhgn2rs', 'Kim Han-min', 'Song Yo-sep, Kim Joong-hee, Choi Jung-tae, Choi Kwang-je, Ju Seok-tae', 'Hàn Quốc', 2024, 'T18', 'Đại Hải Chiến Noryang: Biển Chết lấy bối cảnh cuối thế kỉ 16, tác phẩm sẽ xoay quanh trận đánh thuộc hàng ác liệt nhất giai đoạn chiến tranh Nhâm Nhìn (1592 – 1598), đồng thời cũng là trận đánh bi tráng nhất sự nghiệp cầm quân của Đô đốc Lý Thuấn Thần.', 3, '2025-03-28 21:55:10', 3, '2025-03-28 21:55:10', 1),
(103, 'Mật Vụ Ong', 'mat-vu-ong', 105, 'film_67e6b8c9bda98.jpg', 'film_67e6b8c9bda98-2024.jpg', 'https://youtu.be/GqG8fXZI5T4', 'David Ayer', 'Phylicia Rashad, Reza Diako, Adam Basil, Taylor James, Dan Li', 'Âu Mỹ', 2024, 'T18', 'Jason Statham vào vai Adam Clay, một người nuôi ong cần mẫn và đơn độc. Anh có mối quan hệ tốt với bà chủ nhà, thậm chí coi bà như người thân duy nhất của mình. Thế nhưng, một sự kiện xảy ra khiến bà qua đời, và “người nuôi ong” Adam Clay quyết định bắt đầu kế hoạch trả thù tàn bạo của mình. Trong khi Clay vạch trần bí mật đằng sau đường dây lừa đảo cỡ lớn và bắt những kẻ có tội phải trả giá, thân phận thật của anh cũng dần được hé lộ.', 3, '2025-03-28 21:57:13', 3, '2025-03-28 21:57:25', 1),
(104, 'Thanh Gươm Diệt Quỷ: Phép Màu Tình Thân, Cho Đến Chuyến Đặc Huấn Của Đại Trụ', 'thanh-guom-diet-quy:-phep-mau-tinh-than--cho-den-chuyen-dac-huan-cua-dai-tru', 103, 'film_67e6b96b7c309.jpg', 'film_67e6b96b7c309-2024.jpg', 'https://youtu.be/SXcCdQdcBtw', 'Haruo Sotozaki', 'Toshio Furukawa, Katsuyuki Konishi, Takahiro Sakurai, Kengo Kawanishi, Tomokazu Seki', 'Nhật Bản', 2024, 'T16', 'Phim lấy bối cảnh ở làng thợ rèn, kể về hồi kết của trận ác chiến giữa Tanjiro với Thượng Huyền Tứ Hantengu, và việc Nezuko khắc chế được mặt trời. Thêm vào đó, tập đầu tiên của phần \"Đại Trụ Đặc Huấn\", mở màn cho khóa đặc huấn của các Đại Trụ cho cuộc quyết chiến với Kibutsuji Muzan.', 3, '2025-03-28 21:59:55', 3, '2025-03-28 21:59:55', 1),
(105, 'Kung Fu Panda 4', 'kung-fu-panda-4', 94, 'film_67e6b9ffc96b1.jpg', 'film_67e6b9ffc96b1-2024.jpg', 'https://youtu.be/8MhTBKv-mSg', 'Mike Mitchell', 'Lucy Liu, David Cross, Seth Rogen, Jackie Chan, Angelina Jolie', 'Trung Quốc', 2024, 'P', 'Sau khi Po được chọn trở thành Thủ lĩnh tinh thần của Thung lũng Bình Yên, Po cần tìm và huấn luyện một Chiến binh Rồng mới, trong khi đó một mụ phù thủy độc ác lên kế hoạch triệu hồi lại tất cả những kẻ phản diện mà Po đã đánh bại về cõi linh hồn.', 3, '2025-03-28 22:02:23', 3, '2025-03-28 22:02:23', 1),
(106, 'Godzilla x Kong: Đế Chế Mới', 'godzilla-x-kong:-de-che-moi', 115, 'film_67e6ba7e48f21.jpg', 'film_67e6ba7e48f21-2024.jpg', 'https://youtu.be/EN5Nbnh8Z7U', 'Adam Wingard', 'Dan Stevens, Rebecca Hall, Brian Tyree Henry, Kaylee Hottle, Fala Chen', 'Âu Mỹ', 2024, 'P', 'Kong và Godzilla - hai sinh vật vĩ đại huyền thoại, hai kẻ thủ truyền kiếp sẽ cùng bắt tay thực thi một sứ mệnh chung mang tính sống còn để bảo vệ nhân loại, và trận chiến gắn kết chúng với loài người mãi mãi sẽ bắt đầu.', 3, '2025-03-28 22:04:30', 3, '2025-03-28 22:04:30', 1),
(107, 'Dune 2: Hành Tinh Cát', 'dune-2:-hanh-tinh-cat', 166, 'film_67e6bb3463870.jpg', 'film_67e6bb3463870-2024.jpg', 'https://youtu.be/_DS9QpvtAjE', 'Denis Villeneuve', 'Timothee Chalamet, Zendaya, Rebecca Ferguson, Javier Bardem, Florence Pugh', 'Âu Mỹ', 2024, 'T16', 'Dune. 2: Hành Tinh Cát sẽ tiếp tục khám phá hành trình đậm chất thần thoại của Paul Atreides khi anh đồng hành cùng Chani và những người Fremen trên chặng đường trả thù những kẻ đã hủy hoại gia đình mình. Đối mặt với những lựa chọn giữa tình yêu của cuộc đời mình và số phận của vũ trụ, Paul phải ngăn chặn viễn cảnh tương lai tồi tệ chỉ mình anh nhìn thấy.', 3, '2025-03-28 22:07:32', 3, '2025-03-28 22:07:32', 1),
(108, 'Garfield: Mèo Béo Siêu Quậy', 'garfield:-meo-beo-sieu-quay', 101, 'film_67e6bc0f0eaee.jpg', 'film_67e6bc0f0eaee-2024.jpg', 'https://youtu.be/hMrTVMZS0TA', 'Mark Dindal', 'Gregg Berger, Bowen Yang, Brett Goldstein, Cecily Strong, Ving Rhames', 'Âu Mỹ', 2024, 'P', 'Trong bộ phim hoạt hình này, chú mèo mê đồ ăn Garfield bị cuốn vào một vụ trộm để giúp cha mình - một tên trộm đường phố, khỏi một chú mèo biểu diễn khác đang muốn trả thù ông. Bắt đầu như một mối quan hệ hợp tác miễn cưỡng và kết thúc bằng việc Garfield và Vic nhận ra rằng cha con họ không hề khác biệt như vẻ ngoài của mình.', 3, '2025-03-28 22:11:11', 3, '2025-03-28 22:11:11', 1),
(109, 'Phim Điện Ảnh Doraemon: Nobita Và Bản Giao Hưởng Địa Cầu', 'phim-dien-anh-doraemon:-nobita-va-ban-giao-huong-dia-cau', 115, 'film_67e6bc8d19c68.jpg', 'film_67e6bc8d19c68-2024.jpg', 'https://youtu.be/Yug8gbDd5EQ', 'Kazuaki Imai', 'Wasabi Mizuta, Megumi Oohara, Yumi Kakazu, Subaru Kimura, Tomokazu Seki', 'Nhật Bản', 2024, 'P', 'Đây là phần thứ 43 trong loạt phim điện ảnh Doraemon 2D, và là phần phim điện ảnh đầu tiên của thương hiệu Mèo Ú lấy chủ đề âm nhạc. Để chuẩn bị cho buổi hòa nhạc ở trường, Nobita phải tập thổi sáo, trong khi cậu chẳng giỏi khoản này chút nào. Bạn bè ở trường - bao gồm cả Jaian và Suneo - không ngừng trêu chọc Nobita với nốt \"No\" lạc quẻ mà cậu tạo ra. Thế nhưng, một cô bạn kỳ lạ có tên Micca lại bị chinh phục bởi âm thanh kỳ quặc này! Và thế là, Micca đã mời cả Nobita, Doraemon cùng nhóm bạn thân đến với cung điện Farre - tọa lạc tại một hành tinh sử dụng năng lượng từ âm nhạc. Với bảo bối mới \"chứng chỉ chuyên viên âm nhạc\", Doraemon cùng nhóm bạn giúp Micca tìm ra một \"virtuoso\" - bậc thầy âm nhạc sẽ cùng cô biểu diễn nhằm cứu lấy cung điện Farre. Thế nhưng, một thế lực bí ẩn và đáng sợ đang nhăm nhe xóa sổ âm nhạc khỏi thế giới này!? Liệu những người bạn nhỏ có thể cứu lấy âm nhạc và cả Trái Đất của chúng ta?', 3, '2025-03-28 22:13:17', 3, '2025-03-28 22:13:17', 1),
(110, 'Furiosa: Câu Chuyện Từ Max Điên', 'furiosa:-cau-chuyen-tu-max-dien', 148, 'film_67e6bcf37ebc8.jpg', 'film_67e6bcf37ebc8-2024.jpg', 'https://youtu.be/BUwndlpdbVU', 'George Miller', 'Anya Taylor-Joy, Chris Hemsworth, CJ. Bloomfield, Goran D. Kleut, Daniel Webber', 'Âu Mỹ', 2024, 'T18', 'Câu chuyện bắt đầu từ lúc Thế giới sụp đổ, Furiosa phải tự cứu lấy mình để trở về nhà. Một cuộc phiêu lưu hành động độc lập khốc liệt, tiền truyện về quái nữ đồng hành với Max Rockatansky.', 3, '2025-03-28 22:14:59', 3, '2025-03-28 22:14:59', 1),
(111, 'Những Mảnh Ghép Cảm Xúc 2', 'nhung-manh-ghep-cam-xuc-2', 96, 'film_67e6bd79ad43d.jpg', 'film_67e6bd79ad43d-2024.jpg', 'https://youtu.be/XkWHScWxoiI', 'Kelsey Mann', 'Maya Hawke, Liza Lapira, Tony Hale, Lewis Black, Phyllis Smith', '', 2024, 'P', 'Một cuộc phiêu lưu hoàn toàn mới bên trong đầu của Riley với 9 cảm xúc mới.', 3, '2025-03-28 22:17:13', 3, '2025-03-28 22:17:13', 1),
(112, 'Những Gã Trai Hư: Chơi Hay Bị Xơi', 'nhung-ga-trai-hu:-choi-hay-bi-xoi', 110, 'film_67e6bdd175954.jpg', 'film_67e6bdd175954-2024.jpg', 'https://youtu.be/jFCmy8BgT9o', 'Adil El Arbi', 'Will Smith, Martin Lawrence', 'Âu Mỹ', 2024, 'T18', 'Sự trở lại của bộ đôi cảnh sát Mike Lowrey và Marcus Burnett do Will Smith và Martin Lawrence thủ vai. Theo đó nhiệm vụ 2 thảm tử này trong phần 4 đó là giúp chứng minh sự trong sạch của Đại úy sở cảnh sát của họ, người không may qua đời ở phần 3. Trong lúc cứ găng minh oan cho sếp của mình rằng ông không tham nhũng và tiếp tay cho băng đảng ma túy, 2 nhân vật chính cũng trở thành tội phạm bị truy nã khắp đất nước và cũng phải tìm cách chứng minh sự trong sạch của bản thân.', 3, '2025-03-28 22:18:41', 3, '2025-03-28 22:18:41', 1),
(113, 'Cửu Long Thành Trại: Vây Thành', 'cuu-long-thanh-trai:-vay-thanh', 124, 'film_67e6be3e28b77.jpg', 'film_67e6be3e28b77-2024.jpg', 'https://youtu.be/mkvZ5sZtK5U', 'Soi Cheang', 'Cổ Thiên Lạc, Sammo Hung, Raymond Lam, Terrance Lau, Richie Jen', 'Trung Quốc', 2024, 'T18', 'Lạc Quân nhập cảnh trái phép vào Hồng Kông và được Quyền Phong giúp đỡ để tồn tại ở Cửu Long Thành Trại - khu vực phức tạp có rất nhiều băng đảng xã hội đen. Trong lúc gặp nạn họ vô tình phát hiện ra quy luật ngầm giữa sự hỗn loạn phía sau nó. Đứng trước những thế lực tội ác, họ đứng lên chống lại âm mưu đen tối của kẻ thù để giữ lời thề bảo vệ sự bình yên của nơi này.', 3, '2025-03-28 22:20:30', 3, '2025-03-28 22:20:30', 1),
(114, 'Kẻ Trộm Mặt Trăng 4', 'ke-trom-mat-trang-4', 94, 'film_67e6be984a4ae.jpg', 'film_67e6be984a4ae-2024.jpg', 'https://youtu.be/l3oHhZCuTA4', 'Chris Renaud', 'Dana Gaier, Steve Coogan, Miranda Cosgrove, Pierre Coffin, Kristen Wiig', 'Âu Mỹ', 2024, 'P', 'Gru phải đối mặt với kẻ thù mới là Maxime Le Mal và Valentina đang lên kế hoạch trả thù anh, buộc gia đình anh phải lẩn trốn đi nơi khác. Bên cạnh việc đấu tranh bảo vệ gia đình, Gru đồng thời còn phải tìm ra điểm chung với thành viên mới nhất trong nhà đó là Gru Jr.', 3, '2025-03-28 22:22:00', 3, '2025-03-28 22:22:00', 1),
(115, 'Deadpool 3: Deadpool & Wolverine', 'deadpool-3:-deadpool-&-wolverine', 128, 'film_67e6bef064f7c.jpg', 'film_67e6bef064f7c-2024.jpeg', 'https://youtu.be/lW4-A3ZQnVQ', 'Shawn Levy', 'Ryan Reynolds, Hugh Jackman, Emma Corrin, Matthew MacFadyen, Dafne Keen', 'Âu Mỹ', 2024, 'T18', 'Wolverine hợp sức với Deadpool để đánh bại kẻ thù chung.', 3, '2025-03-28 22:23:28', 3, '2025-03-28 22:23:28', 1),
(116, 'Vây Hãm Trên Không', 'vay-ham-tren-khong', 100, 'film_67e6bf51df0f6.jpg', 'film_67e6bf51df0f6-2024.jpg', 'https://youtu.be/1Umr4h5dn5I', 'Kim Sung-han', 'Ha Jung-Woo, Yeo Jin-goo, Sung Dong-il, Chae Soo-bin, Moon You-kang', 'Hàn Quốc', 2024, 'T16', '\"Từ giờ trở đi, chiếc máy bay này sẽ tới Triều Tiên!”. Bộ phim hành động ly kỳ dựa trên sự kiện có thật với sự tham gia của Ha Jung Woo, Yeo Jin Goo và Sung Dong Il được dựa trên một sự kiện có thật năm 1971, khi một thanh niên Hàn Quốc định cướp một chiếc máy bay chở khách khởi hành từ thành phố cảnh phía đông Sokcho bay tới Seoul. Mọi người trên chuyến bay này đều đang đặt cược mạng sống của mình!', 3, '2025-03-28 22:25:05', 3, '2025-03-28 22:25:05', 1),
(117, 'Phim Điện Ảnh Conan 27: Ngôi Sao 5 Cánh 1 Triệu Đô', 'phim-dien-anh-conan-27:-ngoi-sao-5-canh-1-trieu-do', 111, 'film_67e6c03313ef8.jpg', 'film_67e6c03313ef8-2024.jpg', 'https://youtu.be/x_gGMJOppAo', 'Tomoka Nagaoka', 'Minami Takayama, Wakana Yamazaki, Rikiya Koyama, Ryou Horikawa, Yûko Miyamura', 'Nhật Bản', 2024, 'T13', 'Trong khi đến Hakodate tham gia một giải kiếm đạo, Conan và Heiji đụng độ siêu trộm Kaito Kid - khi hắn đang nhắm tới một thanh kiếm Nhật được cất giấu trong nhà kho của một gia đình tài phiệt. Thi thể một tay buôn vũ khí khét tiếng được phát hiện với vết chém hình chữ thập, và trùng hợp thay, \"kho báu\" mà gã truy lùng dường như cũng có liên quan mật thiết đến thanh kiếm cổ mà Kid đang nhắm tới.', 3, '2025-03-28 22:28:51', 3, '2025-03-28 22:28:51', 1),
(118, 'Mộ Đom Đóm', 'mo-dom-dom', 89, 'film_67e6c0c6154e6.jpg', 'film_67e6c0c6154e6-2024.jpg', 'https://youtu.be/CpcQcKIDYFs', 'Isao Takahata', 'Tsutomu Tatsumi, Ayano Shiraishi, Yoshiko Shinohara, Akemi Yamaguchi', 'Nhật Bản', 2024, 'P', 'Bộ phim được đặt trong bối cảnh giai đoạn cuối chiến tranh thế giới thứ 2 ở Nhật, kể về câu chuyện cảm động về tình anh em của hai đứa trẻ mồ côi là Seita và Setsuko. Hai anh em mất mẹ trong một trận bom dữ dội của không quân Mỹ khi cha của chúng đang chiến đấu cho Hải quân Nhật. Hai đứa bé phải vật lộn giữa nạn đói, giữa sự thờ ơ của những người xung quanh (trong đó có cả người cô họ của mình)... Bi kịch thấm đẫm nước mắt.', 3, '2025-03-28 22:31:18', 3, '2025-03-28 22:31:18', 1),
(119, 'Nhím Sonic 3', 'nhim-sonic-3', 110, 'film_67e6c2df09c1d.jpg', 'film_67e6c2df09c1d-2024.jpg', 'https://youtu.be/9ZQMzTr0K4I', 'Jeff Fowler', 'Melody Nosipho Niemann, Adam Pally, Natasha Rothwell, Tom Butler, Shemar Moore', 'Âu Mỹ', 2024, 'P', 'Sonic the Hedgehog 3 (Nhím Sonic 3) xảy ra khi Sonic, Knuckles và Tails phải đối mặt với một kẻ thù mới cức kì mạnh mẽ là Shadow - một nhân vật phản diện bí ẩn với sức mạnh không giống bất kỳ đối thủ nào họ từng đối mặt trước đây. Bị áp đảo về năng lực, Sonic phải lên đường thành lập một liên minh to lớn hơn.', 3, '2025-03-28 22:40:15', 3, '2025-03-28 22:40:15', 1),
(120, 'Aquaman 2 Và Vương Quốc Thất Lạc', 'aquaman-2-va-vuong-quoc-that-lac', 124, 'film_67e6c362d82a3.jpg', 'film_67e6c362d82a3-2023.jpg', 'https://youtu.be/LtE4ACvFiv4', 'James Wan', 'Jason Momoa, Patrick Wilson, Amber Heard, Yahya Abdul-Mateen II, Nicole Kidman', 'Âu Mỹ', 2023, 'T13', 'Từng là cứu tinh cho cả vũ trụ DC mở rộng khi đạt doanh thu vượt mốc tỷ đô vào năm 2018, nay vị vua biển khơi Aquaman tiếp tục đảm nhận trọng trách lớn hơn – gánh vác việc lấy lại thanh danh cho DCEU nói riêng và cả dòng phim siêu anh hùng nói chung sau một năm thành công thì ít mà thất bại thì nhiều.\r\nCầm trịch dự án Aquaman And The Lost Kingdom vẫn là James Wan - cái tên mà công chúng đặt trọn niềm tin. Từ bộ phim đầu tay Saw (2004) - chỉ mất 1,2 triệu $ chi phí sản xuất và càn quét gần 104 triệu $ tại các rạp chiếu phim toàn cầu, James Wan trở thành “phù thủy của những nỗi sợ”, “ông hoàng phim kinh dị”… Hầu hết tác phẩm James Wan nhúng tay đều hốt bạc phòng vé. Đáng chú ý, lúc lấn sân thực hiện phim hành động, James Wan cũng khiến cả Hollywood thán phục, chỉ đạo thành công Fast & Furious 7 đạt doanh thu hơn 1,5 tỷ $. Tiếp nhận chỉ đạo Aquaman bất chấp nhiều nghi ngại xoay quanh vũ trụ DC mở rộng lẫn độ hấp dẫn của Arthur Curry, James Wan tiếp tục làm cả thế giới sửng sốt bởi Aquaman phá mốc tỉ đô.\r\nGiờ đây, Arthur Curry ngày nào đã trở thành ông bố bỉm sữa ngày ngày chăm con kiêm cai quản cả vùng Atlantis rộng lớn. Thế nhưng, kẻ thù cũ đời nào để cho nhà vua biển cả yên ổn. Nhờ sự trợ giúp của công nghệ, Black Manta lần nữa trỗi dậy với sức mạnh kinh khủng hơn xưa. Không thể chiến đấu một mình, Arthur đành phải nhờ sự trợ giúp của một kẻ thù khác - đứa em cùng mẹ khác cha Orm.\r\n', 3, '2025-03-28 22:42:26', 3, '2025-03-28 22:42:26', 1),
(121, 'Biệt Đội Marvel', 'biet-doi-marvel', 105, 'film_67e6c40ddb348.jpg', 'film_67e6c40ddb348-2023.jpg', 'https://youtu.be/8pW1P8ddqOo', 'Nia DaCosta', 'Brie Larson, Teyonah Parris, Iman Vellani, Zawe Ashton, Park Seo-jun', 'Âu Mỹ', 2023, 'T13', 'Biệt Đội Marvel là phần phim tiếp theo của Captain Marvel (2019) và miniseries Ms. Marvel (2022). Biệt Đội Marvel tập trung vào ba nhân vật Carol Danvers/Captain Marvel, Monica Rambeau và Kamala Khan/Ms. Marvel. Một mối liên kết kỳ lạ khiến cả ba gặp rắc rối khi làm sức mạnh của họ hoán đổi cho nhau và trở nên hỗn loạn. Để giải quyết vấn đề, họ phải đào sâu nguồn gốc, khám phá sức mạnh bản thân đang sở hữu.', 3, '2025-03-28 22:45:17', 3, '2025-03-28 22:45:17', 1),
(122, 'Đất Rừng Phương Nam', 'dat-rung-phuong-nam', 110, 'film_67e6c475287dc.jpg', 'film_67e6c475287dc-2023.jpg', 'https://youtu.be/DHa4MSOzPXw', 'Nguyễn Quang Dũng', 'Hồng Ánh, Hạo Khang, Mai Tài Phến, NSUT Công Ninh, Hứa Vĩ Văn', 'Việt Nam', 2023, 'P', 'Đất Rừng Phương Nam phiên bản điện ảnh được kế thừa và phát triển từ tiểu thuyết cùng tên của nhà văn Đoàn Giỏi và tác phẩm truyền hình nổi tiếng “Đất Phương Nam” của đạo diễn Nguyễn Vinh Sơn. Bộ phim kể về hành trình phiêu lưu của An - một cậu bé chẳng may mất mẹ trên đường đi tìm cha. Cùng với An, khán giả sẽ trải nghiệm sự trù phú của thiên nhiên và nét đẹp văn hoá đặc sắc của vùng đất Nam Kì Lục Tỉnh, sự hào hiệp của những người nông dân bám đất bám rừng và tinh thần yêu nước kháng Pháp đầu thế kỉ 20. Bên cạnh đó, tình cảm gia đình, tình bạn, tình người, tình thầy trò, tình yêu nước là những cung bậc cảm xúc sâu sắc sẽ đọng lại qua mỗi bước chân của An và đồng bạn.', 3, '2025-03-28 22:47:01', 3, '2025-03-28 22:47:01', 1),
(123, 'Địa Đàng Sụp Đổ', 'dia-dang-sup-do', 129, 'film_67e6c4d98c8bd.jpg', 'film_67e6c4d98c8bd-2023.jpg', 'https://youtu.be/-b1sTXyGyq0', 'Um Tae-hwa', 'Lee Byung-Hun, Park Seo-jun, Park Bo-young, Kim Sun-young, Park Ji-hu', 'Hàn Quốc', 2023, 'T16', 'Địa Đàng Sụp Đổ xoay quanh cơn đại địa chấn san bằng Seoul thành bình địa và hành trình sinh tồn của những người sống sót.', 3, '2025-03-28 22:48:41', 3, '2025-03-28 22:48:41', 1),
(124, 'Thanh Tra Sát Nhân', 'thanh-tra-sat-nhan', 102, 'film_67e6c566459ff.jpg', 'film_67e6c566459ff-2023.jpg', 'https://youtu.be/2PQmkoVYjFA', 'Kim Jae-hoon', 'Jang Dong-yoon, Oh Dae-hwan, Jang Jae-ho, Choi Gwi-hwa, Son Jong-hak', 'Hàn Quốc', 2023, 'T18', 'Phim điện ảnh Thanh Tra Sát Nhân (Devils) của đạo diễn Kim Jae-hoon xoay quanh màn tráo đổi thân phận bí ẩn, ly kỳ của thanh tra Jae-hwan (Oh Dae-hwan thủ vai) và tên giết người hàng loạt Jin-hyuk (Jang Dong-yoon thủ vai). Kẻ phản diện sống cuộc đời chính nghĩa, người lương thiện lại bất đắc dĩ trở thành sát nhân, những tình tiết không tưởng liên tục xảy ra khiến người xem không thể rời mắt khỏi cuộc truy đuổi nghẹt thở giữa hai nhân vật.', 3, '2025-03-28 22:51:02', 3, '2025-03-28 22:51:02', 1),
(125, 'Vây Hãm Không Lối Thoát', 'vay-ham-khong-loi-thoat', 105, 'film_67e6c5b84cc88.jpg', 'film_67e6c5b84cc88-2023.jpg', 'https://youtu.be/ze0YBIE0ZkA', 'Lee Sang-yong', 'Ma Dong-seok, Lee Jun-hyuk, Munetaka Aoki, Lee Beom-Soo, Kim Min-Jae', 'Hàn Quốc', 2023, 'T18', 'Lịch chiếu Vây Hãm Không Lối Thoát và review Vây Hãm Không Lối Thoát tại Moveek. Quái vật cơ bắp Seok-do (Ma Dong Seok) dẫn đầu đội hình sự truy lùng đường dây buôn chất cấm của thiếu gia Joo Seong Cheol. Cuộc truy đuổi càng thêm gay cấn khi cú đấm công lý \"chú Ma\" chạm trán thanh kiếm lừng lẫy chốn giang hồ Nhật Bản.', 3, '2025-03-28 22:52:24', 3, '2025-03-28 22:52:24', 1),
(126, 'Transformers: Quái Thú Trỗi Dậy', 'transformers:-quai-thu-troi-day', 127, 'film_67e6c616d111e.jpg', 'film_67e6c616d111e-2023.jpg', 'https://youtu.be/VV_Mjc8ttrg', 'Steven Caple Jr.', 'Anthony Ramos, Dominique Fishback, Tobe Nwigwe, Peter Cullen, Ron Perlman', 'Âu Mỹ', 2023, 'T13', 'Lịch chiếu Transformers: Quái Thú Trỗi Dậy và review Transformers: Quái Thú Trỗi Dậy tại Moveek. Bộ phim dựa trên sự kiện Beast Wars trong loạt phim hoạt hình \"Transformers\", nơi mà các robot có khả năng biến thành động vật khổng lồ cùng chiến đấu chống lại một mối đe dọa tiềm tàng.', 3, '2025-03-28 22:53:58', 3, '2025-03-28 22:53:58', 1),
(127, 'Xứ Sở Các Nguyên Tố', 'xu-so-cac-nguyen-to', 109, 'film_67e6c675cfeac.jpg', 'film_67e6c675cfeac-2023.jpg', 'https://youtu.be/j2DD_MlAnoA', 'Denise Ream', 'Mamoudou Athie, Leah Lewis', 'Âu Mỹ', 2023, 'P', 'Lịch chiếu Xứ Sở Các Nguyên Tố và review phim Xứ Sở Các Nguyên Tố. Xứ Sở Các Nguyên Tố từ Disney và Pixar lấy bối cảnh tại thành phố các nguyên tố, nơi lửa, nước, đất và không khí cùng chung sống với nhau. Câu chuyện xoay quanh nhân vật Ember, một cô nàng cá tính, thông minh, mạnh mẽ và đầy sức hút. Tuy nhiên, mối quan hệ của cô với Wade - một anh chàng hài hước, luôn thuận thế đẩy dòng - khiến Ember cảm thấy ngờ vực với thế giới này.', 3, '2025-03-28 22:55:33', 3, '2025-03-28 22:55:33', 1),
(128, 'Vệ Binh Dải Ngân Hà 3', 've-binh-dai-ngan-ha-3', 149, 'film_67e6c6d5e6afc.jpg', 'film_67e6c6d5e6afc-2023.jpg', 'https://youtu.be/cfbKqpbdrYg', 'James Gunn', 'Chris Pratt, Zoe Saldana, Dave Bautista, Karen Gillan, Pom Klementieff', 'Âu Mỹ', 2023, 'T13', 'Review Vệ Binh Dải Ngân Hà 3 và lịch chiếu Vệ Binh Dải Ngân Hà 3 tại Moveek. Cho dù vũ trụ này có bao la đến đâu, các Vệ Binh của chúng ta cũng không thể trốn chạy mãi mãi.', 3, '2025-03-28 22:57:09', 3, '2025-03-28 22:57:09', 1),
(129, 'Fast & Furious 10', 'fast-&-furious-10', 141, 'film_67e6c7216408d.jpg', 'film_67e6c7216408d-2023.jpg', 'https://youtu.be/jTHpOm6L2FQ', 'Louis Leterrier', 'Vin Diesel, Michelle Rodriguez, Tyrese Gibson, Ludacris, Jason Momoa', 'Âu Mỹ', 2023, 'T16', 'Review Fast & Furious 10 và lịch chiếu Fast & Furious 10 xem tại Moveek. Dom Toretto và gia đình của anh ấy bị trở thành mục tiêu của người con trai đầy thù hận của ông trùm ma túy Hernan Reyes.', 3, '2025-03-28 22:58:25', 3, '2025-03-28 22:58:25', 1),
(130, 'Anh Em Super Mario', 'anh-em-super-mario', 93, 'film_67e6c78bb7327.jpg', 'film_67e6c78bb7327-2024.jpg', 'https://youtu.be/QcinmCfoh8E', 'Michael Jelenic, Aaron Horvath', 'Chris Pratt, Anya Taylor-Joy, Charlie Day, Jack Black, Keegan-Michael Key', 'Âu Mỹ', 2024, 'P', 'Cuộc phiêu lưu đến Vương quốc Nấm của anh chàng thợ sửa ống nước Mario và quá trình anh vươn lên trở thành một huyền thoại. Xem lịch chiếu, review phim và mua vé xem phim dễ dàng hơn tại Moveek', 3, '2025-03-28 23:00:11', 3, '2025-03-28 23:00:11', 1),
(131, 'Khế Ước', 'khe-uoc', 123, 'film_67e6c7e96ce55.jpg', 'film_67e6c7e96ce55-2023.jpg', 'https://youtu.be/JwjjIoTiv5k', 'Guy Ritchie', 'Jake Gyllenhaal, Dar Salim, Antony Starr, Alexander Ludwig, Emily Beecham', 'Âu Mỹ', 2023, 'T18', 'Review Khế Ước và lịch chiếu Khế Ước tại Moveek. Trong nhiệm vụ cuối cùng ở Afghanistan, Trung sĩ John Kinley cùng đội với phiên dịch viên bản địa Ahmed. Khi đơn vị của họ bị phục kích, Kinley và Ahmed là 2 người sống sót duy nhất. Bị kẻ địch truy đuổi, Ahmed liều mạng đưa Kinley đang bị thương băng qua nhiều dặm đường địa hình khắc nghiệt đến nơi an toàn. Trở về Mỹ, Kinley biết rằng Ahmed và gia đình không dc cấp giấy thông hành tới Mỹ như đã hứa. Quyết tâm bảo vệ bạn mình và đền ơn cứu mạng, Kinley trở lại chiến trường để giúp Ahmed và gia đình trước khi lực lượng phiến quân phát hiện ra họ.', 3, '2025-03-28 23:01:45', 3, '2025-03-28 23:01:45', 1),
(132, 'Thanh Gươm Diệt Quỷ Đường Đến Làng Rèn Gươm', 'thanh-guom-diet-quy-duong-den-lang-ren-guom', 110, 'film_67e6c84e8b4c4.jpg', 'film_67e6c84e8b4c4-2023.jpg', 'https://youtu.be/yvUoQ4wE1mg', 'Haruo Sotozaki', 'Natsuki Hanae, Akari Kitō, Yoshitsugu Matsuoka, Hiro Shimono, Katsuyuki Konishi', 'Nhật Bản', 2023, 'T13', 'Gươm Diệt Quỷ Đường Đến Làng Rèn Gươm tại Moveek. Sau trận chiến với Thượng Huyền Lục, thanh gươm của Tanjiro cũng bị hư hỏng nặng và lúc này, cậu cần một thanh gươm mới để tiếp tục lên đường làm nhiệm vụ. Cậu được đưa đến Làng Rèn Gươm, nơi phụ trách rèn vũ khí cho các kiếm sĩ của Đội Diệt Quỷ và chuẩn bị cho trận chiến mới với các thành viên mạnh nhất trong hàng Thượng Huyền của Thập Nhị Quỷ Nguyệt.', 3, '2025-03-28 23:03:26', 3, '2025-03-28 23:03:26', 1),
(133, 'Babylon', 'babylon', 188, 'film_67e6c8cfb3b00.jpg', 'film_67e6c8cfb3b00-2023.jpg', 'https://youtu.be/5muQK7CuFtY', 'Damien Chazelle', 'Brad Pitt, Margot Robbie, Katherine Waterston, Samara Weaving, Max Minghella', 'Âu Mỹ', 2023, 'T18', 'Từ đạo diễn Damien Chazelle, BABYLON là bộ phim lấy bối cảnh Los Angeles vào những năm 1920, do Brad Pitt, Margot Robbie và Diego Calva đóng chính, cùng dàn diễn viên bao gồm Jovan Adepo, Li Jun Li và Jean Smart. Một câu chuyện về sự tham vọng và xa hoa thái quá, cùng với đó là sự thăng trầm của nhiều nhân vật trong thời đại suy đồi và sa đọa không thể kiềm chế ở Hollywood thời sơ khai. Xem lịch chiếu, review phim và mua vé xem phim dễ dàng hơn tại Moveek', 3, '2025-03-28 23:05:35', 3, '2025-03-28 23:05:35', 1),
(134, 'Captain America: Thế Giới Mới', 'captain-america:-the-gioi-moi', 118, 'film_67e92aa5ebb2e.jpg', 'film_67e92aa5ebb2e-2025.png', 'https://youtu.be/Y3h6Noj_pEw', 'Julius Onah', 'Anthony Mackie, Danny Ramirez, Shira Haas, Carl Lumbly', 'Âu Mỹ', 2025, 'T13', 'Captain America: Thế Giới Mới Captain America: Brave New World 2025 Sau khi Thaddeus Ross được bầu làm Tổng thống Hoa Kỳ, Sam Wilson (do Anthony Mackie thủ vai) – Captain America mới, sẽ phải đối mặt với một thảm họa địa cầu và nỗ lực ngăn chặn những kẻ chủ mưu thực sự đứng sau.', 3, '2025-03-30 18:27:33', 3, '2025-03-30 18:27:33', 1),
(135, 'Hành Trình Của Moana 2', 'hanh-trinh-cua-moana-2', 99, 'film_67e92b1359809.jpg', 'film_67e92b1359809-2024.jpg', 'https://youtu.be/POIGX4BX6AI', 'Dave Derrick Jr', 'Auli*i Cravalho, Dwayne Johnson, Hualalai Chung', 'Âu Mỹ', 2024, 'P', 'Hành Trình Của Moana 2 Moana 2 2024 phần hai tiếp theo của bộ phim Moana ra mắt năm 2016. Phim được đạo diễn bởi David Derrick Jr., Jason Hand và Dana Ledoux Miller, với sự tham gia lồng tiếng của Auliʻi Cravalho, Dwayne Johnson, cùng các diễn viên mới như Hualālai Chung và Rose Matafeo. \r\nBa năm sau các sự kiện của phần đầu, Moana giờ đây là một \"wayfinder\" tự tin, nhận được lời kêu gọi từ tổ tiên để khám phá những vùng biển chưa được biết đến ở châu Đại Dương. Cô cùng với á thần Maui và một nhóm thủy thủ lên đường tìm kiếm hòn đảo bị mất tích Motufetu nhằm kết nối các cộng đồng và phá bỏ lời nguyền cổ xưa.', 3, '2025-03-30 18:29:23', 3, '2025-03-30 18:29:23', 1),
(136, 'Vùng Đất Câm Lặng: Ngày Một', 'vung-dat-cam-lang:-ngay-mot', 99, 'film_67e92bdad4407.jpg', 'film_67e92bdad4407-2024.jpg', 'https://youtu.be/eD1O0wVwW7o', 'Michael Sarnoski', 'Lupita Nyong*o, Joseph Quinn, Alex Wolff, Djimon Hounsou', 'Âu Mỹ', 2024, 'T18', 'Vùng Đất Câm Lặng: Ngày Một A Quiet Place: Day One 2024 là phần tiền truyện của loạt phim A Quiet Place do Michael Sarnoski đạo diễn. Bộ phim kể về sự xâm lăng ban đầu của những sinh vật ngoài hành tinh có khả năng nghe cực kỳ nhạy bén, tập trung vào cuộc đấu tranh sinh tồn của một người phụ nữ tại thành phố New York. Lupita Nyong\'o đóng vai Sam, một người phụ nữ bị bệnh nan y, phải đối mặt với sự hỗn loạn, cùng với các diễn viên Joseph Quinn, Alex Wolff và Djimon Hounsou (người trở lại với vai Henri từ \"A Quiet Place Part II\")​', 3, '2025-03-30 18:32:42', 3, '2025-03-30 18:32:42', 1),
(137, 'Vây Hãm: Kẻ Trừng Phạt', 'vay-ham:-ke-trung-phat', 109, 'film_67e92c4ce995e.jpg', 'film_67e92c4ce995e-2024.jpg', 'https://youtu.be/h4okylxDB1Y', 'Heo Myung haeng', 'Ma Dong Seok, Kim Mu Yeol, Lee Joo Bin', 'Âu Mỹ', 2024, 'T18', 'Vây Hãm: Kẻ Trừng Phạt The Roundup: Punishment 2024 dự kiến khởi chiếu vào ngày 24 tháng 4 năm 2024, là phần thứ tư trong loạt phim hành động tội phạm nổi tiếng của Hàn Quốc. Phim do Heo Myung-haeng đạo diễn và có sự tham gia của Ma Dong-seok, Kim Mu-yeol, Lee Dong-hwi, và nhiều diễn viên khác.\r\nNội dung phim xoay quanh cuộc điều tra của \"Monster Cop\" Ma Seok Do và đội của anh ấy khi họ phát hiện mối liên hệ giữa nhà phát triển một ứng dụng mua bán ma túy đã bị sát hại ở Philippines và một tổ chức cá cược trực tuyến bất hợp pháp. Nhân vật chính là Baek Chang Ki, người đang kiểm soát thị trường cá cược trực tuyến bất hợp pháp của Hàn Quốc và gây ra bạo lực, bắt cóc và giết người. Jang Dong Cheol, một thiên tài IT, là đối tác của Baek và đang lên kế hoạch cho một âm mưu lớn hơn nữa tại Hàn Quốc. Để chấm dứt mối đe dọa ngày càng tăng, Ma Seok Do mở rộng hoạt động của mình bằng cách đề xuất một liên minh bất ngờ.', 3, '2025-03-30 18:34:36', 3, '2025-03-30 18:34:36', 1),
(138, 'Nhà Vịt Di Cư', 'nha-vit-di-cu', 83, 'film_67e92ceb7a408.jpg', 'film_67e92ceb7a408-2023.jpg', 'https://youtu.be/SRdCWLCPOrc', 'Benjamin Renner', 'Kumail Nanjiani, Elizabeth Banks, Caspar Jennings', 'Âu Mỹ', 2023, 'P', 'Nhà Vịt Di Cư Migration 2023 là một bộ phim hoạt hình phiêu lưu gia đình do Illumination sản xuất và Universal Pictures phân phối. Bộ phim được đạo diễn bởi Benjamin Renner và Guylo Homsy, với kịch bản viết bởi Mike White. Phim có sự tham gia lồng tiếng của các diễn viên nổi tiếng như Kumail Nanjiani, Elizabeth Banks, Keegan-Michael Key, Awkwafina và Danny DeVito.\r\nNội dung phim xoay quanh gia đình vịt Mallard, với người cha cẩn thận Mack (lồng tiếng bởi Kumail Nanjiani), người mẹ mạo hiểm Pam (Elizabeth Banks), cậu con trai thiếu niên Dax (Caspar Jennings), cô con gái vịt non Gwen (Tresi Gazal), và chú Dan (Danny DeVito) có tính cách cằn nhằn. Họ chưa bao giờ rời khỏi hồ nước ở New England, chủ yếu do lo lắng của Mack về những nguy hiểm có thể xảy ra ngoài thế giới rộng lớn. Tuy nhiên, khi một gia đình vịt di cư kể về những nơi xa xôi hấp dẫn, Pam thuyết phục Mack thực hiện chuyến đi đến Jamaica.\r\nTrong hành trình của mình, gia đình Mallard vô tình đi lạc và lên đường tới New York City, nơi họ gặp một băng nhóm chim bồ câu do Chump (Awkwafina) dẫn dắt. Họ cũng gặp Delroy (Keegan-Michael Key), một con vẹt người Jamaica bị giam cầm trong một nhà hàng thời thượng ở Manhattan. Gia đình Mallard giúp Delroy thoát khỏi nhà hàng và tiếp tục cuộc hành trình của mình. Dọc theo đường đi, họ trải qua nhiều tình huống kỳ quặc và xung đột nhẹ nhàng trong khi bị đuổi theo bởi đầu bếp ác ý, người sở hữu một chiếc trực thăng riêng để truy đuổi họ.', 3, '2025-03-30 18:37:15', 3, '2025-03-30 18:37:15', 1),
(139, 'Bão Trắng 3: Thiên Đàng Hay Địa Ngục', 'bao-trang-3:-thien-dang-hay-dia-nguc', 123, 'film_67e92daa3790b.jpg', 'film_67e92daa3790b-2023.jpg', 'https://youtu.be/UoRSxeHI3Vs', 'Khâu Lễ Đào', 'Cổ Thiên Lạc, Quách Phú Thành, Lưu Thanh Vân, La Gia Lương, Phương Trung Tín', 'Trung Quốc', 2023, 'T18', 'Bão Trắng 3: Thiên Đàng Hay Địa Ngục The White Storm 3: Heaven or Hell 2023 Xoay quanh hai cảnh sát chìm, Âu Chí Viễn và Trương Kiến Hành, đang hoạt động bên trong một tổ chức ma túy lớn do ông trùm Khang Tố Sai đứng đầu tại Hong Kong.\r\nTrong một tình huống, Trương Kiến Hành bị thương nặng và được cứu giúp bởi chính ông trùm ma túy Khang Tố Sai trên một con tàu đang vượt biên đến khu Tam Giác Vàng, nơi trở thành trung tâm sản xuất thuốc phiện. Sự cứu giúp này không chỉ giúp Trương thoát khỏi cái chết mà còn thay đổi hoàn toàn quan điểm của anh về phe đối lập. Trương Kiến Hành, trong tình trạng giằng xé vì lòng biết ơn, quyết định miễn cưỡng hợp tác và làm việc cho Khang Tố Sai, giúp ông trùm này sản xuất thuốc phiện.\r\nMặt khác, Âu Chí Viễn, không biết về sự thay đổi bên trong Trương, tiếp tục theo dấu vết của ông trùm ma túy. Anh cùng với lực lượng cảnh sát quốc tế khao khát truy nã Khang Tố Sai và triệt phá đường dây buôn bán ma túy lớn. Trong quá trình này, Âu phát hiện ra sự thật về Trương và đứng trước sự lựa chọn khó khăn giữa tình nghĩa đồng đội và trách nhiệm công việc.\r\nBão Trắng 3: Thiên Đàng Hay Địa Ngục kết thúc khi cả hai đối diện với nhau trong một cuộc đụng độ căng thẳng, đầy cảm xúc giữa lòng trung thành, tình nghĩa và trách nhiệm.', 3, '2025-03-30 18:40:26', 3, '2025-03-30 18:40:26', 1),
(140, 'Sát thủ John Wick Phần 4', 'sat-thu-john-wick-phan-4', 169, 'film_67e92e9d0ff93.jpg', 'film_67e92e9d0ff93-2023.jpg', 'https://youtu.be/qEVUtrk8_B4', 'Chad Stahelski', 'Keanu Reeves, Donnie Yen, Hiroyuki Sanada, Bill Skarsgård, Ian McShane', 'Âu Mỹ', 2023, 'T18', 'Sát thủ John Wick Phần 4 John Wick: Chapter 4 2023 Là phần tiếp theo của phần Chuẩn bị chiến tranh, đây là phần phim thứ tư trong loạt phim John Wick.Tìm ra một con đường để đánh bại The High Table. Nhưng trước khi anh ta có thể giành được sự tự do, Wick phải đối đầu với một kẻ thù mới có liên minh mạnh mẽ trên toàn cầu và các lực lượng biến những người bạn cũ thành kẻ thù.\r\nỞ New York City, John Wick chuẩn bị trả thù cho mình bằng cách ẩn nấp dưới lòng đất với Bowery King. Anh ta đi đến Morocco và giết Elder, người duy nhất ở trên High Table.\r\nDo đó, quản lý khách sạn New York Continental Hotel Winston Scott và phục vụ Charon của anh ta được triệu tập đến Marquis Vincent de Gramont, một thành viên cao cấp của High Table, người khiển trách Winston vì thất bại trong việc ám sát John. Để trừng phạt Winston, de Gramont tước anh ta vai trò quản lý, phá hủy khách sạn Continental và giết Charon. Sau đó, ông ta đi đến Paris và tuyển Caine, một sát thủ của High Table đã nghỉ hưu và là bạn cũ của John, để giết anh ta, đe dọa giết con gái của Caine nếu không tuân thủ.\r\nJohn tìm sự ẩn náu tại Osaka Continental, được điều hành bởi người bạn Shimazu Koji. Các sát thủ của de Gramont, do đối tác của ông ta Chidi lãnh đạo, đến cùng với Caine để giết John. Akira, con gái của Koji và phục vụ khách sạn, yêu cầu khách sạn được sơ tán và cùng với cha, John và nhân viên khách sạn chiến đấu chống lại sát thủ của High Table. Akira bị thương, trong khi Koji cho John biết cách để trốn thoát. Trên đường đi, John đánh bại một làn sóng sát thủ khác, theo sau là Caine. Họ bị gián đoạn bởi một kẻ theo dõi John vì một hợp đồng, được đặt biệt danh là \"Ông không ai\" bởi de Gramont, nhưng ông ta để John đi sau khi quyết định hợp đồng không đủ. Akira cũng thoát được, nhưng Koji bị Caine giết..... Theo dõi chi tiết bộ phim này trên phimmoi khi có bản chất lượng nhất.', 3, '2025-03-30 18:44:29', 3, '2025-03-30 18:44:29', 1),
(141, 'Lưu Lạc Địa Cầu 2', 'luu-lac-dia-cau-2', 173, 'film_67e92f63c80ff.jpg', 'film_67e92f63c80ff-2023.jpg', 'https://youtu.be/tvqqu_tG7wQ', 'Frant Gwo', 'Ngô Kinh, Lưu Đức Hoa, Vương Trí, Vạn Thiến, Li Xuejian', 'Trung Quốc', 2023, 'P', 'Lưu Lạc Địa Cầu 2 The Wandering Earth II 2023 Bộ phim lấy bối cảnh vào một thời đại đề xuất kế hoạch xây dựng mười nghìn động cơ hành tinh, và kể câu chuyện về cuộc \"khủng hoảng mặt trời\" sắp tới, đẩy thế giới vào tình trạng hoang mang. Trong khi mười nghìn động cơ hành tinh đang được xây dựng, nhân loại đối mặt với một thử thách kép về thảm họa tận thế và sự sống còn.\r\nTừ năm 2044 đến 2058, các nhà khoa học phát hiện ra rằng mặt trời đang bị lão hóa nhanh chóng và tiếp tục phình to, trong vài trăm năm tới sẽ nuốt chửng toàn bộ hệ Mặt Trời bao gồm cả Trái Đất. Đối mặt với thử thách kép về thảm họa tận thế và sự sống còn, một chính phủ liên minh được thành lập, trụ sở đặt tại New York, Mỹ. Tuy nhiên, tình hình chính trị thế giới đang rất bất ổn, con người cố gắng tự cứu nhưng vẫn tranh giành không ngừng. Các cuộc chiến lớn nhỏ liên tiếp xảy ra, cùng với sự mở rộng vô tội vạ của ngành công nghiệp nặng, thế giới trở nên hoang tàn. Công nghệ phát triển nhanh chóng dưới áp lực nặng nề, con người chuyển sang một xã hội kế hoạch hóa chủ yếu dựa trên công nghiệp hàng không vũ trụ, và toàn thế giới cùng đưa ra hàng trăm kế hoạch tự cứu.\r\n', 3, '2025-03-30 18:47:47', 3, '2025-03-30 18:47:47', 1),
(142, 'Avatar 2: Dòng Chảy Của Nước', 'avatar-2:-dong-chay-cua-nuoc', 192, 'film_67e92fc6e9e61.jpg', 'film_67e92fc6e9e61-2022.jpg', 'https://youtu.be/_CgHXISxU4E', 'James Cameron', 'Sam Worthington, Zoe Saldana, Sigourney Weaver, Stephen Lang', 'Âu Mỹ', 2022, 'T13', 'Avatar 2 Avatar 2: Dòng Chảy Của Nước 2022 sau avatar 1 Hai nhân vật chính, Jake Sully và Neytiri, giờ đã thành đôi, nguyện sẽ ở bên nhau. Tuy nhiên, cả hai buộc phải rời khỏi nhà và khám phá những miền đất mới trên mặt trăng Pandora, cũng chính là lúc những mối nguy cũ trở lại với họ. cùng phimmoi hóng bộ phim thế thân 2 Dòng Chảy Của Nước bom tấn này nge\r\nCốt truyện cho thấy Jake và gia đình của anh ấy là mục tiêu của những kẻ thực dân loài người, những người muốn biến Pandora thành ngôi nhà mới cho cư dân Trái đất, vì vậy họ chạy trốn khỏi ngôi nhà trong rừng của mình và tìm nơi ẩn náu với một cộng đồng Na\'vi lưỡng cư trên đại dương, được gọi là Metkayina. Điều này có nghĩa là phần lớn bộ phim diễn ra trong, dưới hoặc xung quanh nước, liên quan đến một mức độ hiểu biết mới về môi trường và công nghệ. Landau nói: “Ánh sáng di chuyển khác nhau dưới nước. \"Vì vậy, chúng tôi cần tạo ra một hệ thống chụp hoàn toàn khác để hoạt động với các điểm đánh dấu phản chiếu và một hệ thống khác trên mặt nước, đồng thời để chúng hoạt động cùng nhau.\"', 3, '2025-03-30 18:49:26', 3, '2025-03-30 18:49:26', 1),
(143, 'One Piece Film: Red', 'one-piece-film:-red', 115, 'film_67e9302d20205.jpg', 'film_67e9302d20205-2022.jpg', 'https://youtu.be/L-aFL-bX1ao', 'Gorō Taniguchi', 'Tanaka Mayumi, Nakai Kazuya, Okamura Akemi', 'Nhật Bản', 2022, 'T13', 'One Piece Film: Red One Piece Movie 15 2022 One Piece Film: Red là bộ phim hoạt hình anime của Nhật Bản thuộc thể loại kỳ ảo, hành động-phiêu lưu được sản xuất bởi Toei Animation. Đây là phần phim thứ mười lăm trong loạt phim điện ảnh của One Piece, dựa trên bộ truyện manga nổi tiếng cùng tên của tác giả Eiichiro Oda. Phim được công bố lần đầu tiên vào ngày 21 tháng 11, 2021 để kỷ niệm sự ra mắt của tập phim thứ 1000 của bộ anime One Piece và sau khi tập phim này được phát sóng, đoạn quảng cáo và áp phích chính thức của phim cũng chính thức được công bố. Phim dự kiến sẽ phát hành vào ngày 6 tháng 8 năm 2022. Bộ phim được giới thiệu sẽ là hành trình xoay quanh một nhân vật nữ mới cùng với Shanks \"Tóc Đỏ\".', 3, '2025-03-30 18:51:09', 3, '2025-03-30 18:51:09', 1),
(144, 'Quyết Tâm Cua Em', 'quyet-tam-cua-em', 125, 'film_67e930ba4081b.jpg', 'film_67e930ba4081b-2022.jpg', 'https://youtu.be/9U7fkTY6HRY', 'Thitipong Kerdtongtawee', 'Wongravee Nateetorn, Plearnpichaya Komalarajun, Pachara Chirathivat', 'Thái Lan', 2022, 'T16', 'Quyết Tâm Cua Em OMG! Oh My Girl 2022 Một câu chuyện tình yêu đầy nổi loạn của một người đàn ông và một người phụ nữ luôn yêu nhau, nhưng sai thời gian và sai địa điểm. Guy là một chàng trai vụng về trong tình trường hay nói cách khác là “ế nhờ thực lực”. Cậu đem lòng yêu đơn phương June, một hot girl bậc nhất của trường, nổi tiếng với lời đồn là “tráp gơ” - thuật ngữ giới trẻ dùng để chỉ những cô gái thích chơi đùa tình cảm người khác. Tuy nhiên, Guy lại mặc kệ lời cảnh tỉnh mà rơi vào lưới tình của June, nhưng số phận trớ trêu đã cản bước họ đi đến một mối quan hệ yêu đương ra trò. Trong khi Guy độc thân, June đang có bạn trai. Khi June vừa kết thúc mối quan hệ của mình, Guy lại đang “thử yêu” một cô gái khác. Khi Guy quyết định chia tay, June lại có bạn trai mới! Cứ thế, họ lựa chọn sẽ coi nhau như những người bạn mà không thể gặp nhau ở “giao điểm” tình yêu. Liệu sự quyết tâm “cuồng si” của Guy có đủ sức biến mối quan hệ này thành “đúng người, đúng thời điểm”?', 3, '2025-03-30 18:53:30', 3, '2025-03-30 18:53:30', 1),
(145, 'Bay Vào Tử Địa', 'bay-vao-tu-dia', 108, 'film_67e9312016795.jpg', 'film_67e9312016795-2023.jpg', 'https://youtu.be/LuSKvz3b0nU', 'Jean François Richet', 'Gerard Butler, Daniella Pineda, Mike Colter', 'Âu Mỹ', 2023, 'T16', 'Bay Vào Tử Địa Plane 2023 Vào đêm giao thừa, phi công lão luyện Brodie Torrance (Gerard Butler) thực hiện một cú hạ cánh mạo hiểm khi chiếc máy bay chở đầy hành khách của anh bị sét đánh. Bị lạc giữa một hòn đảo bị tàn phá bởi chiến tranh, Torrance sẽ nhận ra rằng sống sót sau chuyến bay chỉ là khởi đầu của một cuộc phiêu lưu khủng khiếp đầy nguy hiểm. Người phi công sẽ phải sử dụng tất cả sự khéo léo của mình để cố gắng đưa hành khách đến đích an toàn.', 3, '2025-03-30 18:55:12', 3, '2025-03-30 18:55:12', 1);
INSERT INTO `phim` (`MaPhim`, `TenPhim`, `TenRutGon`, `ThoiLuong`, `Anh`, `Banner`, `Trailer`, `DaoDien`, `DienVien`, `QuocGia`, `NamPhatHanh`, `PhanLoai`, `MoTa`, `NguoiTao`, `NgayTao`, `NguoiCapNhat`, `NgayCapNhat`, `TrangThai`) VALUES
(146, 'Mèo Đi Hia Điều Ước Cuối Cùng', 'meo-di-hia-dieu-uoc-cuoi-cung', 103, 'film_67e9316bdee5e.jpg', 'film_67e9316bdee5e-2022.jpg', 'https://youtu.be/fovTZDDPgAQ', 'Joel Crawford, Januel Mercado', 'Antonio Banderas, Salma Hayek, Harvey Guillén', 'Âu Mỹ', 2022, 'P', 'Mèo Đi Hia Điều Ước Cuối Cùng Puss in Boots: The Last Wish 2022 Mùa thu này, loài mèo yêu thích leche, thích lộng lẫy, bất chấp sợ hãi yêu thích của mọi người sẽ trở lại. Lần đầu tiên sau hơn một thập kỷ, DreamWorks Animation giới thiệu một cuộc phiêu lưu mới trong vũ trụ Shrek khi Puss in Boots táo bạo ngoài vòng pháp luật phát hiện ra rằng niềm đam mê với sự nguy hiểm và coi thường sự an toàn của mình đã gây ra hậu quả nghiêm trọng. Puss đã đốt cháy tám trong số chín mạng sống của mình, mặc dù anh ta đã mất đi số lượng trên đường đi. Lấy lại những mạng sống đó sẽ đưa Mèo đi hia vào nhiệm vụ vĩ đại nhất của nó. Người được đề cử Giải Oscar®, Antonio Banderas trở lại với vai trò lồng tiếng cho PiB khét tiếng khi anh bắt đầu cuộc hành trình hoành tráng vào Rừng Đen để tìm Ngôi sao Điều ước thần thoại và khôi phục lại những mạng sống đã mất của mình. Nhưng chỉ còn một mạng sống, Puss sẽ phải hạ mình và nhờ sự giúp đỡ từ người đồng đội cũ cũng như kẻ thù không đội trời chung của mình: Kitty Soft Paws (ứng cử viên Oscar® Salma Hayek) quyến rũ. Trong nhiệm vụ của mình, Puss và Kitty sẽ được hỗ trợ - trái ngược với khả năng phán đoán tốt hơn của chúng - bởi một con chó lầm lì, hay nói chuyện, không ngừng vui vẻ, Perro (Harvey Guillén, What We Do in the Shadows). Cùng với nhau, bộ ba anh hùng của chúng ta sẽ phải đi trước một bước so với Goldilocks (người được đề cử giải Oscar, Florence Pugh, Góa phụ đen) và Gia đình tội phạm Three Bears, \"Big\" Jack Horner (người chiến thắng giải Emmy John Mulaney, Big Mouth) và thợ săn tiền thưởng đáng sợ , Con sói xấu xa (Wagner Moura, Narcos).', 3, '2025-03-30 18:56:27', 3, '2025-03-30 18:56:27', 1),
(147, 'Black Adam', 'black-adam', 125, 'film_67e931c12b5bc.jpg', 'film_67e931c12b5bc-2022.jpg', 'https://youtu.be/XBH5bmXOyUc', 'Jaume Collet-Serra', 'Dwayne Johnson, Sarah Shahi, Pierce Brosnan', 'Âu Mỹ', 2022, 'T13', 'Black Adam Black Adam 2022 Phim kể về người đàn ông Black Adam đã bị giam cầm sau gần 5000 năm, giờ đây anh được các vị thần Ai Cập bang cho những sức mạnh đầy quyền năng, và từ đó anh đã thoát ra khỏi sự giam cầm. Từ đây, anh đã tận dụng sức mạnh này để bắt đầu một cuộc sống công lý độc nhất trên thế giới hiện đại hóa này. Không những thế anh còn phải đối mặt với những kẻ thù hung ác mới.\r\nBlack Adam là một bộ phim điện ảnh siêu anh hùng của Hoa Kỳ ra mắt năm 2022, dựa trên nhân vật cùng tên của DC Comics. Được sản xuất bởi New Line Cinema, DC Films, Seven Bucks Productions và Flynn Picture, đây là phần phim ngoại truyện của Shazam!, và là phim thứ 11 trong Vũ trụ Mở rộng DC.', 3, '2025-03-30 18:57:53', 3, '2025-03-30 18:57:53', 1),
(148, 'Chiến Binh Báo Đen: Wakanda Bất Diệt', 'chien-binh-bao-den:-wakanda-bat-diet', 161, 'film_67e9327629f1f.jpg', 'film_67e9327629f1f-2022.jpg', 'https://youtu.be/2Qcg6ZaSj8A', 'Ryan Coogler', 'Michael B. Jordan, Forest Whitaker, Martin Freeman, Andy Serkis, Chadwick Boseman, Daniel Kaluuya, Angela Bassett, Danai Gurira', 'Âu Mỹ', 2022, 'T13', 'Chiến Binh Báo Đen Black Panther 2018 T\'Challa (Báo Đen) là một hoàng tử, một nhà phát minh tài ba của đất nước Wakanda nằm ở Châu Phi, nơi có cội nguồn. kim loại cực hiếm: vibranium. Với nguồn tài nguyên phong phú và sự tiến bộ vượt bậc, Wakanda trở thành mục tiêu của nhiều quốc gia và đế chế trong vài thiên niên kỷ, mục đích của những kẻ xâm lược là thu được một lượng vũ khí và của cải khủng khiếp. ở đất nước giàu có này. Với tư cách là người đứng đầu đất nước, Hoàng tử T\'Challa sẽ phải bảo vệ người dân của mình khỏi những âm mưu của ngoại bang. Sở hữu khả năng chiến đấu nhanh, bộ giáp và móng vuốt làm từ vibranium, có thể nói Black Panther cũng là một siêu anh hùng trong thế giới Marvel.', 3, '2025-03-30 19:00:54', 3, '2025-03-30 19:00:54', 1),
(149, 'Đặc Vụ Xuyên Quốc Gia', 'dac-vu-xuyen-quoc-gia', 129, 'film_67e932c8bf9e0.jpg', 'film_67e932c8bf9e0-2022.jpg', 'https://youtu.be/t0ixlAp4BSU', 'Lee Seok Hoon', 'Hyun Bin, Yoo Hai Jin, Lim Yoon A, Daniel Henney, Jin Sun Kyu', 'Âu Mỹ', 2022, 'T16', 'Đặc Vụ Xuyên Quốc Gia Confidential Assignment 2: International 2022 Là bộ phim có doanh thu cao thứ ba tại Hàn Quốc, Nhiệm vụ bí mật chính thức được công chiếu với phần tiếp theo của nó. Bộ phim này quy tụ Hyun Bin , SNSD Yoona và Yoo Hae Jin trong một khung hình. Rất nhiều fan dòng phim hàn quốc đang mong chờ phần tiếp theo của bộ phim này.\r\nViệc phát hành bộ phim này cũng đánh dấu sự khai mạc của Liên hoan phim Hàn Quốc Indonesia 2022, có mặt tại một số cụm rạp trên cả nước, đặc biệt theo thông tin thì sẽ được vietsub bở subteam bỗng dưng trúng số làm mưa làm gió trong thời gian qua.', 3, '2025-03-30 19:02:16', 3, '2025-03-30 19:02:16', 1),
(150, 'Bỗng Dưng Trúng Số', 'bong-dung-trung-so', 113, 'film_67e93317f345f.jpg', 'film_67e93317f345f-2022.png', 'https://youtu.be/D3KbO3QF-lg', 'Park Gyu-tae', 'Ko Kyoung-pyo, Lee Yi-kyung, Eum Mun-suk, Park Se-wan, Kwak Dong-yeon, Lee Soon-won, Kim Min-ho', 'Hàn Quốc', 2022, 'T13', 'Bỗng Dưng Trúng Số 6/45 2022 May mắn nhặt được một tờ vé số trúng thưởng trị giá hàng triệu đô la, nhưng một người lính Hàn Quốc đã để chiếc vé bay qua biên giới và cuối cùng nó đã rơi vào tay một người lính Triều Tiên. Khi biết rằng mình là người chiến thắng lớn, Yong Ho đã thay mặt Chun Woo đến nhận giải thưởng. Yong Ho đã không thể đến Hàn Quốc nhận giải vì muốn lấy lại vé số. Khi đồng đội của hai anh chàng biết được sự việc và yêu cầu họ tham gia vào cuộc đàm phán về số phận của giải thưởng, mọi chuyện trở nên phức tạp. Sau nhiều lần thương lượng, hai bên đã thống nhất chia đôi giải thưởng.\r\nMột thỏa thuận được đưa ra là phía Triều Tiên sẽ trả lại tờ vé số và phía Hàn Quốc sẽ chịu trách nhiệm đổi. Hai bên sẽ đổi một người lính để lấy số tiền được trả lại sau đó. Hai người được chọn để làm nhiệm vụ này là Yong Ho và Chun Woo. Hai người lính phải thích nghi với môi trường quân đội mới mà không được tiết lộ danh tính thật là một trong những câu chuyện hài hước nhất của cuộc hoán đổi quốc tịch.', 3, '2025-03-30 19:03:35', 3, '2025-03-30 19:03:35', 1),
(151, 'Người Nhện: Không Còn Nhà', 'nguoi-nhen:-khong-con-nha', 157, 'film_67e93368400b4.jpg', 'film_67e93368400b4-2023.jpg', 'https://youtu.be/twOE43vLRAM', 'Jon Watts', 'Tom Holland, Zendaya, Benedict Cumberbatch, Jon Favreau, Jacob Batalon, Marisa Tomei', 'Âu Mỹ', 2023, 'T13', 'Người Nhện: Không Còn Nhà Spider-Man: No Way Home 2021 Khi trailer của Spider-Man: No Way Home ra mắt vào ngày 16 tháng 11, nó đã chiếm lĩnh xu hướng toàn thế giới của Twitter khi những người hâm mộ mắt đại bàng đã tìm thấy teaser cho mỗi quả trứng phục sinh mà họ tìm thấy. Những người hâm mộ Marvel đã thất vọng khi cựu Spider-Men Tobey Maguire và Andrew Garfield không có trong trailer, đặc biệt là kể từ khi những phản diện mà họ đánh bại được thiết lập để trở lại trong bộ phim sắp tới. Nhưng không phải tất cả hy vọng cho một cuộc crossover Spidey đa vũ trụ đều bị mất . Với danh tính của Người Nhện giờ đã được tiết lộ, Peter nhờ Doctor Strange giúp đỡ. Khi một câu thần chú bị sai, những kẻ thù nguy hiểm từ các thế giới khác bắt đầu xuất hiện, buộc Peter phải khám phá ra ý nghĩa thực sự của việc trở thành Người Nhện.', 3, '2025-03-30 19:04:56', 3, '2025-03-30 19:04:56', 1),
(152, 'Sát Thủ Đối Đầu', 'sat-thu-doi-dau', 126, 'film_67e933f73ee43.jpg', 'film_67e933f73ee43-2022.jpg', 'https://youtu.be/fiEG-Y9vB00', 'David Leitch', 'Brad Pitt, Joey King, Andrew Koji, Aaron Taylor Johnson, Brian Tyree Henry, Zazie Beetz', 'Âu Mỹ', 2022, 'T18', 'Sát Thủ Đối Đầu Bullet Train 2022 Trong bộ phim này Brad Pitt đóng vai Ladybug, một sát thủ xui xẻo quyết tâm thực hiện công việc của mình một cách hòa bình sau khi có quá nhiều hợp đồng biểu diễn không đạt yêu cầu. Tuy nhiên, số phận có thể có những kế hoạch khác, vì nhiệm vụ mới nhất của Ladybug đưa anh ta vào một khóa học va chạm với những kẻ thù nguy hiểm từ khắp nơi trên thế giới - tất cả đều có các mục tiêu được kết nối, nhưng xung đột - trên chuyến tàu nhanh nhất thế giới. Từ đạo diễn của Deadpool 2, David Leitch, đoạn kết chỉ là khởi đầu trong một chuyến đi hoang dã, không ngừng nghỉ qua Nhật Bản thời hiện đại.', 3, '2025-03-30 19:07:19', 3, '2025-03-30 19:07:19', 1),
(153, 'Jujutsu Kaisen 0: Chú Thuật Hồi Chiến', 'jujutsu-kaisen-0:-chu-thuat-hoi-chien', 105, 'film_67e9347c223f2.jpg', 'film_67e9347c223f2-2022.jpeg', 'https://youtu.be/uLKg1Yksi3c', 'Park Seong Ho', 'Yuuichi, Kouki, Mikako', 'Nhật Bản', 2022, 'T13', 'Jujutsu Kaisen 0: Chú Thuật Hồi Chiến Jujutsu Kaisen 0: The Movie 2021 Những bất hạnh bạo lực thường xuyên xảy ra xung quanh Yuuta Okkotsu, 16 tuổi, một nạn nhân nhút nhát của nạn bắt nạt ở trường trung học. Yuuta bị đeo một lời nguyền quái dị, một sức mạnh có thể gây ra sự trả thù tàn bạo chống lại những kẻ bắt nạt mình. Rika Orimoto, lời nguyền của Yuuta, là cái bóng từ thời thơ ấu đầy bi kịch của anh và là mối đe dọa có thể gây chết người cho bất cứ ai dám sai anh ta.\r\nTình huống độc đáo của Yuuta thu hút sự chú ý của Satoru Gojou, một pháp sư quyền năng đang giảng dạy tại trường Trung học Jujutsu Tokyo. Gojou nhìn thấy tiềm năng to lớn ở Yuuta, và ông hy vọng sẽ giúp cậu bé chuyển gánh nặng chết chóc của mình thành một lực lượng tốt. Tuy nhiên, Yuuta phải vật lộn để tìm được vị trí của mình trong số những người bạn học tài năng của mình: Toge Inumaki bị câm có chọn lọc, chuyên gia vũ khí Maki Zenin và Panda.\r\nYuuta sử dụng Rika một cách vụng về trong các nhiệm vụ với các học sinh năm nhất khác, nhưng hậu quả khủng khiếp của màn thể hiện sức mạnh khủng khiếp của Rika đã thu hút sự quan tâm của người sử dụng lời nguyền tính toán Suguru Getou. Khi Getou cố gắng yêu cầu sức mạnh của Rika và sử dụng nó để loại bỏ tất cả những người không sử dụng thuật thuật trên thế giới, Yuuta chiến đấu cùng với bạn bè của mình để ngăn chặn âm mưu diệt chủng.', 3, '2025-03-30 19:09:32', 3, '2025-03-30 19:09:32', 1),
(154, 'Hạ Cánh Khẩn Cấp', 'ha-canh-khan-cap', 141, 'film_67e934d85620e.jpg', 'film_67e934d85620e-2022.jpg', 'https://youtu.be/CaIYD369OJI', 'Han Jae-rim', 'Song Kang-ho, Lee Byung-hun, Jeon Do-yeon, Kim Nam-Gil và Yim Si-wan, Park Hae-Joon', 'Hàn Quốc', 2022, 'T16', 'Hạ Cánh Khẩn Cấp Emergency Declaration 2022 là một bộ phim truyền hình kinh dị hồi hộp từ đầu đến cuối. Mang chủ đề xoay quanh một loại virus đe dọa, tác phẩm của đạo diễn kiêm biên kịch Han Jae-rim chứa đầy thông điệp đạo đức về tình người và gia đình.\r\nJae-hyuk (Lee Byung-hun) là một cựu phi công muốn đưa con trai của mình, So-min) đến Hawaii để điều trị bệnh chàm của mình. Vợ của thám tử In-ho (Song Kang-ho) cũng vậy, người đi nghỉ cùng bạn bè của anh ta.Khi ở trong nhà vệ sinh, So-min phát hiện ra rằng Jin-seok (Yim Si-wan) đã đặt một thứ gì đó vào nách của mình. Jin-seok biết điều này cũng theo So-min, bao gồm cả việc bay đến Hawaii.\r\nMặt khác, In-ho phát hiện ra Jin-seok là một kẻ tâm thần, người đã tải lên một đoạn video, tiết lộ kế hoạch thực hiện một hành động khủng bố trên máy bay. Nhưng anh ấy phát hiện ra rằng Jin-seok đã đáp chuyến bay K1501 mà vợ anh ấy cũng đang đi.\r\nChuyến bay đáng sợ\r\nKhông nói thêm gì, bộ phim mở đầu bằng sân bay Seoul nhộn nhịp, Jae-hyuk bí ẩn, đồng thời giới thiệu các nhân vật chính và xuất thân của họ để khiến anh gắn bó hơn với khán giả. \r\nCốt truyện được đóng gói với sự hồi hộp từ đầu đến cuối. Thời lượng hai giờ cảm thấy phù hợp khi xem xét số lượng nhân vật và độ phức tạp của cốt truyện được kể. Mọi thứ ngày càng dày đặc hơn với những bí ẩn liên tục hiện ra từ hàng loạt nhân vật có sức hút riêng.\r\nQuy mô lớn phim hạ cánh khẩn cấp có thể được nhìn thấy từ hàng loạt tên tuổi lớn tham gia như Lee Byung-hun, Jeon Do-yeon, và chưa kể đến Song Kang-ho, người cũng đóng vai chính trong bộ phim hài Broker (2022) đã phát sóng cách đây vài tháng.\r\nGây chú ý nhất dĩ nhiên là cựu thần tượng Yim Si-wan, người ngày càng nổi tiếng sau khi bước chân vào thế giới diễn xuất với vai chính trong bộ phim truyền hình Moon Embracing the Sun (2012). Anh ấy thể hiện nhân vật Jae-hyuk, người có vai trò lớn trong việc thể hiện ấn tượng hấp dẫn trong câu chuyện.', 3, '2025-03-30 19:11:04', 3, '2025-03-30 19:11:04', 1),
(155, 'Thần Sấm 4: Tình Yêu Và Sấm Sét', 'than-sam-4:-tinh-yeu-va-sam-set', 118, 'film_67e9354a4c1c3.jpg', 'film_67e9354a4c1c3-2022.jpg', 'https://youtu.be/PEo2LzBi4_o', 'Taika Waititi', 'Natalie Portman, Christian Bale, Karen Gillan', 'Âu Mỹ', 2022, 'T13', 'Thần Sấm 4: Tình Yêu Và Sấm Sét Thor 4: Love and Thunder 2022 Thor 4: Love and Thunder câu chuyện xoay quanh cô nàng tình cũ của anh chàng Thor là Jane Foster, cô là người phàm trần và hiện đang phát hiện bản thân mắc phải căn bệnh ung thư. Thor vì để cứu Jane Foster nên đã truyền sức mạnh của mình qua cho cô và từ đó Jane Foster dần sứng đáng và có thể cầm được cây búa, còn Thor thì mất hết sức mạnh và truyền lại danh hiệu thần sấm cho Jane Foster. Sau một vài lần sử dụng sức mạnh thần sấm đã giúp cho Jane Foster chữa trị được căn bệnh của mình.\r\nGorr , người cuối cùng trong dân tộc của anh ta, dành cả ngày phấn đấu để tồn tại trên một sa mạc cằn cỗi cùng với con gái của mình . Anh cầu nguyện thần Rapu của mình để được giúp đỡ, nhưng con gái anh sớm chết vì đói. Ngay khi bắt đầu nghe thấy một giọng nói gọi mình ở phía xa, Gorr phát hiện ra một ốc đảo, nơi anh ta tìm thấy Rapu, người đã giết người sử dụng vũ khí cổ đại mới nhất được gọi là All-Black the Necrosword . Rapu chế giễu Gorr vì sự bất lực của anh ta và từ chối hỗ trợ. Cảm thấy bị phản bội, Gorr tuyên bố thanh kiếm Necrosword và chặt đầu anh ta, đồng thời thề sẽ loại bỏ tất cả các vị thần.', 3, '2025-03-30 19:12:58', 3, '2025-03-30 19:12:58', 1),
(156, 'Thủy Chiến Đảo Hansan: Rồng Trỗi Dậy', 'thuy-chien-dao-hansan:-rong-troi-day', 129, 'film_67e9359fd8b75.jpg', 'film_67e9359fd8b75-2022.jpg', 'https://youtu.be/fF9QVa5rEHw', 'Kim Han min', 'Park Haeil, Byun YoHan, Ahn SungKi, Son HyunJoo, Kim SungKyu, Kim SungKyun, Kim HyangGi, Ok TaecYeon, Gong Myoung, Park JiHwan', 'Hàn Quốc', 2022, 'T16', 'Thủy Chiến Đảo Hansan: Rồng Trỗi Dậy Hansan: Rising Dragon 2022 là một sử thi chiến tranh lịch sử mô tả Trận chiến đảo Hansan ngoài khơi bờ biển phía nam Hàn Quốc vào tháng 7 năm 1592, nơi Đô đốc Yi Sun-sin đánh bại lực lượng lớn hơn của Nhật Bản thông qua các chiến thuật thông minh và việc sử dụng chiến hạm rùa đặc trưng của ông “Geobukseon” .\r\nPhim kể về trận đại chiến giữa Hàn Quốc và Nhật Bản tại Vịnh Hansan. Chỉ với 66 chiến thuyền, quân của Yi Sun Sin đã thành công trong việc đẩy lùi quân Nhật. Trên thực tế, quân của Yi Sun Sin không có thương vong, trong khi Nhật Bản phải mất 66 tàu chiến.\r\nTướng Yi Sun Sin là một nhân vật anh hùng của Hàn Quốc trong Chiến tranh Imjin chống Nhật Bản. Tổng cộng, đã có ít nhất 23 cuộc hải chiến mà Yi Sun Sin đã phải đối mặt. Nhân vật Yi Sun Sin do Park Hae-il thủ vai.\r\nBộ phim thủy chiến đảo hansan: rồng trỗi dậy này nối tiếp thành công của The Admiral: Roaring Current được rất nhiều người xem. Hansan: Rising Dragon đã thu về 6 triệu lượt xem kể từ khi công chiếu tại Hàn Quốc vào ngày 27/7. Đây là con số khá tuyệt vời khi chỉ trong 26 ngày phát sóng.', 3, '2025-03-30 19:14:23', 3, '2025-03-30 19:14:23', 1),
(157, 'Phi Công Siêu Đẳng Maverick', 'phi-cong-sieu-dang-maverick', 130, 'film_67e9367b5e79b.jpg', 'film_67e9367b5e79b-2022.jpg', 'https://youtu.be/WBtgo0zEuXk', 'Joseph Kosinski', 'Tom Cruise, Jennifer Connelly, Miles Teller', 'Âu Mỹ', 2022, 'T13', 'Phi Công Siêu Đẳng Maverick Top Gun: Maverick 2022 Một người đàn ông với hơn ba mươi năm phục vụ trong quân đội đang được kể về. Anh ấy là một phi công rất dũng cảm. Anh ta tìm cách tránh sự thăng tiến, vì nó khiến anh ta cảm thấy bị bó buộc và không thể trở lại là chính mình. Sau khi nói đùa với Trung úy Bradley Bradshaw, con trai của người bạn thân quá cố của mình, Maverick chuẩn bị bắt tay vào một nhiệm vụ nguy hiểm.\r\nPhi công siêu đẳng máy bay chiến đấu \"không tuổi\" được yêu thích của rạp chiếu phim trở lại với tất cả các động tác hàng không cắn đinh và những cú đấm đầy cảm xúc đã làm cho bản gốc trở thành một hit nổi tiếng của thập niên 80. Trọn vẹn 36 năm (bao gồm cả một số lần trì hoãn đường băng liên quan đến Covid) sau khi quảng cáo tuyển dụng phi công hải quân Mỹ trên màn ảnh rộng của Tony Scott trở thành một tác phẩm điện ảnh nổi tiếng trong thời đại, Tom Cruise đã trở lại làm những gì anh ấy làm tốt nhất - nở nụ cười siêu sao dễ thương / điên rồ của anh ấy và uốn nắn cơ thể già nua kỳ lạ của anh ấy trong một bộ phim bom tấn mãn nhãn mà đối với tất cả những đường nét nam nhi tuyệt vời của nó, vẫn khiến bạn phải nín thở.\r\nTừ những cảnh quay mở màn chói sáng của những chiếc máy bay lao ra khỏi tàu sân bay cho đến những cảnh quay trong Vùng nguy hiểm của Kenny Loggins , có rất ít thay đổi trong thế giới của Top Gun: Maverick - ít nhất là trên Cruise. Maverick có thể đang thử nghiệm máy bay phản lực trên sa mạc Mojave, nhưng anh ấy vẫn có áo khoác, (các) chiếc xe đạp, kính phi công và (quan trọng nhất) \"nhu cầu về tốc độ\" đã khiến anh ấy trở thành một cú hit vào năm 1986', 3, '2025-03-30 19:18:03', 3, '2025-03-30 19:18:03', 1),
(158, 'Điều Ước Cuối Của Tù Nhân 2037', 'dieu-uoc-cuoi-cua-tu-nhan-2037', 111, 'film_67e936da6a072.jpg', 'film_67e936da6a072-2022.jpeg', 'https://youtu.be/B9wYFIlMuBk', 'Mo Hong jin', 'Hong Ye ji, Kim Ji young, Kim Mi hwa, Hwang Seok jeong', 'Hàn Quốc', 2022, 'T16', '', 3, '2025-03-30 19:19:38', 3, '2025-03-30 19:19:38', 1),
(159, 'Sát Thủ Nhân Tạo (Phần 2)', 'sat-thu-nhan-tao-(phan-2)', 138, 'film_67e9373fee9a6.jpg', 'film_67e9373fee9a6-2022.jpg', 'https://youtu.be/2j_g0bmlgoQ', 'Park Hoon Jung', 'Park Eun Bi, Jo Min Soo, Kim Da Mi, Lee Jong Suk, Jin Goo', 'Hàn Quốc', 2022, 'T18', 'Sát Thủ Nhân Tạo (Phần 2) The Witch: Part 2 The Other One 2022 là một bộ phim Hàn Quốc được phát hành vào ngày 15 tháng 6 năm 2022.Bộ phim này có sự tham gia của một số diễn viên nổi tiếng như Shin Si-ah, Kim Da-mi, Jo Min-su, Lee Jong-suk và Park Eun-bin.Được biết, nữ diễn viên Shin Shi-A đã được chọn vào vai nữ chính sau khi trải qua buổi thử giọng với 1.408 người tham gia.\r\nSát Thủ Nhân Tạo Phần 2 Mẫu Vật Còn Lại Kể về câu chuyện của một cô gái tỉnh dậy trong một phòng thí nghiệm bí mật khổng lồ.Khi cô gái trốn thoát khỏi phòng thí nghiệm, cô thấy Kyung Hee đang cố gắng bảo vệ ngôi nhà của mình khỏi các băng nhóm tội phạm.Khi cô gái phải đối mặt với một tổ chức tội phạm tiếp cận nhà của Kyung Hee, cô gái đã áp đảo chúng với sức mạnh áp đảo.Trong khi đó, họ bắt đầu truy đuổi anh ta trong một phòng thí nghiệm bí mật.', 3, '2025-03-30 19:21:19', 3, '2025-03-30 19:21:19', 1),
(160, 'Lightyear', 'lightyear', 105, 'film_67e937ac3e3bf.jpg', 'film_67e937ac3e3bf-2022.jpg', 'https://youtu.be/dIsvndy9I_k', 'Angus MacLane', 'Chris Evans, Keke Palmer, Taika Waititi', 'Âu Mỹ', 2022, 'P', 'Cảnh Sát Vũ Trụ Lightyear 2022 Viết tiếp loạt series câu chuyện đồ chơi cũng có thể nói đây là phần phim Toy Story 5. Phim có diễn biến: Trong khi dành nhiều năm cố gắng trở về nhà, Space Ranger Buzz Lightyear đầy ma mãnh chạm trán với một đội quân robot tàn nhẫn do Zurg chỉ huy đang cố gắng ăn cắp nguồn nhiên liệu của anh ta.', 3, '2025-03-30 19:23:08', 3, '2025-03-30 19:23:08', 1),
(161, 'Thế Giới Khủng Long 3: Lãnh Địa', 'the-gioi-khung-long-3:-lanh-dia', 147, 'film_67e937fcd8c9c.jpg', 'film_67e937fcd8c9c-2022.jpg', 'https://youtu.be/X0Peh-AClUM', 'Colin Trevorrow', 'Laura Dern, Sam Neill, Jeff Goldblum, Chris Pratt, Bryce Dallas Howard', 'Âu Mỹ', 2022, 'T13', 'Thế Giới Khủng Long 3: Lãnh Địa Jurassic World: Dominion 2022 là bộ phim thứ ba sắp tới trong bộ ba Jurassic World và là phần tiếp theo trực tiếp của bộ phim năm 2018 Thế giới khủng long 2 vương quốc sụp đổ . Đây là bộ phim thứ sáu trong loạt phim Công viên kỷ Jura và sẽ là phần kết chotoàn bộ câu chuyện về \"Thế giới kỷ Jura\" .\r\nJurassic World: Dominion có sự góp mặt của một nhóm các diễn viên tái hiện các vai diễn của họ từ các bộ phim Jurassic Park và Jurassic World trước đó .\r\nDominion diễn ra 4 năm sau khi Isla Nublar bị tiêu diệt . Khủng long hiện đang sống — và săn — cùng với con người trên khắp thế giới. Sự cân bằng mong manh này sẽ định hình lại tương lai và xác định, một lần và mãi mãi, liệu con người có còn là kẻ săn mồi đỉnh cao trên hành tinh mà họ đang chia sẻ với những sinh vật đáng sợ nhất trong lịch sử hay không.', 3, '2025-03-30 19:24:28', 3, '2025-03-30 19:24:28', 1),
(162, 'Phù Thủy Tối Thượng Trong Đa Vũ Trụ Hỗn Loạn', 'phu-thuy-toi-thuong-trong-da-vu-tru-hon-loan', 126, 'film_67e93846eb561.jpg', 'film_67e93846eb561-2022.jpg', 'https://youtu.be/ijQGIHy88JM', 'Sam Raimi', 'Benedict Cumberbatch, Elizabeth Olsen, Rachel McAdams', 'Âu Mỹ', 2022, 'T13', 'Phù Thủy Tối Thượng Trong Đa Vũ Trụ Hỗn Loạn Doctor Strange in the Multiverse of Madness 2022 Để khôi phục một thế giới nơi mọi thứ đang thay đổi, Strange tìm kiếm sự giúp đỡ từ đồng minh của mình là Wong , Sorcerer Supreme và Scarlet Wanda, Wanda mạnh mẽ nhất của Avengers . Nhưng một mối đe dọa khủng khiếp rình rập nhân loại và toàn bộ vũ trụ mà không còn có thể được thực hiện bằng sức mạnh của riêng họ. Đáng ngạc nhiên hơn nữa, mối đe dọa lớn nhất trong vũ trụ trông giống hệt như Doctor Strange.\r\nTrong Gap Junction , một máy bay giữa các vũ trụ, America Chavez và Doctor Strange chạy đua tới Sách của Vishanti trong khi cố gắng trốn tránh một Sinh vật có dải băng . Những nỗ lực của Strange để ngăn chặn con quái vật vô ích, dẫn đến việc anh ta cố gắng đánh cắp sức mạnh du hành đa vũ trụ của Chavez, trong khi biết rằng quá trình này sẽ giết chết cô. Tuy nhiên, con quỷ đã giết Strange trong quá trình này, và Chavez, trong nỗi sợ hãi, đã vô tình mở ra một cánh cổng dẫn đến Earth-616 mà xác chết của cô và Strange rơi xuống.\r\nDoctor Strange tỉnh dậy, tin rằng tầm nhìn này là một cơn ác mộng và tiếp tục về ngày của anh ta. Anh ấy mặc trang phục để tham dự đám cưới của Christine Palmer , ở đó anh ấy hồi tưởng về khoảng thời gian họ đã ở bên nhau trước đây, nhưng Palmer khẳng định rằng mối quan hệ sẽ không thành công. Trong lễ kỷ niệm, một thực thể vô hình bắt đầu khủng bố các đường phố của New York . Strange buộc phải trả lời và tiết lộ thực thể là Gargantos , một con quái vật có xúc tu khổng lồ. Có mặt cũng là Chavez, người mà Strange nhận ra từ \"cơn ác mộng\" của mình và giải cứu cô. Wong đến hiện trường từ Kamar-Taj, và họ cùng nhau giết Gargantos bằng cách khoét mắt nó ra. Strange và Wong đặt câu hỏi cho Chavez, và cô ấy giải thích rằng những con quỷ đang săn lùng cô ấy để lấy sức mạnh của mình. Để làm bằng chứng cho những tuyên bố của mình, cô ấy đưa họ đến chỗ xác chết của Strange để chứng minh rằng \"cơn ác mộng\" của Strange thực sự là một cái nhìn của đối tác của anh ấy trên Đa vũ trụ .\r\nDoctor Strange in the Multiverse of Madness Trong Doctor Strange của Marvel Studios trong Đa vũ trụ điên rồ , MCU mở khóa Đa vũ trụ và đẩy ranh giới của nó ra xa hơn bao giờ hết. Hành trình vào thế giới vô danh với Doctor Strange , người, với sự giúp đỡ của các đồng minh thần bí cả cũ và mới, vượt qua những thực tại thay thế nguy hiểm và đáng sợ của Đa vũ trụ để đối đầu với một kẻ thù mới bí ẩn.', 3, '2025-03-30 19:25:42', 3, '2025-03-30 19:25:42', 1),
(163, 'Những Kẻ Xấu Xa', 'nhung-ke-xau-xa', 100, 'film_67e938db138d7.jpg', 'film_67e938db138d7-2022.jpg', 'https://youtu.be/STzy5Y408To', 'Pierre Perifel', 'Sam Rockwell, Craig Robinson, Richard Ayoade, Awkwafina, Marc Maron', 'Âu Mỹ', 2022, 'P', 'Những Kẻ Xấu Xa The Bad Guys 2022 The Bad Guys bao gồm thủ lĩnh Sói độc ác và các đồng đội của hắn: Cô Nhện, Ông Cá Mập, Ông Hổ và Ông Rắn. Trong quá khứ, năm người này đã từng đối mặt với những tên tội phạm chuyên trộm cắp trong thành phố. Nhiệm vụ mới mà họ thực hiện lần này sẽ khác hoàn toàn so với những lần trước, một thách thức được cho là \"quay đầu về bờ\" - trở thành công dân gương mẫu.', 3, '2025-03-30 19:28:11', 3, '2025-03-30 19:28:11', 1),
(164, 'Xe Cấp Cứu', 'xe-cap-cuu', 137, 'film_67e9392607a9a.jpg', 'film_67e9392607a9a-2022.jpg', 'https://youtu.be/hOfqZiuDhxo', 'Michael Bay', 'Jake Gyllenhaal, Eiza González, Yahya Abdul‑Mateen II, Kayli Tran', 'Âu Mỹ', 2022, 'T18', 'Xe Cấp Cứu Ambulance 2022 Michael Bay là đạo diễn và nhà sản xuất của bộ phim Ambulance. Thành phố Los Angeles là địa điểm thực hiện bối cảnh của bộ phim. Cựu chiến binh Will Sharp (do Yahya Abdul-Mateen II thủ vai) thấy mình đang ở trong một tình huống khó khăn và tìm đến người mà anh biết rằng anh không nên nhờ vả - người anh nuôi Danny Sharp. Will được Danny đề nghị tham gia cùng anh ta trong vụ cướp ngân hàng lớn nhất trong lịch sử Los Angeles. Đối diện với hoàn cảnh của gia đình, Will không thể nói không. Kịch tính càng tăng thêm khi hai anh em chạy thoát thân bằng xe cấp cứu chở một bệnh nhân bị thương nặng. Trong khi bị truy đuổi bởi cả thành phố, cố gắng cứu sống viên cảnh sát và ngăn cản ý định bỏ trốn của cô y tá, nhiều tình huống nghẹt thở, thót tim sẽ diễn ra chỉ trong một không gian.', 3, '2025-03-30 19:29:26', 3, '2025-03-30 19:29:26', 1),
(165, 'Người Dơi', 'nguoi-doi', 175, 'film_67e939b74d3ae.jpg', 'film_67e939b74d3ae-2022.jpg', 'https://youtu.be/a8oWMQzXYWA', 'Matt Reeves', 'Robert Pattinson, Zoë Kravitz, Colin Farrell, Paul Dano Riddler', 'Âu Mỹ', 2022, 'T16', 'Người Dơi The Batman 2022 Trong năm thứ hai chiến đấu với tội phạm, Batman phát hiện ra tham nhũng ở thành phố Gotham , nơi kết nối với gia đình của chính anh ta trong khi đối mặt với một kẻ giết người hàng loạt được gọi là Riddler .', 3, '2025-03-30 19:31:51', 3, '2025-03-30 19:31:51', 1),
(166, 'Trăng Rơi', 'trang-roi', 130, 'film_67e93a0d577b2.jpg', 'film_67e93a0d577b2-2022.jpg', 'https://youtu.be/grjSTCfYLG8', 'Roland Emmerich', 'Halle Berry, Patrick Wilson, John Bradley', 'Âu Mỹ', 2022, 'T13', 'Trăng Rơi Moonfall 2022 Đạo diễn \"Moonfall\" được mệnh danh là \"vua thảm họa\" vì những tác phẩm khơi gợi nỗi sợ hãi của con người trước những biến cố khó lường của thiên nhiên và vũ trụ. Từ Ngày Độc lập đến Ngày Sau Ngày mai, nhà sản xuất phim người Đức sản xuất nhiều bộ phim quy mô không chỉ dừng lại ở những sự kiện trên hành tinh chúng ta đang sống, mà mối nguy hiểm đến từ không gian.\r\nPhim Trăng rơi Thế giới đang trên bờ vực diệt vong khi một thế lực bí ẩn đánh bật mặt trăng ra khỏi quỹ đạo của nó và khiến nó bay về phía Trái đất. Giám đốc điều hành NASA Jocinda \"Jo\" Fowler hợp tác với một người đàn ông trong quá khứ của cô và một nhà lý thuyết âm mưu cho một sứ mệnh bất khả thi vào không gian để cứu nhân loại, chỉ vài tuần trước khi va chạm.', 3, '2025-03-30 19:33:17', 3, '2025-03-30 19:33:17', 1),
(167, 'Pokémon: Thám Tử Pikachu', 'pokemon:-tham-tu-pikachu', 98, 'film_67e93a7daec41.jpg', 'film_67e93a7daec41-2019.jpg', 'https://youtu.be/2B34Ojmkx0s', 'Rob Letterman', 'Ryan Reynolds, Kathryn Newton, Justice Smith, Ken Watanabe, Karan Soni, Priyanga Burford, Omar Chaparro, Ikue Ôtani, Emily Ng, Suki Waterhouse, Bill Nighy, Rita Ora, Chris Geere, Ruth Horrocks, Kadiff Kirwan,', 'Âu Mỹ', 2019, 'T13', 'Pokémon: Thám Tử Pikachu Pokémon: Detective Pikachu 2019 Pokemon: Detective Pikachu xoay quay hành trình truy tìm manh mối phá án về cái chết của Harry Goodman – thám tử mẫn cán ở thành phố Ryme của Tim Goodman và người bạn đồng hành siêu đáng yêu Pikachu. Là người duy nhất nghe được giọng nói thực của của Pikachu thay vì tiếng “Pika Pika” quen thuộc, Tim và Pikachu nhanh chóng trở thành bạn thân và cùng dấn thân vào cuộc điều tra những vụ mất tích bí ẩn trong thành phố.', 3, '2025-03-30 19:35:09', 3, '2025-03-30 19:35:09', 1),
(168, 'Gấu Đỏ Biến Hình', 'gau-do-bien-hinh', 99, 'film_67e93ae6190b5.jpg', 'film_67e93ae6190b5-2024.jpg', 'https://youtu.be/eXeEM2rVIZk', 'Domee Shi', 'Rosalie Chiang, Sandra Oh, Ava Morse', 'Âu Mỹ', 2024, 'P', 'Gấu Đỏ Biến Hình Turning Red 2022 Meilin \"Mei\" Lee là một thần đồng 13 tuổi, học sinh Canada gốc Hoa, sống ở Toronto . Miriam, Priya và Abby là những người bạn thân nhất của cô ấy và là người hâm mộ của nhóm nhạc nam 4 * Town. Ming, mẹ của Mei, luôn mong đợi sự hoàn hảo từ con gái và không chấp nhận những sở thích cá nhân của cô, họ dành cả ngày để chăm sóc ngôi đền Trung Quốc của gia đình.\r\nMột đêm sau khi gặp ác mộng, Mei đột nhiên tỉnh dậy và phát hiện ra rằng cô đã biến thành một con gấu trúc đỏ khổng lồ . Sau khi trốn cha mẹ, Mei phát hiện ra rằng cô chỉ biến đổi khi có áp lực cảm xúc cao. Sau đó, Ming phát hiện ra khi cô ấy vô tình làm cô ấy xấu hổ khi đánh nhau với một nhân viên bảo vệ trước lớp của cô ấy. Mei rời trường học và chạy đến nhà cô ấy.\r\nCha của Ming và Mei, Jin giải thích rằng mọi thành viên nữ trong gia đình họ đều được ban phép biến hình vì tổ tiên, và linh hồn gấu trúc đỏ chỉ có thể được phong ấn trong một lá bùa bằng một nghi lễ vào đêm Trăng đỏ. Bạn bè của cô ấy vô tình phát hiện ra và thích nó và thấy rằng việc tập trung vào bạn bè của cô ấy sẽ giúp không thay đổi.\r\n4 * Town sẽ đến Toronto và tổ chức một buổi hòa nhạc, tuy nhiên, Ming từ chối để Mei tham gia buổi hòa nhạc. Sử dụng sức mạnh của Mei, cô và những người bạn của cô bắt đầu quyên góp số tiền cần thiết để mua vé. Tyler, kẻ bắt nạt Mei, yêu cầu cô giải trí vào sinh nhật của anh ta. Đột nhiên, Mei phát hiện ra rằng buổi hòa nhạc sẽ diễn ra vào đêm nghi lễ. Cô ấy tức giận và giảm giá cho Tyler khi anh ta xúc phạm cô ấy, khiến lũ trẻ hoảng sợ.\r\nBà và dì của Mei đã đến để hỗ trợ nghi lễ, nhưng khi hình dạng gấu trúc đỏ của cô sắp bị phong ấn, cô quyết định giữ sức mạnh của mình và từ bỏ nghi lễ để tham gia buổi hòa nhạc tại Skydome . Thật không may, Mei đã vô tình làm vỡ lá bùa của mẹ cô trong quá trình cố gắng trốn thoát, và Ming đã biến thành một con gấu trúc đỏ khổng lồ và phá vỡ buổi hòa nhạc với ý định trừng phạt Mei. Trong khi khán giả di tản, Mei ở lại, và cô ấy và mẹ của cô ấy kết thúc cuộc chiến về việc Mei từ chối nghi lễ, kết thúc bằng việc Mei đánh mẹ cô ấy ra ngoài. Những người phụ nữ của gia đình Lee đi cùng trong hình dạng gấu trúc đỏ của họ và tiến hành giúp thiết lập một nghi lễ mới đưa Mei, Ming và những người phụ nữ khác lên máy bay trung gian. Mei tìm cách hòa giải với mẹ và quyết định giữ lại con gấu trúc đỏ của mình.', 3, '2025-03-30 19:36:54', 3, '2025-03-30 19:36:54', 1),
(169, 'Hải Tặc 2: Kho Báu Hoàng Gia Cuối Cùng', 'hai-tac-2:-kho-bau-hoang-gia-cuoi-cung', 126, 'film_67e93b5d4ef48.jpg', 'film_67e93b5d4ef48-2022.jpg', 'https://youtu.be/HgwAq98cChw', 'Kim Jeong Hoon', 'Kang Ha neul, Han Hyo joo, Lee Kwang soo', 'Hàn Quốc', 2022, 'P', 'Hải Tặc 2: Kho Báu Hoàng Gia Cuối Cùng The Pirates 2: The Last Royal Treasure 2022 2022 Một thủy thủ đoàn dũng cảm gồm những tên cướp biển và cướp biển Joseon chiến đấu với vùng nước bão tố, những manh mối khó hiểu và các đối thủ dân quân để tìm kiếm vàng của hoàng gia bị mất trên biển.', 3, '2025-03-30 19:38:53', 3, '2025-03-30 19:38:53', 1),
(170, 'Chủng Tộc Bất Tử', 'chung-toc-bat-tu', 155, 'film_67e93bc590d16.jpg', 'film_67e93bc590d16-2022.jpg', 'https://youtu.be/vHuAu8sJPY4', 'Chloé Zhao', 'Gemma Chan, Angelina Jolie, Salma Hayek, Richard Madden, Kit Harington, Barry Keoghan', 'Âu Mỹ', 2022, 'T16', 'Chủng Tộc Bất Tử Eternals 2021 \"Khi bạn yêu một thứ gì đó, bạn sẽ bảo vệ nó.\" Xem đoạn giới thiệu hoàn toàn mới cho \"Eternals\" của Marvel Studios. Phim sẽ ra rạp ngày 3/12 tại Việt Nam, sau đó bạn sẽ được trải nghiệm bộ phim trên hệ thống phimmoi ngay sau đó.\r\nTrong 5000 BC , mười superpowered Eternals - Ajak , Sersi , Ikaris , Kingo , Sprite , Phastos , Makkari , Druig , Gilgamesh , và Thena -là gửi bởi Celestial Arishem về Trái đất trên của họ phi thuyền , các Domo , để tiêu diệt các xâm lấn Deviants. Người cuối cùng trong số các Deviant bị giết vào năm 1521, và ý kiến ​​của nhóm khác nhau về trách nhiệm tiếp tục của họ và mối quan hệ của họ với loài người. Trong hơn năm trăm năm tiếp theo, họ hầu như sống xa nhau, chờ đợi sự trở lại của Arishem.\r\nHiện tại, Sersi và Sprite sống cùng nhau ở London. Sau khi Sersi bị người bạn đời Ikaris bỏ rơi nhiều thế kỷ trước, cô ấy đang có mối quan hệ với con người Dane Whitman , người làm việc tại Bảo tàng Lịch sử Tự nhiên . Bộ ba bị tấn công bởi Deviant Kro , với Ikaris đến và đuổi sinh vật đi. Nhận ra các Deviant đã trở lại, họ đi đến Nam Dakota để đoàn tụ với thủ lĩnh của họ, Ajak, chỉ để biết rằng cô đã bị giết bởi Kro.\r\nSau khi Sersi được Ajak chọn làm người kế vị, cho cô khả năng giao tiếp với Arishem, người tiết lộ rằng nhiệm vụ của Eternals không phải là chiến đấu với Deviants mà là chuẩn bị cho Trái đất cho \"Sự xuất hiện\". Arishem giải thích rằng trong hàng triệu năm, người Celestials đã gieo hạt giống của họ trên các hành tinh đông dân cư để những người Celestials mới được sinh ra, với những Deviant được họ cử đến để tiêu diệt những kẻ săn mồi trên đỉnh của mỗi hành tinh để đảm bảo sự phát triển của cuộc sống thông minh. Tuy nhiên, khi các Deviant tiến hóa và bắt đầu săn lùng các quần thể bản địa của hành tinh, người Celestials đã tạo ra các Eternals để tiêu diệt chúng. Với sự đảo ngược của Blip , [N 1] Trái đất đã đạt đến dân số cần thiết cho sự ra đời của Celestial Tiamut, điều này sẽ dẫn đến sự hủy diệt của Trái đất .\r\nSau khi học cách yêu thương nhân loại, các Eternals tập hợp lại và quyết định ngăn chặn Sự xuất hiện. Họ kết nối lại với Kingo, Thena và Gilgamesh trước khi đến nơi ở của Druig trong rừng nhiệt đới Amazon , nơi họ bị tấn công bởi Kro và Deviants. Cả nhóm tiêu diệt thành công hầu hết bọn chúng, chỉ để Kro giết Gilgamesh trước khi chạy trốn. Sau khi hỏa táng anh ta, họ đến thăm Phastos, người đã đề xuất Druig đưa Tiamut vào giấc ngủ bằng cách khuếch đại sức mạnh kiểm soát tâm trí của anh ta với Uni-Mind , một kết nối giữa tất cả các Eternals. Nhóm cũng tìm thấy Makkari, người đã sống ở Domo. Ikaris tiết lộ rằng anh đã được Ajak thông báo về Sự xuất hiện từ nhiều thế kỷ trước và, lựa chọn trung thành với Arishem, đã cho Ajak ăn Deviants sáu ngày trước để ngăn cô ngăn chặn nó, trước khi gieo xác cô trở lại nhà của mình để giả vờ là không biết. Sprite tham gia cùng Ikaris khi anh bỏ trốn vì tình yêu đơn phương của cô dành cho anh, trong khi Kingo cũng rời nhóm vì anh không muốn đối mặt với Arishem hay chiến đấu với đồng đội của mình.\r\nMakkari xác định vị trí của Sự xuất hiện dưới chân một ngọn núi lửa đang hoạt động ở Ấn Độ Dương , và trận chiến Eternals giữa Ikaris và Sprite trước khi bị tấn công bởi Kro, người sau đó bị giết bởi Thena. Druig hạ gục Sprite sau khi cô ta cố gắng giết Sersi, và các Eternals còn lại hợp tác với nhau để', 3, '2025-03-30 19:40:37', 3, '2025-03-30 19:40:37', 1),
(171, 'Encanto: Vùng Đất Thần Kỳ', 'encanto:-vung-dat-than-ky', 109, 'film_67e93c0baa3b4.jpg', 'film_67e93c0baa3b4-2022.jpg', 'https://youtu.be/Ua0s23bbOSg', 'Byron Howard, Jared Bush', 'Angie Cepeda, Diane Guerrero, Jessica Darrow, John Leguizamo, María Cecilia Botero, Stephanie Beatriz', 'Âu Mỹ', 2022, 'P', 'Encanto: Vùng Đất Thần Kỳ Encanto 2021 Trong khi trốn khỏi nhà khỏi cuộc xung đột vũ trang, một phụ nữ trẻ tên Alma Madrigal mất chồng là Pedro nhưng đã cứu được ba đứa con thơ Julieta , Pepa và Bruno . Thông qua một phép màu, một ngọn nến mà Alma nắm giữ đã được thấm nhuần phép thuật và tạo ra một \" Casita \" có tri giác cho người Madrigals sinh sống, đồng thời cung cấp nơi trú ẩn an toàn cho những người tị nạn, những người tiến hành xây dựng một thị trấn có tên là Encanto .', 3, '2025-03-30 19:41:47', 3, '2025-03-30 19:41:47', 1),
(172, 'Đấu Trường Âm Nhạc 2', 'dau-truong-am-nhac-2', 110, 'film_67e93c53e343b.jpg', 'film_67e93c53e343b-2022.jpg', 'https://youtu.be/s7shIOOV5iQ', 'Garth Jennings', 'Bobby Cannavale, Matthew McConaughey, Reese Witherspoon, Scarlett Johansson, Taron Egerton, Tori Kelly', 'Âu Mỹ', 2022, 'P', 'Đấu Trường Âm Nhạc 2 Sing 2 2021 Buster Moon và những người bạn của anh ấy phải thuyết phục ngôi sao nhạc rock ẩn dật Clay Calloway tham gia cùng họ để mở màn một buổi biểu diễn mới.', 3, '2025-03-30 19:42:59', 3, '2025-03-30 19:42:59', 1),
(173, 'Ma Trận 4: Hồi Sinh', 'ma-tran-4:-hoi-sinh', 148, 'film_67e93cb46cc2e.jpg', 'film_67e93cb46cc2e-2021.jpeg', 'https://youtu.be/jDF3H9KQJHw', 'Lana Wachowski', 'Keanu Reeves, Carrie Anne Moss, Priyanka Chopra, Jessica Henwick', 'Âu Mỹ', 2021, 'T18', 'Ma Trận 4: Hồi Sinh The Matrix Resurrections 2021 The Matrix Resurrections là phim điện ảnh  phần thứ tư trong loạt phim cùng tên, tiếp nối Ma Trận 3 The Matrix Revolutions, từ năm 2003. Để tìm hiểu xem thực tế của anh ta là một cấu tạo thể chất hay tinh thần, ông Anderson, hay còn gọi là Neo, sẽ phải chọn theo dõi con thỏ trắng một lần nữa. Nếu anh ta học được bất cứ điều gì, đó là lựa chọn, trong khi ảo tưởng, vẫn là lối thoát duy nhất để - hoặc vào - Ma trận. Neo đã biết mình phải làm gì, nhưng điều anh chưa biết là Ma trận mạnh hơn, an toàn hơn và nguy hiểm hơn bao giờ hết.', 3, '2025-03-30 19:44:36', 3, '2025-03-30 19:44:36', 1),
(174, 'Venom 2 : Đối mặt tử thù', 'venom-2-:-doi-mat-tu-thu', 97, 'film_67e93d00dac7b.jpg', 'film_67e93d00dac7b-2021.jpg', 'https://youtu.be/j2dqpq8MBBM', 'Andy Serkis', 'Tom Hardy, Michelle Williams, Naomie Harris, Reid Scott, Stephen Graham, Tom Hardy Michelle Williams Naomie Harris Reid Scott Stephen Graham Woody Harrelson', 'Âu Mỹ', 2021, 'T13', 'Venom 2 : Đối mặt tử thù Venom: Let There Be Carnage 2021 Hơn một năm sau khi các sự kiện của Venom 1 (2018), nhà báo điều tra Eddie Brock phải đấu tranh để thích nghi với cuộc sống như các máy chủ của người ngoài hành tinh symbiote Venom , mà cấp ông khả năng siêu phàm để có một vigilante gây chết người. Nỗ lực Brock để tiếp cận sự nghiệp của mình bằng cách phỏng vấn giết người hàng loạt Cletus Kasady , ai sẽ trở thành chủ nhà của symbiote Carnage và thoát tù sau khi một thi thất bại.', 3, '2025-03-30 19:45:52', 3, '2025-03-30 19:45:52', 1),
(175, 'Không Phải Lúc Chết', 'khong-phai-luc-chet', 164, 'film_67e93d8cd6428.jpg', 'film_67e93d8cd6428-2021.jpg', 'https://youtu.be/PUREfnWag9o', 'Cary Joji Fukunaga', 'Daniel Craig, Ana De Armas, Christoph Waltz, Ralph Fiennes, Léa Seydoux', 'Âu Mỹ', 2021, 'T16', 'Không Phải Lúc Chết No Time to Die 2021 Điệp Viên 007: Không Phải Lúc Chết Trong \"No Time To Die\", Bond không còn hoạt động tình báo mà đang tận hưởng cuộc sống yên bình ở Jamaica. Tuy nhiên, quãng thời gian nghỉ ngơi của anh không kéo dài được lâu khi người bạn cũ Felix Leiter từ CIA xuất hiện, cầu xin sự giúp đỡ. Bond sẽ thực hiện nhiệm vụ giải cứu nhà khoa học bị bắt cóc, và từ đó dẫn anh đến với tên ác nhân sở hữu một loại công nghệ nguy hiểm.', 3, '2025-03-30 19:48:12', 3, '2025-03-30 19:48:12', 1),
(176, 'Shang-Chi và huyền thoại Thập Luân', 'shang-chi-va-huyen-thoai-thap-luan', 132, 'film_67e93e14c1f7c.jpg', 'film_67e93e14c1f7c-2021.png', 'https://youtu.be/ccQjdsbZJ0U', 'Destin Daniel Cretton', 'Lưu Tư Mộ, Awkwafina, Lương Triều Vỹ, Trần Pháp Lai', 'Âu Mỹ', 2021, 'T13', 'Shang-Chi và huyền thoại Thập Luân Shang Chi and the Legend of the Ten Rings 2021  là bộ phim thuộc giai đoạn 4 của Vũ trụ điện ảnh Marvel. Nhân vật này được biết đến như một bậc thầy Kung Fu, tinh thông võ thuật. Sức mạnh của Shang-Chi đến từ hàng ngàn giờ luyện tập miệt mài và sự kỷ luật cao độ với bản thân. Siêu anh hùng võ thuật này được chính bố dạy dỗ để trở thành một sát thủ chuyên nghiệp và kế thừa tập đoàn tội ác của ông.', 3, '2025-03-30 19:50:28', 3, '2025-03-30 19:50:28', 1),
(177, 'Thoát khỏi Mogadishu', 'thoat-khoi-mogadishu', 121, 'film_67e93e7fd583a.jpg', 'film_67e93e7fd583a-2022.jpg', 'https://youtu.be/yz5XSicbWvQ', 'Ryoo Seung-Wan', 'Jo In sung, Koo Kyo hwan, Kim Yoon seok, Kim So jin', 'Hàn Quốc', 2022, 'T16', 'Thoát khỏi Mogadishu Escape from Mogadishu 2021 Khi Mogadishu , thành phố thủ đô của Somalia , bị nội chiến tàn phá vào năm 1991, các nhân viên và gia đình của đại sứ quán Hàn Quốc bị mắc kẹt không có phương tiện liên lạc. Đi ra ngoài đồng nghĩa với việc phải đối mặt với một trận mưa đạn và đạn pháo. Trong tình huống như vậy vào một đêm, nhân viên từ đại sứ quán Triều Tiên đã đến gặp họ để nhờ giúp đỡ. Với mục tiêu chung là trốn khỏi Mogadishu, những người từ cả hai đại sứ quán đã thực hiện một nỗ lực táo bạo để đến sân bay trong điều kiện hỗn loạn.', 3, '2025-03-30 19:52:15', 3, '2025-03-30 19:52:15', 1),
(178, 'Kong: Đảo Đầu Lâu', 'kong:-dao-dau-lau', 119, 'film_67e93f1199e46.jpg', 'film_67e93f1199e46-2017.jpg', 'https://youtu.be/WfjvbkdQ2zQ', 'Jordan Vogt-Roberts', 'Tom Hiddleston, John Goodman, Brie Larson, Cảnh Điềm, Samuel L. Jackson, Toby Kebbell, Jason Mitchell', 'Âu Mỹ', 2017, 'T16', 'Kong: Đảo Đầu Lâu Kong: Skull Island 2017 Kong: Skull Island, Kong: Skull Island (2017) Kong: Skull Island kể về con quái vật huyền thoại của Hollywood kể từ King Kong (2005). Bối cảnh phim chủ yếu ở Đảo Đầu Lâu, quê hương của vua khỉ. Kong: Skull Islands được quay ngoại cảnh tại Tràng An, Vân Long, Tam Cốc, Vịnh Hạ Long, Động Phong Nha-Kẻ Bàng và các địa điểm khác. tên quốc tế như Hawaii, Australia ...', 3, '2025-03-30 19:54:41', 3, '2025-03-30 19:54:41', 1),
(179, 'Natra Ma Đồng Giáng Thế', 'natra-ma-dong-giang-the', 111, 'film_67e93f7e37ae2.jpg', 'film_67e93f7e37ae2-2019.jpg', 'https://youtu.be/ElWKU1jei9M', 'Yu Yang', 'Yanting Lü, Joseph, Mo Han', 'Âu Mỹ', 2019, 'P', 'Natra Ma Đồng Giáng Thế Nezha Zhi Motong Jiangshi 2019 Natra Ma Đồng Giáng Thế xây dựng tạo hình Na Tra là 1 cậu bé có đôi mắt gấu trúc, miệng rộng. Vì một sự cố hoán đổi Linh Châu và Ma Viên mà từ nhỏ Na Tra đã bị họ hàng và bạn bè xa lánh. Nhưng rồi Na Tra gặp được Ngao Bính (Tam Thái Tử của Long Tộc) người duy nhất chịu lắng nghe hắn, cùng hắn chơi đùa, không ghét bỏ và hai người đã thực sự trở thành bạn của nhau. Tuy nhiên giường như số phận đã định, Na Tra sinh ra bị coi như một ma đồng, còn Ngao Bính lại là người phải tiêu diệt ma đồng đó. Bộ phim hoạt hình còn cải biên các tình tiết kinh điển như cuộc đại chiến với Ngao Bính, róc xương trả cha, róc thịt trả mẹ.', 3, '2025-03-30 19:56:30', 3, '2025-03-30 19:56:30', 1),
(180, 'Liên Minh Công Lý: Phiên bản của Zack Snyder', 'lien-minh-cong-ly:-phien-ban-cua-zack-snyder', 121, 'film_67e93ffc821c9.jpg', 'film_67e93ffc821c9-2017.jpg', 'https://youtu.be/yMiPpwfD3cU', 'Zack Snyder', 'Jared Leto, Henry Cavill, Ray Porter, Sergi Constance', 'Âu Mỹ', 2017, 'T13', 'Liên Minh Công Lý: Phiên bản của Zack Snyder Zack Snyder*s Justice League 2021 Năm nghìn năm trước, Darkseid và đội quân Parademon của anh ta cố gắng chinh phục Trái đất bằng cách sử dụng ba Hộp Mẹ . Họ bị đánh bại bởi một liên minh của Các vị thần già , Amazons , người Atlantis , con người và Green Lantern , để lại những Hộp Mẹ, được giấu riêng biệt. Hiện tại, cái chết của Superman [b] đã kích hoạt lại Boxes, thu hút Steppenwolf , trung úy thất sủng của Darkseid. Steppenwolf đặt mục tiêu giành lại sự ưu ái của Darkseid bằng cách thu thập các hộp để tạo thành \"The Unity\", biến Trái đất thành một bản sao của Apokolips, quê hương của họ.\r\nSteppenwolf chiến đấu với quân Amazons trên Themyscira và lấy Mother Box do chúng canh giữ. Diana Prince nhận được một cảnh báo từ Amazons, sau đó biết về cuộc tấn công của Darkseid trên Trái đất và Steppenwolf, thông báo cho Bruce Wayne . Cả hai tìm cách thành lập một đội metahumans để bảo vệ Trái đất. Trước đó đã thất bại trong việc chiêu mộ Arthur Curry , Bruce tìm Barry Allen , trong khi Diana tìm Victor Stone . Barry tham gia trong khi Victor từ chối cho đến khi cha anh ấy là Silas và các STAR Labs kháccác nhân viên bị bắt cóc bởi Parademons đang tìm kiếm Mother Box mà con người đã giấu. Steppenwolf bắt cóc và giết các Vệ binh Atlantean đang trông coi Hộp mẹ của họ và lấy đi nó chỉ còn lại Mera và Arthur miễn cưỡng canh giữ nó.\r\nMặc dù đội giải cứu các nhân viên bị bắt cóc, nhưng cơ sở bị ngập nước, bẫy họ cho đến khi Arthur giúp họ trốn thoát. Victor lấy lại Hộp Mẹ cuối cùng mà anh ta đã giấu. Anh tiết lộ rằng nó đã được sử dụng để xây dựng lại cơ thể của anh sau một vụ tai nạn xe hơi, giải thích rằng các Hộp có thể sắp xếp lại vật chất theo ý muốn của chủ nhân. Cả nhóm nhận ra rằng họ có thể sử dụng Chiếc hộp để hồi sinh Superman, mặc dù Steppenwolf chắc chắn sẽ phát hiện ra điều đó. Trong khi đó, Steppenwolf nhận được tầm nhìn về Phương trình Chống Sự sống , một sức mạnh bí mật được Darkseid tìm kiếm, và anh ta thông báo cho chủ nhân của mình. Một người mất trí nhớ Clark Kent được hồi sinh, nhưng lại tấn công cả nhóm. Trước khi anh ta có thể giết Bruce, Lois Lane đến và làm cho Clark bình tĩnh lại, và họ về nhà gia đình anh ta ởSmallville , nơi anh lấy lại ký ức của mình.\r\nSteppenwolf lấy được Hộp Mẹ cuối cùng, nhưng không phải trước khi Silas hy sinh bản thân để phóng nó bằng nhiệt laze, cho phép Victor theo dõi nó. Không có Superman, năm anh hùng du hành đến một thành phố bỏ hoang của Nga, nơi Steppenwolf nhắm đến việc thành lập Unity. Họ chiến đấu theo cách của họ thông qua các Parademons và Superman đến và khuất phục Steppenwolf, nhưng Victor không tách được các hộp. The Unity được hình thành, phá hủy hành tinh. Barry gia nhập Lực lượng Tốc độ trước khi sóng xung kích truyền đến anh ta, đảo ngược thời gian để cung cấp cho Victor khoản phí cần thiết cho phép anh ta và Superman tách các Hộp ra. Nhóm giết Steppenwolf, ném xác anh ta vào chân Darkseid trở lại Apokolips thông qua một cánh cổng. Darkseid thề sẽ quay trở lại Trái đất để hoàn thành nhiệm vụ của mình cho Phương trình phản sự sống.\r\nSau trận chiến, Bruce, Diana và Alfred Pennyworth đồng ý thành lập đại bản doanh của đội tại Wayne Manor . Barry nhận được một công việc trong sở cảnh sát của Thành phố Trung tâm , Victor được truyền cảm hứng bởi một tin nhắn âm thanh do Silas để lại để sử dụng khả năng của mình cho mục đích', 3, '2025-03-30 19:58:36', 3, '2025-03-30 19:58:36', 1),
(181, 'G. I. Joe 3: Xà nhãn báo thù', 'g.-i.-joe-3:-xa-nhan-bao-thu', 120, 'film_67e94084bd398.jpg', 'film_67e94084bd398-2021.jpg', 'https://youtu.be/erwq6yJUibo', 'Robert Schwentke', 'Henry Golding, Úrsula Corberó, Samara Weaving, Andrew Koji', 'Âu Mỹ', 2021, 'T18', 'G. I. Joe 3: Xà nhãn báo thù Snake Eyes: G.I. Joe Origins 2021 Một cậu bé mồ côi khi cha cậu bị sát hại. Nhiều năm sau, cậu bé đã trở thành một võ sĩ võ thuật tài năng và chết người, được thúc đẩy bởi mong muốn trả thù cho cha mình. Để che giấu danh tính thực sự của mình, anh ta tự gọi mình là \" Snake Eyes \", một cái tên được lấy cảm hứng từ việc chứng kiến ​​kẻ giết cha mình buộc anh ta phải tung một cặp xúc xắc có trọng lượng để xác định số phận của mình, giết anh ta khi anh ta lăn hai con.\r\nĐược phát hiện trong một mạch chiến đấu ngầm ở Los Angeles, một ông trùm Yakuza giàu có , Kenta, đề nghị tìm ra kẻ giết cha mình nếu Snake Eyes sẽ làm việc cho anh ta. Khi Snake Eyes được yêu cầu chứng minh lòng trung thành của mình bằng cách bắn một người đàn ông đã phản bội lòng tin của Kenta, Snake Eyes đã từ chối và thay vào đó giúp kẻ phản bội trốn thoát. Kẻ phản bội là Tommy , em họ của Kenta . Tommy và Kenta đều phù hợp để lãnh đạo gia tộc Arashikage, một xã hội ninja cổ đại dành cho việc giữ gìn trật tự và chống lại cái ác. Kenta tìm cách giết anh họ của mình, nhưng không thành công và bị trục xuất.\r\nBiết ơn Snake Eyes, Tommy đưa anh ta đến võ đường ninja của mình ở Nhật Bản và yêu cầu anh ta được nhập môn với tư cách là một thành viên. Trưởng tộc hiện tại, Sen, bà của Tommy, đồng ý để Snake Eyes trải qua ba thử thách để xác định xem anh ta có xứng đáng hay không. Người đứng đầu bộ phận an ninh của gia tộc, Akiko, ban đầu không tin tưởng Snake Eyes, nhưng anh ấy đã giành được sự tin tưởng của cô ấy bằng cách tiết lộ vụ giết cha mình và giải thích đó là lý do tại sao không có lịch sử ghi chép về anh ấy. Không hề quen biết với bất kỳ ai, Snake Eyes lên kế hoạch phản bội các đồng minh mới của mình. Âm mưu giết người và trốn thoát của Tommy được cho là do Kenta dàn dựng nhằm đưa Mắt rắn đến đủ gần để đánh cắp kho báu thiêng liêng nhất của gia tộc, \"Viên ngọc của Mặt trời\", có sức mạnh ma thuật.\r\nSnake Eyes nhận thấy bản thân ngày càng bị giằng xé giữa cảm giác tội lỗi vì đã phản bội Tommy và gia tộc của anh ta, và mong muốn trả thù quá lớn của anh ta. Anh ta vượt qua hai thử thách đầu tiên với tài năng đặc biệt của mình, nhưng thử thách thứ ba và thử thách cuối cùng đòi hỏi tinh thần của anh ta phải được kiểm tra bởi các anacondas thiêng liêng, người có thể cảm nhận được liệu anh ta có thực sự thuần khiết trong trái tim hay không. Do bí mật của Snake Eyes, những con rắn đã tấn công anh ta, nhưng Akiko đã cứu anh ta khỏi bị giết. Đối mặt với gia tộc, Snake Eyes thừa nhận rằng anh ta không hoàn toàn trung thực, nhưng cố gắng che giấu lý do thực sự mà anh ta ở đó. Kết quả là anh ta bị đuổi học.', 3, '2025-03-30 20:00:52', 3, '2025-03-30 20:00:52', 1),
(182, 'Doraemon : Tân Chú Khủng Long Của Nobita', 'doraemon-:-tan-chu-khung-long-cua-nobita', 110, 'film_67e940fd26021.jpg', 'film_67e940fd26021-2020.png', 'https://youtu.be/2vdLzk15Z0w', 'Kazuaki Imai', 'Kakazu Yumi, Subaru Kimura, Tomokazu Seki, Megumi Oohara, Wasabi Mizuta', 'Nhật Bản', 2020, 'P', 'Doraemon : Tân Chú Khủng Long Của Nobita Doraemon the 40th Movie : Nobitas New Dinosaur / Nobita no Shin Kyouryuu 2019 Năm 2020 là kỷ niệm 50 năm của Doraemon. Để kỷ niệm điều đó, chúng tôi sẽ ra mắt bộ phim Doraemon - Tân Chú khủng long của Nobita.Nobita đã gặp được một cặp song sinh khủng long đầy đáng yêu là Myuu và Kyuu.\r\nMùa xuân năm 2020- Doraemon, một bộ phim đầy phát triển trong tương lai. Câu chuyện về Tân Chú khủng long của Nobita bắt đầu từ đây.', 3, '2025-03-30 20:02:53', 3, '2025-03-30 20:02:53', 1);
INSERT INTO `phim` (`MaPhim`, `TenPhim`, `TenRutGon`, `ThoiLuong`, `Anh`, `Banner`, `Trailer`, `DaoDien`, `DienVien`, `QuocGia`, `NamPhatHanh`, `PhanLoai`, `MoTa`, `NguoiTao`, `NgayTao`, `NguoiCapNhat`, `NgayCapNhat`, `TrangThai`) VALUES
(183, 'Suicide Squad: Biệt Đội Cảm Tử 2', 'suicide-squad:-biet-doi-cam-tu-2', 132, 'film_67e9419d383c1.jpg', 'film_67e9419d383c1-2021.jpg', 'https://youtu.be/tokZfMdQDKQ', 'James Gunn', 'John Cena, Margot Robbie, Pete Davidson, Idris Elba', 'Âu Mỹ', 2021, 'T16', 'Suicide Squad: Biệt Đội Cảm Tử 2 The Suicide Squad 2 2021 Theo lệnh của sĩ quan tình báo Amanda Waller , mười ba tù nhân từ trại giam Belle Reve — cựu bác sĩ tâm thần Harley Quinn ; Nanaue lai ăn thịt người ; Thuyền trưởng tên trộm người Úc Boomerang ; sát thủ Bloodsport ; Nhà tạo hòa bình cực đoan bạo lực ; metahumans TDK . và Polka-Dot Man ; hacker máy tính Savant ; lính đánh thuê Blackguard ; cựu vận động viên Olympic Javelin ; chiến binh ngoài hành tinh Mongal ; tên cướp điều khiển chuột Ratcher 2 ; và Chồn hình người ăn thịt đồng loại—Được \"tuyển dụng\" làm Lực lượng Đặc nhiệm X để tiêu diệt Jötunheim, một nhà tù và phòng thí nghiệm cấp bậc của Đức Quốc xã ở đảo quốc Corto Maltese ở Nam Mỹ , nơi giam giữ các tù nhân chính trị và một địa điểm cho các thí nghiệm bí mật. Nhóm nghiên cứu có các thiết bị nổ trong hộp sọ của họ, có thể phát nổ bất cứ lúc nào nếu họ không tuân theo lệnh của Waller.\r\nSuicide Squad: Biệt Đội Cảm Tử 2 Được dẫn dắt bởi cấp dưới của Waller, Đại tá Rick Flag , Harley, Boomerang, TDK, Mongal, Javelin, Blackguard, Weasel và Savant được triển khai trên một bãi biển Corto Maltese để xâm nhập vào phòng thí nghiệm. Chồn dường như bị chết đuối, trong khi Blackguard cố gắng phản bội đội cho quân đội Corto Maltese nhưng bị bắn chết. Mongal bị thiêu sống khi cô đâm trực thăng, còn Boomerang chết khi bị các mảnh vỡ từ trực thăng rơi trúng. TDK và Javelin cũng bị bắn chết; Waller kích nổ thiết bị nổ của Savant khi anh ta cố gắng chạy trốn trong cơn hoảng loạn. Harley và Flag là những người sống sót duy nhất.', 3, '2025-03-30 20:04:45', 3, '2025-03-30 20:05:33', 1),
(184, 'Quá Nhanh Quá Nguy Hiểm 9', 'qua-nhanh-qua-nguy-hiem-9', 143, 'film_67e941ebd1afc.jpg', 'film_67e941ebd1afc-2022.jpeg', 'https://youtu.be/Ufhj6hGn3h4', 'Justin Lin', 'Charlize Theron, John Cena, Vin Diesel, Helen Mirren, Michelle Rodriguez, Lucas Black, Jordana Brewster, Nathalie Emmanuel, Michael Rooker, Tyrese Gibson, Sung Kang, Jim Parrack, Finn Cole, Anna Sawai, Cardi B', 'Âu Mỹ', 2022, 'T16', 'Quá Nhanh Quá Nguy Hiểm 9 Fast & Furious 9 2020 Quá Nhanh Quá Nguy Hiểm 9 Sau các sự kiện của The Fate of the Furious (2017), Dominic Toretto và gia đình phải đối mặt với Jakob, em trai của Dominic, một sát thủ chết người, người đang hợp tác với kẻ thù cũ của họ là Cipher, đồng thời là người có mối quan hệ cá nhân chống lại Dominic.\r\nFast & Furious 9 tiếp tục những gì còn dang dở ở Fast & Furious 8 khi ả hacker Cipher (Charlize Theron) kịp trốn thoát và nay tiếp tục nhắm đến gia đình Dominic Toretto (Vin Diesel) nhằm trả thù.Giữa lúc gia đình của Dominic Toretto hay còn gọi là Dom (Vin Diesel) đang sống hạnh phúc, người em trai ruột Jacob (John Cena thủ vai) của anh tái xuất, trở thành phản diện chính của phim bên cạnh Cipher.', 3, '2025-03-30 20:06:51', 3, '2025-03-30 20:06:51', 1),
(185, 'Quá Nhanh Quá Nguy Hiểm 8', 'qua-nhanh-qua-nguy-hiem-8', 136, 'film_67e94238cbe94.jpg', 'film_67e94238cbe94-2017.jpg', 'https://youtu.be/_7tF-Uf7IZY', 'F. Gary Gray', 'Vin Diesel, Dwayne Johnson, Jason Statham, Kurt Russell, Scott Eastwood, Lucas Black, Charlize Theron, Jordana Brewster, Elsa Pataky, Nathalie Emmanuel', 'Âu Mỹ', 2017, 'T16', 'Quá Nhanh Quá Nguy Hiểm 8 Fast & Furious 8 The Fate of the Furious 2017 Phim Quá Nhanh Quá Nguy Hiểm 8: Cipher - kẻ phản diện chính sẽ bắt cóc cả gia đình Mia Toretto và Bian O\'Conner, đồng thời buộc Dom phải phản bội anh ta anh em. Lần này, \"cựu phản diện\" Deckard Shaw (do Jason Statham thủ vai) cũng bất ngờ đứng về phe phải. Sở hữu kỹ năng chiến đấu tay đôi tàn bạo và đầu óc xảo quyệt, liệu đây sẽ là dấu chấm hết cho tình thế “huynh đệ tương tàn” hiện tại của nhóm hay là con dao hai lưỡi khi đối mặt với hàng loạt hiểm nguy đang chờ đón?', 3, '2025-03-30 20:08:08', 3, '2025-03-30 20:08:08', 1),
(186, 'Nhiệm Vụ Bất Khả Thi: Sụp Đổ', 'nhiem-vu-bat-kha-thi:-sup-do', 147, 'film_67e942993ddfb.jpg', 'film_67e942993ddfb-2018.jpeg', 'https://youtu.be/R2RBVsiFXmc', 'Christopher McQuarrie', 'Tom Cruise, Vanessa Kirby, Rebecca Ferguson', 'Âu Mỹ', 2018, 'T16', 'Nhiệm Vụ Bất Khả Thi: Sụp Đổ Mission: Impossible - Fallout 2018 Mission: Impossible: Fallout, Mission: Impossible - Fallout 2018 Phim Mission: Impossible: Fallout Ba năm sau Mission: Impossible - Rogue Nation, chàng điệp viên điển trai và hào hoa nhất màn ảnh rộng Ethan Hunt sẽ trở lại màn bạc vào mùa hè năm 2018. Trailer đầu tiên của Mission: Impossible: Fallout (Tựa gốc: Mission: Impossible - Fallout) vừa được nhà phát hành Paramount tung ra, ngay lập tức trở thành tâm điểm của dư luận. bởi sự trở lại của ngôi sao hành động hàng đầu thế giới Tom Cruise và những pha hành động nghẹt thở đến từ những pha hành động đặc sắc của cá nhân anh.', 3, '2025-03-30 20:09:45', 3, '2025-03-30 20:09:45', 1),
(187, 'Mật Vụ Kingsman 2: Tổ Chức Hoàng Kim', 'mat-vu-kingsman-2:-to-chuc-hoang-kim', 140, 'film_67e942ed60cca.jpg', 'film_67e942ed60cca-2017.jpg', 'https://youtu.be/UNFUYIueheI', 'Matthew Vaughn', 'Julianne Moore, Jeff Bridges, Halle Berry, Colin Firth, Channing Tatum, Mark Strong, Taron Egerton, Pedro Pascal', 'Âu Mỹ', 2017, 'T18', 'Mật Vụ Kingsman 2: Tổ Chức Hoàng Kim Kingsman: The Golden Circle 2017 Kingsman 2, Kingsman: The Golden Circle 2017 Kingsman 2: The Golden Circle 2017- Kingsman: The Golden Circle là phần tiếp theo của Kingsman: The Secret Service, Kingsman: The Golden Circle tiếp tục xoay quanh anh. Eggsy cứng đầu. Câu chuyện gốc diễn ra ở Anh, nhưng phần phim mới diễn ra ở Mỹ. Taron Egerton cũng như Mark Strong trở lại với hai vai diễn quen thuộc là Eggsy và Merlin. Người đẹp Halle Berry vào vai người đứng đầu CIA, trong khi nữ diễn viên Julianne Moore đóng vai phản diện trung tâm của phim.', 3, '2025-03-30 20:11:09', 3, '2025-03-30 20:11:09', 1),
(188, 'Robot Đại Chiến 5: Chiến Binh Cuối Cùng', 'robot-dai-chien-5:-chién-binh-cuói-cùng', 148, 'film_67e9434bed1be.jpg', 'film_67e9434bed1be-2017.jpg', 'https://youtu.be/ux21drPm_6E', 'Michael Bay', 'Mark Wahlberg, Isabela Moner, Peter Cullen', 'Âu Mỹ', 2017, 'T18', 'Robot Đại Chiến 5: Chiến Binh Cuối Cùng Transformers 5: The Last Knight 2017 Robot đại chiến 5, Transformers 5: The Last Knight (2017) Phim Transformers 5 (2017): Phần tiếp theo của robot biến hình bán chạy nhất. \"The Last Soldier\" phá vỡ những huyền thoại cốt lõi của loạt phim Transformers và xác định lại ý nghĩa của việc trở thành một anh hùng. Con người và Transformers chiến tranh, Optimus Prime ra đi. Chìa khóa để cứu tương lai của chúng ta bị chôn vùi trong những bí mật của quá khứ, trong lịch sử ẩn giấu của Transformers trên Trái đất. Trách nhiệm giải cứu thế giới đặt lên vai một đồng minh đặc biệt: Cade Yeager, người máy Bumblebee, một quý tộc người Anh, và một Giáo sư Đại học Oxford Có một khoảnh khắc trong cuộc đời mỗi người khi chúng ta được chọn để tạo ra sự khác biệt. tách rời. Trong Transformers: The Last Warrior, kẻ phản diện trở thành anh hùng. Anh hùng trở thành nhân vật phản diện. Chỉ có một thế giới có thể tồn tại: của họ, hoặc của chúng ta.', 3, '2025-03-30 20:12:43', 3, '2025-03-30 20:12:43', 1),
(189, 'Avengers: Cuộc Chiến Vô Cực', 'avengers:-cuoc-chien-vo-cuc', 150, 'film_67e943fcdc994.jpg', 'film_67e943fcdc994-2018.jpg', 'https://youtu.be/O4XbKp6kN2k', 'Anthony Russo, Joe Russo', 'Dave Bautista, Karen Gillan, Tom Holland', 'Âu Mỹ', 2018, 'T16', 'Sau chuyến hành trình độc nhất vô nhị không ngừng mở rộng và phát triển vụ trũ điện ảnh Marvel, bộ phim Avengers: Cuộc Chiến Vô Cực sẽ mang đến màn ảnh trận chiến cuối cùng khốc liệt nhất mọi thời đại. Biệt đội Avengers và các đồng minh siêu anh hùng của họ phải chấp nhận hy sinh tất cả để có thể chống lại kẻ thù hùng mạnh Thanos trước tham vọng hủy diệt toàn bộ vũ trụ của hắn', 3, '2025-03-30 20:15:40', 3, '2025-03-30 20:15:40', 1),
(190, 'Đặc Vụ Áo Đen 4: Sứ Mệnh Toàn Cầu', 'dac-vu-ao-den-4:-su-menh-toan-cau', 115, 'film_67e944ba6341d.jpg', 'film_67e944ba6341d-2019.jpg', 'https://youtu.be/BU7LV7tQMHs', 'F. Gary Gray', 'Chris Hemswort, Rebecca Fergus, Tessa Thompso...', 'Âu Mỹ', 2019, 'T13', 'Đặc Vụ Áo Đen 4: Sứ Mệnh Toàn Cầu Men in Black: International 2019 Đặc Vụ Áo Đen 4: Sứ Mệnh Toàn Cầu (Men in Black: International )\r\n\r\nBấy lâu nay, Đặc vụ Áo Đen luôn là những người hùng thầm lặng “ngầu” nhất, bảo vệ Trái Đất khỏi những hiểm họa xấu xa ngoài hành tinh. Trong cuộc phiêu lưu mới này, họ phải đối mặt với mối đe dọa mang tính toàn cầu lớn nhất từ trước đến giờ: truy tìm điệp viên hai mang ẩn mình trong tổ chức Men In Black.', 3, '2025-03-30 20:18:50', 3, '2025-03-30 20:18:50', 1),
(191, 'Pokemon Movie 19: Volkenion và Magiana Siêu Máy Móc', 'pokemon-movie-19:-volkenion-va-magiana-sieu-may-moc', 112, 'film_67e94560ab970.jpg', 'film_67e94560ab970-2016.jpg', 'https://youtu.be/0UdmviQ_6RI', 'Kunihiko Yuyama', 'Ikue Ootani, Rica Matsumoto, Mayuki Makiguchi, Yuki Kaji, Mariya Ise, Yuka Terasaki, Shinichiro Miki, Megumi Hayashibara, Inuko Inuyama', 'Nhật Bản', 2016, 'P', 'Pokemon Movie 19: Volkenion và Magiana Siêu Máy Móc Pokémon the Movie: Volcanion and the Mechanical Marvel 2016 Một Pokémon thần bí tên là Volcanion phải chấp nhận sự giúp đỡ của Ash để giải cứu Vương quốc Azoth.', 3, '2025-03-30 20:21:36', 3, '2025-03-30 20:21:36', 1),
(192, 'Điệp Viên Ẩn Danh', 'diep-vien-an-danh', 101, 'film_67e945fd8bcfa.jpg', 'film_67e945fd8bcfa-2019.jpg', 'https://youtu.be/vx7WNU_lVgg', 'Nick Bruno, Troy Quane', 'Rachel Brosnahan, Toru Uchikado, Will Smith, Mark Ronson, Masi Oka, Toshiya Agata, Ben Mendelsohn, Karen Gillan, Tom Holland, Jarrett Bruno, Claire Crosby, Hisato Masuyama, Reba Mcentire, Michi Yamato, Hiroshi Otaguro, Carla Jimenez, Tawny Newsome, R', 'Âu Mỹ', 2019, 'P', 'Điệp Viên Ẩn Danh Spies in Disguise 2019 Lance Sterling, một mật vụ tự mãn của HTUV (Honor, Trust, Unity and Valor), được cử đi để thu hồi một máy bay không người lái tấn công từ tay buôn vũ khí Katsu Kimura ở Nhật Bản . Ngay sau khi người mua, tên khủng bố được tăng cường điều khiển từ tính Killian, đến nơi, Sterling đột nhập theo lệnh của giám đốc HTUV Joy Jenkins, đánh bại Kimura và băng nhóm của hắn, rồi trốn thoát với chiếc cặp chứa máy bay không người lái. Sterling quay trở lại trụ sở HTUV để đối đầu với Walter Beckett, một sinh viên tốt nghiệp MIT và nhà khoa học trẻ bị ruồng bỏ xã hội, vì đã trang bị vũ khí phi sát thương vào bộ đồ của mình. Walter cố gắng thuyết phục Sterling rằng có một cách hòa bình hơn để cứu thế giới nhưng Sterling đã sa thải anh ta trước khi anh ta có thể giải thích phát minh mới nhất của mình: \"che giấu sinh học\".', 3, '2025-03-30 20:24:13', 3, '2025-03-30 20:24:13', 1),
(193, 'Đại Thảm Họa Núi Baekdu', 'dai-tham-hoa-nui-baekdu', 130, 'film_67e9465e21635.jpg', 'film_67e9465e21635-2019.jpeg', 'https://youtu.be/kuZ2KWEj4mI', 'Lee Hae Jun, Kim Byung Seo,', 'Lee Byung Hun, Ha Jung Woo, Ma Dong Seok, Jeon Hye Jin, Bae Suzy, Lee Sang Won, Ok Ja Yeon, Han Soo Hyun, Kang Shin Chul, Kim Shi A', 'Âu Mỹ', 2019, 'T13', 'Đại Thảm Họa Núi Baekdu Ashfall - Baekdu Mountain 2019 Núi Paektu , một ngọn núi lửa đang hoạt động nằm giữa biên giới Trung Quốc - Bắc Triều Tiên , bất ngờ phun trào, gây ra những trận động đất nghiêm trọng ở cả Bắc và Hàn Quốc . Đại dịch xảy ra trên bán đảo Triều Tiên , với nhiều vụ phun trào hơn được dự đoán trong khu vực. Để ngăn chặn thảm họa khác, Jeon Yoo-kyung ( Jeon Hye-jin ) lập kế hoạch hoạt động dựa trên lý thuyết của Giáo sư Kang Bong-rae ( Ma Dong-seok ), người đã nghiên cứu núi Baekdu và những vụ phun trào có thể xảy ra trong tương lai của nó.', 3, '2025-03-30 20:25:50', 3, '2025-03-30 20:25:50', 1),
(194, 'Biệt Đội Siêu Anh Hùng 4: Hồi Kết', 'biet-doi-sieu-anh-hung-4:-hoi-ket', 182, 'film_67e946ebc44f5.jpg', 'film_67e946ebc44f5-2019.jpg', 'https://youtu.be/q6UDgv5TGWA', 'Joe Russo, Anthony Russo', 'Robert Downey Jr., Chris Evans, Mark Ruffalo, Chris Hemsworth, Scarlett Johansson, Jeremy Renner, Don Cheadle, Paul Rudd, Benedict Cumberbatch, Chadwick Boseman, Brie Larson, Tom Holland, Karen Gillan, Zoe Saldana, Evangeline Lilly, Tessa Thompson, L', 'Âu Mỹ', 2019, 'T13', 'Biệt Đội Siêu Anh Hùng 4: Hồi Kết Avengers: Endgame 2019 Năm năm sau, vào năm 2023, Scott Lang trốn thoát khỏi Vương quốc lượng tử . [N 2] Đến được Avengers Compound , anh ấy giải thích rằng anh ấy chỉ trải qua năm giờ khi bị mắc kẹt. Theo giả thuyết Vương quốc lượng tử cho phép du hành thời gian , họ yêu cầu Stark giúp họ lấy lại các Viên đá từ quá khứ để đảo ngược hành động của Thanos trong hiện tại. Stark, Rocket và Banner, những người đã hợp nhất trí thông minh của mình với sức mạnh của Hulk, tạo ra một cỗ máy thời gian. Banner lưu ý rằng việc thay đổi quá khứ không ảnh hưởng đến hiện tại của họ; bất kỳ thay đổi nào tạo ra thực tế thay thế . Banner và Rocket đi đến Na Uy , nơi họ đến thăm khu định cư của những người tị nạn AsgardiaAsgard mới và chiêu mộ một Thor thừa cân và chán nản. Tại Tokyo, Romanoff tuyển dụng Clint Barton , người đã trở thành người cảnh giác sau cái chết của gia đình anh ta.', 3, '2025-03-30 20:28:11', 3, '2025-03-30 20:28:11', 1),
(195, 'Chiến Tranh Các Vì Sao 9: Sự Trỗi Dậy Của Skywalker', 'chien-tranh-cac-vi-sao-9:-su-troi-day-cua-skywalker', 142, 'film_67e947576bc4a.jpg', 'film_67e947576bc4a-2020.jpg', 'https://youtu.be/b-6zWzVaOz4', 'J.J. Abrams', 'Carrie Fisher, Mark Hamill, Adam Driver, Daisy Ridley, John Boyega, Oscar Isaac, Anthony Daniels, Naomi Ackie, Domhnall Gleeson, Richard E. Grant, Lupita Nyong*o, Keri Russell, Joonas Suotamo, Kelly Marie Tran, Ian McDiarmid', 'Âu Mỹ', 2020, 'T13', 'Chiến Tranh Các Vì Sao 9: Sự Trỗi Dậy Của Skywalker Star Wars: Episode IX - The Rise of Skywalker 2019 Trong một thiên hà rất xa, rất xa ... vì vậy hãy bắt đầu một vài giờ miêu tả thực sự kém cỏi về khoa học cấp trung học cơ sở hoặc thực sự là miêu tả hay về khoa học thất bại. Trong tương lai xa, con người chúng ta, nếu chúng ta vẫn ở đây, sẽ khám phá những ngôi sao lân cận với người máy chứ chưa nói đến 100 tỷ ngôi sao trong thiên hà của chúng ta và xa hơn nữa là một số thiên hà khác. Và, chúng ta sẽ không ăn mặc, nói chuyện, cư xử như những người Mỹ đầu thế kỷ 20. Bộ phim này có hiệu ứng đặc biệt CGI có thể dự đoán được giống như chúng ta đã thấy trong nhiều thập kỷ. Cùng một cuộc sống Trái đất cũ được biến đổi một cách hài hước thành cuộc sống ngoài hành tinh.', 3, '2025-03-30 20:29:59', 3, '2025-03-30 20:29:59', 1),
(196, 'Kẻ Kiến Tạo', 'ke-kien-tao', 133, 'film_67e947e961ec4.jpg', 'film_67e947e961ec4-2023.jpg', 'https://youtu.be/MLUcZfI6dbU', 'Gareth Edwards', 'John David Washington, Gemma Chan, Watanabe Ken', 'Âu Mỹ', 2023, 'T13', '(John David Washington) - 1 cựu đặc vụ lì lợm, được thuê để giết “The Creator” - kẻ được xem là đầu não của AI và đã tạo ra 1 loại vũ khí bí ẩn đủ mạnh để kết thúc cuộc chiến và quét sạch nhân loại.', 3, '2025-03-30 20:32:25', 3, '2025-03-30 20:32:25', 1),
(197, 'Nhóc Trùm', 'nhoc-trum', 100, 'film_67e9489d96f56.jpg', 'film_67e9489d96f56-2017.jpg', 'https://youtu.be/3L1zVw5fefU', 'Hendel Butoy', 'Alec Baldwin, Lisa Kudrow, Steve Buscemi, Tobey Maguire, Jimmy Kimmel', 'Âu Mỹ', 2017, 'P', 'Chuyện gì sẽ xảy ra khi một em bé tuổi đang mang tã lại mặc bộ quần áo công sở và hợp tác cùng “anh trai hờ” 7 tuổi của nhóc trong việc chống lại những âm mưu bẩn thỉu của giám đốc điều hành tập đoàn thú cưng? The Boss Baby là bộ phim hài hước dành cho gia đình với cốt truyện chưa-từng-có sẽ ra mắt tại các rạp chiếu phim toàn cầu vào 31.03.2017.', 3, '2025-03-30 20:35:25', 3, '2025-03-30 20:35:25', 1),
(198, 'Alita: Thiên Thần Chiến Binh', 'alita:-thien-than-chien-binh', 122, 'film_67e948f559d46.png', 'film_67e948f559d46-2019.jpg', 'https://youtu.be/hHarnYNDgD0', 'Robert Rodriguez', 'Christoph Waltz, Rosa Salazar, Jennifer Connelly, Mahershala Ali, Ed Skrein...', 'Âu Mỹ', 2019, 'T16', 'Alita: Thiên Thần Chiến Binh Alita: Battle Angel 2019 Alita được ví như một thần chết đến từ địa ngục vì những khả năng vượt qua mọi giới hạn mà cô sở hữu. Cô được tìm thấy bởi Tiến sĩ Ido và không thể nhớ mình là ai hay từ đâu tới. Để có thể tìm ra sự thật, Atila phải dấn thân vào những cuộc chiến đấu nảy lửa.', 3, '2025-03-30 20:36:53', 3, '2025-03-30 20:36:53', 1);
